INSERT INTO `re_recipes` VALUES (10, 'arriba baked winter squash mexican style', 'easy', '55 min', 'make a choice and proceed with recipe,depending on size of squash , cut into half or fourths,remove seeds,for spicy squash , drizzle olive oil or melted butter over each cut squash piece,season with mexican seasoning mix ii,for sweet squash , drizzle melted honey , butter , grated piloncillo over each cut squash piece,season with sweet mexican spice mix,bake at 350 degrees , again depending on size , for 40 minutes up to an hour , until a fork can easily pierce the skin,be careful not to burn the squash especially if you opt to use sugar or butter,if you feel more comfortable , cover the squash with aluminum foil the first half hour , give or take , of baking,if desired , season with salt', '2025-10-05 13:29:14', '2025-10-05 13:29:14', NULL);
INSERT INTO `re_recipes` VALUES (11, 'arriba baked winter squash mexican style', 'easy', '55 min', 'make a choice and proceed with recipe,depending on size of squash , cut into half or fourths,remove seeds,for spicy squash , drizzle olive oil or melted butter over each cut squash piece,season with mexican seasoning mix ii,for sweet squash , drizzle melted honey , butter , grated piloncillo over each cut squash piece,season with sweet mexican spice mix,bake at 350 degrees , again depending on size , for 40 minutes up to an hour , until a fork can easily pierce the skin,be careful not to burn the squash especially if you opt to use sugar or butter,if you feel more comfortable , cover the squash with aluminum foil the first half hour , give or take , of baking,if desired , season with salt', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (12, 'a bit different breakfast pizza', 'easy', '30 min', 'preheat oven to 425 degrees f,press dough into the bottom and sides of a 12 inch pizza pan,bake for 5 minutes until set but not browned,cut sausage into small pieces,whisk eggs and milk in a bowl until frothy,spoon sausage over baked crust and sprinkle with cheese,pour egg mixture slowly over sausage and cheese,s& p to taste,bake 15-20 minutes or until eggs are set and crust is brown', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (13, 'all in the kitchen chili', 'easy', '130 min', 'brown ground beef in large pot,add chopped onions to ground beef when almost brown and sautee until wilted,add all other ingredients,add kidney beans if you like beans in your chili,cook in slow cooker on high for 2-3 hours or 6-8 hours on low,serve with cold clean lettuce and shredded cheese', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (14, 'alouette potatoes', 'easy', '45 min', 'place potatoes in a large pot of lightly salted water and bring to a gentle boil,cook until potatoes are just tender,drain,place potatoes in a large bowl and add all ingredients except the\"alouette,mix well and transfer to a buttered 8x8 inch glass baking dish with 2 inch sides,press the potatoes with a spatula to make top as flat as possible,set aside for 2 hours at room temperature,preheat oven to 350^f,spread\"alouette\" evenly over potatoes and bake 15 minutes,divide between plates,garnish with finely diced red and yellow bell peppers', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (15, 'amish tomato ketchup for canning', 'easy', '190 min', 'mix all ingredients& boil for 2 1 / 2 hours , or until thick,pour into jars,i use\'old\' glass ketchup bottles,it is not necessary for these to\'seal,my amish mother-in-law has been making this her entire life , and has never used a\'sealed\' jar for this recipe , and it\'s always been great !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (16, 'apple a day milk shake', 'easy', '0 min', 'combine ingredients in blender,cover and blend until smooth,sprinkle with ground cinnamon,makes about 2 cups', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (17, 'aww marinated olives', 'easy', '15 min', 'toast the fennel seeds and lightly crush them,place all the ingredients in a bowl , stir well,cover and leave to marinate,keep refrigerated and use within 1 to 2 days', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (18, 'backyard style barbecued ribs', 'easy', '120 min', 'in a medium saucepan combine all the ingredients for sauce#1 , bring to a full rolling boil , reduce heat to medium low and simmer for 1 hour , stirring often,rub the ribs with soy sauce , garlic , ginger , chili powder , pepper , salt and chopped cilantro , both sides !,wrap ribs in heavy duty foil,let stand 1 hour,preheat oven to 350 degrees,place ribs in oven for 1 hour , turning once after 30 minutes,3 times during cooking the ribs open foil wrap and drizzle ribs with sauce#1,place all the ingredients for sauce#2 in a glass or plastic bowl , whisk well and set aside,remove ribs from oven and place on serving platter,offer both sauces at table to drizzle over ribs', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (19, 'bananas 4 ice cream pie', 'easy', '180 min', 'crumble cookies into a 9-inch pie plate , or cake pan,pat down to form an even layer,drizzle 1 cup of chocolate topping evenly over the cookies with a small spoon,scoop the vanilla ice cream on top of the chocolate and smooth down,cover with half of the sliced bananas,top with strawberry ice cream,cover and freeze until firm,before serving , top with 1 / 4 cup chocolate topping , whipped cream , and sliced bananas', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (20, 'beat this banana bread', 'easy', '70 min', 'preheat oven to 350 degrees,butter two 9x5\" loaf pans,cream the sugar and the butter until light and whipped,add the bananas , eggs , lemon juice , orange rind,beat until blended uniformly,be patient , and beat until the banana lumps are gone,sift the dry ingredients together,fold lightly and thoroughly into the banana mixture,pour the batter into prepared loaf pans,bake for 45 to 55 minutes , until the loaves are firm in the middle and the edges begin to pull away from the pans,cool the loaves on racks for 30 minutes before removing from the pans,freezes well', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (21, 'berry good sandwich spread', 'easy', '5 min', 'in medium size bowl , coarsely mash cranberry sauce,stir in sour cream and horseradish until well blended', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (22, 'better than sex strawberries', 'easy', '1460 min', 'crush vanilla wafers into fine crumbs and line a square 8\" x8\" pan,mix butter or margarine and sugar,add beaten eggs,spread the mixture over the wafer crumbs,crush strawberries and spread over sugar , egg , and butter mixture,cover strawberries with whipped cream,sprinkle with chopped nuts,chill 24 hours', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (23, 'better then bush s baked beans', 'easy', '2970 min', 'in a very large sauce pan cover the beans and bouillon cubes in 3 inches of water,bring to a boil , cover , and let sit for 1 1 / 2 hours,preheat oven to 350 degrees f,drain and pour beans into a 9\'x11\' pan,add the rest over the ingredients , stir , and bake until all the water has evaporated , about 3 hours,remove from oven , cover , and let sit overnight,preheat oven to 350 degrees f,add the next 5 cups of water , and bake until all the water has evaporated , about 3 hours,serving suggestions: challah bread , steak , hamburgers', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (24, 'boat house collard greens', 'easy', '525 min', 'put prepared greens in large pot,add water,bring to a boil , and boil for one hour,add sugar , molasses , hot sauce , whiskey , and ham hock,bring to a boil again , and boil for another hour,reduce heat and simmer for 4-6 hours,during the last hour of cooking , add a little salt to taste', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (25, 'calm your nerves tonic', 'easy', '5 min', 'combine herbs,dosage: one-half teaspoonful mixed in one-half glass of cold water , followed by a glass of hot water , one hour before each meal and upon retiring,this can be put in gelatin capsules,two no,00 capsules would contain the required amount for one dose,more can be taken with beneficial results', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (26, 'chicken lickin good pork chops', 'easy', '500 min', 'dredge pork chops in mixture of flour , salt , dry mustard and garlic powder,brown in oil in a large skillet,place browned pork chops in a crock pot,add the can of soup , undiluted,cover and cook on low for 6-8 hours', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (27, 'chile rellenos', 'easy', '45 min', 'drain green chiles,sprinkle cornstarch on sheet pan,open up chile and place on egg roll wrapper with corner facing you,place cheese stick on chile and roll up , tucking in corners and moistening edges to seal,toss in cornstarch , dusting liberally,shake off excess cornstarch and deep fry in 350 oil to cover until lightly golden and cheese just starts to ooze out,drain on paper towels and keep warm in 250 oven,serve as a side dish or appetizer with your favorite mexican meal,add your favorite condi- ments / sauces', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (28, 'chinese candy', 'easy', '15 min', 'melt butterscotch chips in heavy saucepan over low heat,fold in peanuts and chinese noodles until coated,drop by tablespoon onto waxed paper,let stand in cool place until firm', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (29, 'chinese chop suey', 'easy', '70 min', 'brown ground meat and onion in a large pot,add 1 / 4 cup of soy sauce,thinly slice the entire bunch of celery , including the leaves,add beef broth and celery,bring to a boil,reduce heat and simmer until celery is tender,add more soy sauce if needed , to taste,serve as an open face sandwich over a hamburger bun', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (30, 'cream of cauliflower soup vegan', 'easy', '110 min', 'heat the oil or margarine in a soup pot and add the onion and garlic,saute over medium heat until the onion is golden , about 10 minutes,add the cauliflower , potatoes , water , and seasonings,there should be enough broth to cover all but about an inch of the veggies,bring to a simmer , then simmer gently covered until the veggies are tender , about 25 minutes,remove from the heat transfer the vegetables from the soup pot to a food processor or blender and puree in batches until smooth,puree about half of the beans with each of the two batches of vegetables,transfer the puree back into the soup pot , stirring it back into whatever liquid remained,let the soup stand for 1-2 hours before serving , then heat through as needed,ladle into soup bowls and garnish the tops with 2-3 garnishes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (31, 'cream of spinach soup', 'easy', '45 min', 'bring water and salt to a boil,cut the potatoes in half lengthwise , and then into 1 / 2\" thick slices,boil over medium-high heat for twenty minutes,add the spinach and boil another 10 minutes being careful to not overcook in order to maintain it\'s bright green color,drain , reserving 1 1 / 4 cups cooking liquid,in a food processor , process the potatoes and spinach until very smooth , adding the butter 1 / 2 t at a time,return the puree to the pot and add the reserved liquid until the desired consistency,reheat slowly and season with salt and pepper,ladle into shallow soup plates and garnish with nutmeg or shaved cheese', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (32, 'cream of spinach soup vegan', 'easy', '55 min', 'in a 3 qt saucepan over medium high heat , saute the onions and scallions in the apple juice and oil for 5 minutes , stirring frequently,add the spinach , parsley and celery,cook for 5-7 minutes , stirring occasionally add the broth , oats , salt , thyme and pepper,bring to a boil , then lower the heat to medium,cover and simmer for 20 minutes,remove from the heat,let the soup cool for 10 minutes,working in batches , puree in a blender until thick and smooth,return to the pot,reheat and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (33, 'crispy crunchy chicken', 'easy', '35 min', 'combine soup , egg and seasoned salt in a bowl and set aside,mix together flour , cornstarch , garlic powder , paprika , salt and pepper in a resealable plastic bag,dip chicken pieces into soup mixture and turn so as to coat all over,place chicken pieces in bag with flour mixture , seal bag and shake to coat chicken,place coated pieces of chicken on a platter and allow to set until the coating becomes doughy,heat oil in a deep fryer or in a skillet over medium heat , using enough oil to cover chicken pieces when fried,once chicken is doughy , fry pieces in oil for approx 5-8 minutes or until cooked through and juices run clear,drain pieces on paper towel and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (34, 'deep fried dessert thingys', 'easy', '20 min', 'in a large bowl , mix flour , granulated sugar , baking powder and salt,make a well in the center of the flour mixture , and pour in milk , vanilla , egg and 2 tablespoons oil,mix until smooth,heat remaining vegetable oil to 400 degrees in a small deep fryer,oil is hot enough when it starts to ripple,be careful not to overheat,butter one side of each bread slice,sprinkle the brown sugar and cinnamon evenly onto the buttered side of the bread slices,make sandwiches by placing the slices of bread together with the brown sugar on the inside,cut the sandwiches into quarters,now is a good time to test the oil by dropping in a very small amount of batter,batter should sizzle and brown in about 20 seconds,oil needs to be hot enough to melt the brown sugar inside the sandwiches but not so hot that it scorches the batter,dip the sandwiches into the batter mixture,using deep fryer tongs , carefully place the battered sandwiches into the heated oil,be cautious when deep frying,try to avoid burns from splattering hot oil,remove sandwiches from the oil when they are golden brown,set aside to cool for a couple of minutes,sprinkle with powdered sugar and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (35, 'easiest ever hollandaise sauce', 'easy', '25 min', 'cut the butter into several pieces and bring to room temperature,in the top of a double boiler , combine egg yolks , lemon juice , salt and pepper,add a piece of butter,cook , stirring steadily with a wooden spoon or wire whisk , over , but not touching , boiling water,when butter melts and sauce begins to thicken , add remaining butter , stirring constantly until melted,continue cooking as sauce thickens , about 2 more minutes,immediately remove from heat', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (36, 'emotional balance spice mixture', 'easy', '10 min', 'mix the spices together and store in an airtight container,saute small amounts in butter / ghee to spice vegetables and grains', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (37, 'fool the meat eaters chili', 'easy', '40 min', 'rehydrate tvp if needed,spray or oil a large pot,chop the onion , hot peppers , and garlic and add to the pot,chop remaining vegetables , add to pot and brown lightly,add remaining ingredients,stir well and simmer at least 15 minutes,taste adjust spices to taste,simmer an additional 15 minutes or so,serve with garlic bread , toast , or on rice', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (38, 'forgotten minestrone', 'easy', '495 min', 'in a slow cooker , combine the first nine ingredients,cover and cook on low for 7-9 hours or until meat is tender,add zucchini , cabbage , beans and macaroni,cook on high 30-45 minutes more or until the vegetables are tender,sprinkle individual servings with parmesan cheese', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (39, 'fried potatoes', 'easy', '40 min', 'preheat oven to 400 degrees,cut the potatoes into strips about 2 1 / 2 inches long by 1 / 4-inch thick,soak the potatoes in ice water for five minutes,drain the potatoes , then rinse thoroughly under cold water,press between paper towels to dry,transfer potatoes to a bowl , pour melted margarine over the potatoes and toss to coat them,spray baking sheet with non-stick spray,spread potatoes onto baking sheet,bake for 15 minutes,toss and turn,bake for five minutes,add herbs and toss,bake a final five minutes until the potatoes are brown and crisp,serve immediately', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (40, 'george s at the cove black bean soup', 'easy', '90 min', 'in 1 / 4 cup butter , saute carrots , onion , celery and broccoli stems for 5 minutes,add thyme , oregano and basil,saute 5 minutes more,add wine and deglaze pan,add hot chicken stock and reduce by one-third,add worcestershire sauce , tabasco , smoked chicken , beans and broccoli florets,simmer 5 minutes,add cream , simmer 5 minutes more and season to taste,drop in remaining butter , piece by piece , stirring until melted and serve immediately,smoked chicken: on a covered grill , slightly smoke boneless chicken , cooking to medium rare,chef meskan uses applewood chips and does not allow the grill to become too hot', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (41, 'get the sensation brownies', 'easy', '70 min', 'preheat oven to 350 degrees,grease 13 x 9 baking pan,in a large bowl , whisk together butter , sugar and vanilla,add eggs and stir until well combined,combine dry ingredients and blend well with wet ingredients,reserve 2 cups of batter and set aside,spread remaining batter in prepared pan,arrange peppermint patties in a single layer over batter , about 1 / 2 inch apart,carefully spread reserved 2 cups of batter on top,bake for 50- 55 minutes or until brownies begin to pull away from sides of pan,cool completely on wire rack and cut into squares', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (42, 'global gourmet taco casserole', 'easy', '55 min', 'heat oven to 375 degrees,brown ground beef and onion over medium heat,drain,stir in tomato sauce , taco or other sauce , salt , pepper , tabasco , chiles , and cornmeal , adjusting for\"hot\" taste preference and desired thickness,stir in more cornmeal , if desired,stir in corn and olives,transfer mixture to casserole dish,cover and bake for 30 to 40 minutes , or until bubbly and heated through,top with cheese immediately on removing from oven so cheese melts,garnish with corn chips just before serving to keep them crisp,serve with a cool fresh vegetable such as cucumber slices , avocado , or lettuce leaves , if desired', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (43, 'grilled ranch bread', 'easy', '13 min', 'cream the butter with the dressing mix,spread evenly on the bread halves,place under the broiler for 2-3 minutes , until golden and the butter begins to seep and bubble,serve hot', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (44, 'grilled venison burgers', 'easy', '26 min', 'in bowl , mix dry ingredients,add venison and mix well,add liquid ingredients and mix well with a fork , until bread crumbs are barely noticeable,on plastic wrap , form into 8 patties , making them round and very flat-- like a fast-food burger,they can be cooked immediately , but i prefer to freeze them first,place them on a large cookie sheet and freeze them several hours,remove from freezer and place waxed paper between each burger as you stack them,i stack them in 2 1-quart freezer zip-lock bags,preheat cast iron skillet to very hot,cook frozen burgers until they are slightly charred on one side and then turn and cook until the other side is slightly charred and burgers are medium-well,do not overcook,turn burner off and leave burgers in the pan while you put condiments on your hamburger bun,if cooking thawed burgers , cook about 2-3 minutes per side', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (45, 'healthy for them yogurt popsicles', 'easy', '10 min', 'mix all the ingredients using a blender,pour into popsicle molds,freeze and enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (46, 'homemade vegetable soup from a can', 'easy', '12 min', 'combine all ingredients in large pot,bring to a boil and simmer for 3 minutes,serve,i use the tomatoes that come flavored with basil , oregano , and garlic,you can substitute whatever vegetables you like,if you don\'t want to use the zucchini , add a can of tomato sauce to give it some substance', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (47, 'how i got my family to eat spinach spinach casserole', 'easy', '50 min', 'preheat oven to 350 degrees,place spinach in strainer and squeeze all extra liquid from it,in a large bowl , combine spinach with the rest of ingredients , except croutons , and combine well,pour into a 2 quart casserole dish and top with croutons,bake for 35 to 40 minutes , or until bubbling around edges', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (48, 'i can t believe it s low fat creamy potato salad', 'easy', '30 min', 'cut potatoes into 1 / 2\" pieces,place in medium saucepan,add water to cover,bring to a boil,cover , reduce heat , and simmer 15-20 minutes or until tender,drain and cool,combine potato , chopped green onion , and pimemto in a large bowl,toss gently,combine mayonnaise and next 9 ingredients,stir well,add to potato mixture , tossing gently to coat,cover and chill', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (49, 'i can t believe it s spinach', 'easy', '30 min', 'combine all ingredients in a large bowl and mix well,shape into one-inch balls,cover and refrigerate or freeze until ready to bake,preheat oven to 350 degrees,place on ungreased baking sheet and bake until light brown', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (50, 'i don t feel like cooking tonight casserole', 'easy', '45 min', 'brown onion and meat in the oil , drain any excess moisture,remove from heat and add both cans of soup and the veggies of your choice and stir,salt and pepper to taste,pour mixture into a greased 9x9 inch baking pan,spoon the prepared cornbread mix over the top and spread even,bake in a preheated 350 degree oven for 35-45 minutes , or until cornbread is done', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (51, 'i stole the idea from mirj sesame noodles', 'easy', '18 min', 'in a large pot , cook your angel hair pasta until almost al dente,drain well , put in a bowl and set aside,in a small tupperware container with a lid , mix sesame oil , soy sauce , honey , garlic and sesame seeds,put the lid on the container and shake , shake , shake it like a polaroid picture,pour the sauce over the angel hair and toss well,the heat of the pasta will cook the garlic a bit so it won\'t be totally raw,mix in the green onions and stir fry veggies,serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (52, 'i yam what i yam two muffins', 'easy', '35 min', 'preheat oven to 375 degrees,add the brown sugar , flour , cinnamon to a small bowl and cut in softened butter,when mixture is well mixed stir in chopped pecans,set aside,spray a 12-muffin tin with non-stick cooking spray and set aside,combine the flours , cocoa , baking powder , cinnamon , cloves , baking soda , and salt,lightly beat eggs with honey , sugar , oil , mashed yams and orange juice,add the egg mixture and buttermilk alternately to the dry ingredients , stir until well blended,add orange peel to batter mixing well,spoon batter into prepared muffin tins , sprinkle lightly with strussel topping and bake in preheated oven for 15 to 20 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (53, 'i yam what i yam muffins', 'easy', '45 min', 'preheat oven to 375 degrees,spray muffin tin with non-stick cooking spray and set aside,place the raisins in a small bowl and pour the 1 / 4 cup boiling water over them,cover and set aside while preparing batter,combine the flours , cocoa , baking powder , cinnamon , cloves , baking soda , and salt,lightly beat eggs with sorghum , oil , mashed yams and orange juice,add the egg mixture and buttermilk alternately to the dry ingredients , stir until well blended,drain the raisins and add to batter along with orange peel,spoon batter into prepared muffin tins , sprinkle 1 / 4 to 1 / 2 tsp of granulated sugar over each muffin,bake in preheated oven for 15 to 20 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (54, 'immoral sandwich filling loose meat', 'easy', '35 min', 'brown the meat & drain fat,stir in sugar , mustard , beer , cayenne , garlic and salt & pepper to taste,simmer until liquid has mostly cooked away,lay slices of cheese over top of meat , then cover for about 5 minutes , with heat on very low , until cheese has melted,stir cheese into meat,serve hot , on sandwich buns or bread , or over hot potatoes or rice', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (55, 'italian sandwich pasta salad', 'easy', '25 min', 'cook pasta and set aside,place onions , dill pickles , olives , water chestnuts , chives and peppers in a bowl,add oil , vinegar and spices,marinate for 15-20 minutes or so,add pasta , tomatoes , meat and cheese and toss lightly,serve cold', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (56, 'italian fries', 'easy', '15 min', 'deep fry french fries according to package directions,drain well on paper towels , and transfer to a serving platter,season with salt and pepper , then sprinkle on remaining ingredients,serve with your favorite condiments', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (57, 'italian gut busters', 'easy', '45 min', 'lay out sandwich rolls on jelly roll pans / cookie sheets,melt butter , mix in italian dressing mix,using a pastry or bbq brush , graciously apply seasoned butter to the top of the\"bottom bun\" and the top of the top bun,don\'t miss this step , i don\'t know why , but it does make a difference !,here is where i create an assembly line w / the bottoms of the buns,layer each bun w / ham , then swiss cheese , turkey , then cheddar cheese , pepperoni , then mozzerella cheese,place\"lids\" on buns and place in 425 degree oven for approximly 12-15 minutes , or until you see the tops start to turn golden brown', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (58, 'jeanne s style birthday cake', 'easy', '230 min', 'to prepare base , cut shortening into dry ingredients , mix well,pat firmly and evenly into an 8 inch square pan and bake at 350 deg,f,for 10-12 minutes,cool,for cake: cream shortening , and sugar,add eggs and vanilla , beating well until fluffy,sift flour , baking powder and salt together,add to creamed mixture alternately with milk,pour batter into a greased and floured 8 inch square pan,bake at 350 deg,f for 25 - 40 minutes,frosting: in small saucepan , stir tog,milk and flour,cook , stirring constantly , until mixute is thickened and smooth,cool,on highest speed of mixer , beat cooled flour mixture with butter , shortening and vanilla until smooth and fluffy,blend in icing sugar and salt,continue beating until frosting is very fluffy,this will take at least 15 minutes,to assemble cake: place shortbread base on serving plate,spread with small amount of frosting,place cake on base,cover top and sides of cake with remaining frosting,if desired , garnish sides of cake with shaved semi-sweet chocolate', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (59, 'jiffy extra moist carrot cake', 'easy', '50 min', 'preheat oven to 350 degrees,mix together the cake mix , pudding , nutmeg and cinnamon,add eggs , oil and water to this mixture,mix on medium speed for 1 minute,add the pineapple , carrots , pecans and coconut,blend well,pour into a greased 9 inch round cake pan,bake 25 to 30 minutes , until tooth pick inserted in the center comes out clean', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (60, 'jiffy roasted corn and jalapeno cornbread', 'easy', '35 min', 'melt butter in a saut pan,add the corn , onion and red pepper and saut on medium heat until some of the corn kernels start to turn golden brown,whisk egg , corn liquid , and cream together,stir into corn muffin mix with a fork,stir in diced jalapenos and cheddar cheese,quickly stir in hot sauted corn and onion mixture , just mixing in slightly,pour into 8 x 8 buttered baking dish,bake at 350 for 15 minutes,remove cornbread , turn off oven , drizzle cornbread with honey and put back in hot oven for 5 minutes,remove from oven and let stand for 10 minutes before serving', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (61, 'keep it going german friendship cake', 'easy', '14450 min', 'mix starter ingredients in a bowl and let stand at room temperature undisturbed for 24 to 36 hours,place starter in a medium bowl and combine it with the\"first day\" ingredients,cover and refrigerate,stir once a day for 5 days,on the 5th day , place in a larger bowl and add the\"fifth day\" ingredients,cover and refrigerate,stir once a day for 5 more days,remove 3 separate cups of starter and give each cup to 3 friends with the recipe and instructions,preheat oven to 350 degrees,combine all of the\"tenth day\" ingredients with the remaining mixture,pour into a greased and floured 9 x 13\" pan,combine topping ingredients and sprinkle on top,bake for 40- 50 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (62, 'killer lasagna', 'easy', '90 min', 'brown the sausage and ground meat and drain all the fat,add all the other ingredients for the meat filling and simmer on the stove , uncovered , for about 1 / 2 hour,i usually add a bay leaf or two,mix up the cheese filling and set aside in fridge until ready to use,put the noodles in salted water and cook until soft when poked with a fork,when the noodles are done , drain the noodles and rinse off with cold water so they can be handled easily,spray the baking pan with a non-stick spray and put a layer of noodles down on the bottom of the pan,it is ok to cut some of the noodles to fit into the pan if they do not fit whole,spread half the cheese filling over the noodels , then half of the mozarella cheese on top of that , then half of the meat sauce over the grated mozarella cheese,repeat layers and then top with more mozarella cheese,bake at 375 degrees for 30 minutes,let stand for 10 minutes before cutting into it,leftovers can be easily stored in the freezer', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (63, 'kitchen sink egg bake', 'easy', '70 min', 'preheat oven to 325,thaw spinach , and squeeze out as much moisture as possible,beat the eggs in medium bowl,stir in the cottage cheese , grated cheese , spinach and seasonings,stir until mixed thoroughly,lightly spray glass 13x9 pan w / olive oil or pam,distribute meat / chicken / ham evenly over bottom of pan,pour cottage cheese mixture over meat,push w / spatula to distribute evenly,top with extra grated cheese if desired,sprinkle top w / toasted wheat germ,bake 45-50 minutes , until set and slightly brown at edges,let sit a few minutes out of oven before serving,serve hot or at room temperature', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (64, 'land of nod cinnamon buns', 'easy', '35 min', 'before you turn in for the night , grease a 10\" bundt pan and add frozen rolls,sprinkle with brown sugar , pudding powder , cinnamon and raisins,pour melted butter over all,cover with a clean , damp cloth,off to bed you go !,in the morning , preheat oven to 350 and bake for 25 minutes,let sit for 5 minutes and then turn out on a serving plate', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (65, 'leftovers spaghetti sauce', 'easy', '40 min', 'i had previously browned and drained the ground beef and had it in the fridge , if you don\'t have this leftover , brown ground beef first in a nonstick skillet , drain off fat really well,i use a pile of paper towels to soak up the fat,place ground beef in a large pot,stir in all other ingredients except the sugar,bring to a boil , stirring occasionally,turn heat down to low and simmer uncovered or covered for about 30 minutes or so to let the flavors mix , stirring occasionally,taste the sauce now and then and add more onions or garlic to taste,add a little sugar to neutralize the acidity of the tomatoes during the simmering,serve over hot spaghetti noodles,the sauce should be fairly thick , not runny , so as you add in the ingredients , use more or less of the prego as needed,if too thick , add a little water , more prego , or more stewed tomatoes with juice,when i made mine , it was the consistency of chili,this makes a pretty decent batch , can feed 2-4 depending on how much everyone eats in a serving', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (66, 'love is in the air beef fondue sauces', 'easy', '25 min', 'honey mustard sauce: whisk all the ingredients together serve warm or cold,easy bbq sauce: combine all ingredients in a pot& cook over low heat until the sugar is dissolved,serve warm or cold,garlic dill sauce: mix all the ingredients and chill until ready to serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (67, 'make it your way shortcakes', 'easy', '25 min', 'pre-heat the oven to 450,sift together the flour , salt and baking powder,mix in the sugar,cut in the butter with a fork until meal-like crumbs form,lightly beat the egg in a separate bowl,add the milk,add to the flour mixture,briefly knead on a floured board,roll out to 1 / 2 inch thick,cut into 2\" squares,place on a greased baking sheet and cook for 10 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (68, 'make that chicken dance salsa pasta', 'easy', '30 min', 'heat oil in a frying pan and saut the onions and mushrooms until soft , about two minutes,add the water , tomatoes , garlic , oregano , basil , parsley and hot sauce,simmer over low heat for 6-10 minutes or until tomatoes are soft and enough water has evaporated to form a relatively thick sauce,add salsa and chicken,simmer until heated through,cook pasta of your choice until al dente,serve sauce over hot pasta , top with parmesan cheese and freshly ground black pepper', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (69, 'marijuana vinegar', 'easy', '20160 min', 'mix the herbs and vinegar together in a jar,seal and leave in a warm place for 2 weeks , shaking often,strain the vinegar through cheesecloth and then through coffee filter paper,pour into sterilised bottles and add 2-3 sprigs of fresh herb to each bottle,seal with acid-proof lids or bottle tops', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (70, 'mennonite corn fritters', 'easy', '15 min', 'combine eggs , flour , baking powder , salt& pepper with the corn,mix thoroughly,add cream to mixture,melt fat in frying pan& drop corn mixture by spoonfuls into the hot fat,brown on both sides,serve w / syrup', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (71, 'mexican pasta', 'easy', '25 min', 'boil pasta as directed on package,drain and put in large serving bowl,mix picante sauce , milk , and cheese soup in a smaller bowl until creamy,heat in microwave until warm,mix sauce and pasta together and garnish with olives and jalepenos if desired', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (72, 'mock a mole low fat guacamole', 'easy', '15 min', 'thaw peas by running hot water over them in a strainer until they are bright green,puree peas in food processor,add 1 / 4 of one avocado , salt , and juice of one lemon or lime,puree again and transfer to a bowl,coarsely mash the remaining avocado and stir in tomato and onion,taste and add more salt / lemon to your taste,stir in cilantro', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (73, 'momma s special marinade', 'easy', '10 min', 'depending on how much meat i have i usually have to either double or triple this recipe the longer your meat marinates the better it tastes,this recipe was originally for salmon , but i think it can be used universally,i\'ve also used this same recipe for steak and chicken,it is wonderful', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (74, 'more more apple pear jigglers', 'easy', '125 min', 'in a food processor or blender , process the gelatin and milk for 30 seconds or until gelatin is disolved and mixture is smooth,add the cream cheese and yogurt and process for 10 seconds,add the fruits and blend until thoroughly pured,spray an 8-inch square baking pan with nonstick spray,pour gelatin mixture into pan and chill until firm,once chilled , cut into squares or creative shapes using cookie cutters and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (75, 'mr grant you took half veal prince orloff', 'easy', '120 min', 'preheat oven to 325,dry the veal on paper towels,place in a heavy casserole just large enough to hold the veal easily,place the casserole over moderately high heat with the butter and oil,when you see the butter foam begin to subside , brown the veal lightly on all sides,this takes 10 to 15 minutes,remove the veal,if the browning fat has burned , pour it out and add butter,stir in the vegetables and herb bouquet , cover and cook over low heat for 5 minutes with out browning,sprinkle salt and pepper over the veal,return it to the casserole and baste with the butter in the casserole,insert meat thermometer,lay the blanched bacon over the meat , then cover with foil,cover the casserole and set in lower third of preheated oven,regulate heat so meat cooks slowly and steadily for about 1-1 / 2 hours,baste it 2 or 3 times with the juices in the casserole,the roast is done at a thermometer reading of 175 degrees , or as soon as it\'s juices run clear yellow when the meat is pricked deeply with a fork,place the veal on a hot platter and discard trussing strings,the veal and vegetables will have produced a cup or more of juice in the casserole,remove all but 2 tablespoons of fat from them,set casserole over moderate heat while scraping up any coagulated cooking juices from the bottom and sides with a wooden spoon , and mashing the vegetables into the liquid,boil down rapidly if necessary,you should have 3 / 4 to 1 cup,correct seasoning , and strain into a hot gravy boat,garnish the meat platter with whatever vegetables you have chosen , and serve,if you are not serving immediately , return the veal and sauce to the casserole , cover partially , and set in a turned-off hot oven where it will stay warm for half an hour at least', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (76, 'munch without guilt tomatoes', 'easy', '10 min', 'put a slice of tomato on each biscuit / cracker,smear with little mayo and sprinkle black pepper,munch without guilt !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (77, 'my muffuletta sandwich', 'easy', '20 min', 'mix everything in food processor,chop fine for spread,refrigerate until ready to use', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (78, 'never weep whipped cream', 'easy', '5 min', 'whip all ingredients together until firm peaks form,cover leftovers tightly , preferably in an air-tight plastic container,this stays the same consistency until used,it will keep for a week in the fridge without deflating', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (79, 'no bake cookie crumble cheesecake', 'easy', '135 min', 'in blender , sprinkle gelatin over cold milk,let stand 2 minutes,add hot milk and process at low until dissolved , about 2 minutes,add cream cheese , sugar and vanilla and process until blended,arrange mini chocolate chips in the bottom of the crust,pour in gelatin mixture,sprinkle with your favourite crushed cookies,chill until firm , about 2 hours', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (80, 'now and later vegetarian empanadas', 'easy', '90 min', 'in a pot , cover carrots with water to cover,bring to a boil , then lower heat,simmer 10 minutes or until just tender,while simmering carrots , pour contents of can of tomatoes into a bowl and squish into little pieces with your hands,wash hands,blend chili powder , cumin , oregano , and cayenne into tomatoes,take the 2 tbs of flour and blend with 1 / 4 cup cold water in a small cup,pour this into tomato mixture and stir to blend,drain carrots , and cut into 3 / 4 in pieces,put both aside for now,melt butter on medium heat in a large fring pan,add onion , mushrooms , zucchini , celery , green pepper , and garlic and saute,stir continuously until onion is limp,stir tomato mixture into frying pan and bring to a simmer,cover and simmer for 2 or 3 minutes , then uncover and cook for about 5 minutes over med-high heat until liquid has evaporated,stir in carrots and cheese,salt to taste,when cheese has melted put pan in refrigerator to quickly cool vegetables,stir now and then to help cool faster,now , begin empanada crust,resift flour with baking powder in a bowl,quickly cut butter and shortening into bowl until it looks like a coarse meal,make a well in the center,add soy sauce and cold water together,stir vigorously with a fork until dough follows the fork around bowl,personal observation: the dough seems rather\"frothy\" at this point,turn dough onto a lightly floured surface and knead gently for about 10 folds to remove stickyness,divide dough into 8 equal pieces,make into a ball and roll into an 8 inch circle,spoon about 3 / 4 cup vegetable filling onto center of circle,moisten edges of circle with water and bring together at top , pinching and fluting edges,mine looked like balls of dough and turned out fine,lift empanada onto ungreased cookie sheet,repeat until done,if you fill more than one cookie sheet put the full one in the refrigerator,when done , prick the top of each empanada with a fork and brush with egg and water mixture,if you are going to cook some of them right away , pre-heat oven to 400 and cook 25 to 30 minutes on an ungreased cookie sheet,take the ones for later and freeze uncovered on cookie sheet overnight,when frozen solid wrap in foil or put in freezer bags,label with instructions: bake uncovered in pre-heated 425 degree oven for 30 minutes,let cool some before serving', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (81, 'off the cob freezer corn', 'easy', '120 min', 'preheat oven to 325f,shuck ears of corn,rinse to remove silks,place on paper towels to drain,using an angel food cake pan and electric knife , stand each ear on tube part of pan and cut corn off cob,your cuttings will fall neatly into the pan,as the cake pan fills , empty into large roaster pan,season with salt and pepper to your taste,cube butter and distribute onto corn in roaster pan,pour half and half throughout corn,roast for 1 hour , stirring gently every 15 minutes,allow to cool for half an hour,label freezer bags with contents , quantity and date,ladle into bags at portions suitable for your personal use,stack neatly in freezer for later use', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (82, 'one bowl perfect pound cake', 'easy', '70 min', 'preheat oven to 325 degrees and grease and flour a tube or bundt pan,combine all ingredients in a large bowl and blend at low speed,beat 3 minutes at medium speed,pour into prepared pan,bake for 1 hour or until top springs back when touched lightly in center,cool in pan for about 15 minutes then remove and cool completely on rack,serve plain or glaze if you like', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (83, 'one pot brownies', 'easy', '40 min', 'melt chocolate and butter in heavy pot,let cool slightly , then add sugar and mix well,add eggs , mix well , then beat in flour,add vanilla,add nuts or raisins , if desired,stir well,bake in 9 1 / 2 x 13 inch greased pan for 20-25 minutes at 375 degrees,do not overbake', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (84, 'open sesame noodles', 'easy', '28 min', 'cook pasta in salted water until al dente,drain,steam broccoli , set aside,whisk next 6 ingredients together in large serving bowl,add hot pasta,stir in onions , broccoli , and chicken,toss in cilantro,sprinkle on sesame seeds', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (85, 'philly waldorf salad', 'easy', '60 min', 'combine softened cream cheese , orange juice , orange rind and sugar , mixing until well blended,add remaining ingredients,mix lightly,chill', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (86, 'pick me up party chicken kabobs', 'easy', '30 min', 'combine all ingredients in a non-reactive bowl,cover and refrigerate overnight,place the chicken on skewers,grill until tender,serve warm', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (87, 'pizza stuffed potato', 'easy', '25 min', 'preheat oven to 450 degrees,cut potato in half lengthwise,scoop out pulp from potato halves into a bowl , leaving 1 / 4-inch-thick shells,mash pulp and reserve shells,add 1 ounce mozzarella cheese , the tomato sauce , ricotta cheese , oregano and garlic powder to potato pulp and stir to combine,spoon half of potato mixture into each reserved shell,top each with half of the remaining mozzarella cheese and half of the parmesan cheese,set potato shells in 1-quart casserole and bake until thoroughly heated , about 10 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (88, 'pour over anything mushroom gravy', 'easy', '20 min', 'in a small saucepan , saut onion and mushrooms in a small amount oil,mix dissolved cornstarch into a cup of vegetable broth,slowly add to onions and mushrooms,add the other ingredients too,check the seasonings and cook gently until thickened,use on vegetables , over cooked rice or noodles , in casseroles , or over mashed potatoes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (89, 'put down your fork tuna and bean salad', 'easy', '120 min', 'in salad bowl , combine oil , vinegar , garlic , salt , basil and black pepper,add beans , tuna , scallions and sweet pepper and toss,chill several hours for flavors to blend,to make a beautiful presentation , serve on a leaf of bibb lettuce', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (90, 'real italian bolognese sauce', 'easy', '160 min', 'in a dutch oven or medium size pot , heat butter and olive oil over medium heat until butter begins to froth,add onion , celery , carrot , garlic , and bacon,cook until onions are translucent,remove bacon and remove fat,chop lean portions of bacon in small pieces and return to pot,add ground beef and ground pork , and cook until meat loses red , raw color,raise heat and add wine and consomme,cook sauce until wine and consomme are mostly evaporated,turn heat down to simmer and add oregano , salt , pepper , sage , red pepper flakes , and nutmeg,let cook for approximately 20 minutes,add crushed tomatoes and bring heat to a boil,once the mixture comes to a boil , return to simmer,let sauce simmer partially covered for about 2 to 4 hours , stirring occasionally to prevent sticking,about 5 to 10 minutes before serving , add milk,sauce can now be added to cooked penne pasta , spaghetti or many other pastas to your liking,remaining sauce may be frozen for up to two months for future use', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (91, 'red hot applesauce', 'easy', '135 min', 'core the apples , but it isn\'t necessary to peel them,i like the texture of having the peels in the sauce,dice them very fine,tumble everything into a large pot and bring to a boil,reduce to the slowest simmer you can arrange on your stove so the sauce won\'t burn on the bottom of the pot,cover , stirring occasionally , until you reach the consistency you want,the longer , the finer texture,i usually cook it about 3 hours', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (92, 'red macaroni salad', 'easy', '1470 min', 'in large mixing bowl , combine your macaroni& diced veggies,in another bowl , combine sauce ingredients , blending well,pour sauce over the macaroni& vegetables,mix well& chill,this can be made up to a day before for fullest flavour,great for a bbq !,may be kept 3-4 days in refrigerator', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (93, 'rich hot fudge cake', 'easy', '45 min', 'combine flour , sugar , 2 t cocoa , baking powder , and salt,stir in milk , oil , and vanilla until smooth,spread in an ungreased 9\" square pan,combine brown sugar and remaining 4 t cocoa,sprinkle over batter,pour hot water over all,do not stir,bake@ 350 for 35-40 min,serve warm or cold with vanilla ice cream,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (94, 'rise and shine german fruit pancake', 'easy', '45 min', 'preheat oven to 450 degrees,with an electric mixer or wire whisk , beat eggs until frothy,whisk in flour,stir in milk and salt,melt butter in a 10-inch oven-proof skillet,pour mixture into hot skillet and place in preheated oven,bake 15 minutes or until pancake is puffed and golden,the center will be shaped like a bowl,remove from oven,fill with fruit , dust with powdered sugar and sprinkle with almonds,serve immediately', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (95, 'say what banana sandwich', 'easy', '5 min', 'spread a tablespoon on one side of each slice on bread,peel and cut the bananas into 1 / 4-inch round slices,lay the slices on two of the slices of bread and then top with the other half,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (96, 'smells like sunday chicken fricassee with meatballs', 'easy', '90 min', 'first of all make the meatballs by combining all the meatball ingredients in a bowl , mixing well,shape mixture into 1 1 / 2 inch balls and brown in a single layer in the oil , over medium high heat , turning occasionally , until well browned on all sides , about 7 to 8 minutes,alternatively meatballs can be browned in a hot oven,remove from the skillet and drain on paper towels,wipe the skillet clean,wash chicken and pat dry,in a shallow bowl , combine the 3 / 4 cup flour , seasonings and mix well,dredge the chicken in this mixture to coat , shaking off any excess flour,in skillet , heat oil over medium high heat until hot but not smoking,add the chicken and brown on all sides about 4 minutes per side,remove and set aside,pour off the oil from the skillet , leaving only a thin layer,add the chopped onion and saute over medium high heat until tender and lightly browned , about 8 minutes,stir in the 2 tsp flour and mix well,add the stock and wine , stirring gently to blend,cook until thickened,return the chicken and meatballs to skillet,cover and braise over moderate heat , stirring occasionally , for 45 minutes until chicken and meatballs are cooked through,adjust seasoning and serve with rice or little noodles,alternatively , chicken , meatballs and sauce can be layered in a covered casserole and cooked in a slow oven for several hours', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (97, 'smoked salmon cracker spread', 'easy', '65 min', 'in small mixer bowl beat cream cheese at med,speed , scraping bowl often , until light and fluffy add salt , lemon juice , onion , and liquid smoke,continue beating until well mixed,by hand , stir in salmon,spoon into serving bowl and serve with crackers,store refrigerated,garnish with chives , green onions , olives , pimiento , etc,to taste', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (98, 'some like it hot', 'easy', '70 min', 'start with the topping , in a frying pan , dry fry the coconut and peanuts until golden brown , tossing it so it wont burn , remove from the pan and let cool,mix together the soy sauce , cayenne , sambal , ginger , sugar , garlic and water , set aside , you will use this after you fried the tempeh,in a wok or frying pan , heat the tablespoon of oil , fry the onion and garlic for one minute , add the coriander , cumin and if you use them the chili peppers , fry this for two minutes,add the carrots , beans and tomatoes , fry until you see the tomatoes going soft , add the stock , bring to the boil and simmer for about 10 minutes,heat the oil in a frying pan large enough to hold the tempeh strips in one layer,fry the tempeh until golden , it will soak up the oil , this is normal,lower the heat when you see them starting to color but fry for a few minutes more , add the soy mix , stir to coat and add to the vegetables , mix,by now the tomatoes should have made a sauce and have dissolved,taste to see if you want to add more sambal and / or sugar,now add the bean sprouts , cook further until you see them go limp,transfer to serving dish , sprinkle with 2 tablespoons of the coconut and peanut mixture , serve with rice and the remaining topping on the side', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (99, 'souper easy sweet sour meatballs', 'easy', '150 min', 'mix together beef , bread crumbs , onions and eggs,form into meatballs,fry and brown in oil,drain on paper towel , then roll in cornstarch,in a sauce pan combine soup , water , sugar , salt , pepper& lemon juice,drop meatballs into simmering sauce,simmer on low heat for 2 hours', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (100, 'sour cream avocado dip vegan', 'easy', '10 min', 'peel and pit avocado , put in a large mixing bowl,add entire block of tofu and salsa,combine ingredients using a hand mixer on medium speed for about 1 minute or until the mixture becomes smooth,add remaining ingredients , mix on low speed until all ingredients are blended together,chill for one hour and serve,store leftovers in the fridge in an air-tight container', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (101, 'spicy banana bread', 'easy', '75 min', 'preheat oven to 350 degrees,spray two 9x5 loaf pans with non-stick cooking spray,cream shortening and sugar until light,beat in eggs one at a time,in separate bowl , sift together flour , salt , baking soda , cinnamon , cloves and nutmeg,add flour mixture to shortening mixture,blend well,add well mashed bananas , blend well,add nuts,pour into the two prepared pans,bake for 45 minutes to 1 hour,testing with wooden toothpick', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (102, 'steamed chicken cutlets in packages', 'easy', '35 min', 'preheat oven to 450f,rinse the chicken breasts , and either cut or pound the chicken to create cutlets of about equal size,tear off squares of aluminum foil and place each chicken breast on a square,slice the tomato and place a slice or two atop of each breast,drizzle the chicken with the olive oil,sprinkle the basil on top of the chicken breasts evenly,add salt and pepper to each breast,loosely fold up the foil over each cutlet , leaving both room for air space but folded up enough not to allow oil to drip out,place all packages in a large baking dish and bake for 20 minutes,serve while still packaged,allow each diner to open his / her package at the table', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (103, 'stove top bbq beef or pork ribs', 'easy', '150 min', 'cut all ribs into serving size pieces sprinkle ribs with salt in a dutch oven , brown ribs on all sides in veg oil over medium heat remove ribs from pot saute onions in pot until lightly browned return ribs to pot combine all remaining ingredients in a bowl and mix together- add to pot cover pot and cook over low heat for approx 2 hours , or until tender , stirring occasionally', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (104, 'sugared grapes', 'easy', '15 min', 'for one regular size bunch of grapes , 2 egg whites,brush grapes with egg whites and then sprinkle sugar to totaly cover grapes,freeze until needed the day of,this makes a very pretty garnish that\'s really yummmy !,the crystallized sugar makes the grapes crunchy and sweet !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (105, 'symphony brownies', 'easy', '45 min', 'preheat oven to 350 degrees , or 325 degrees for glass baking dish,lightly grease the bottom only of an 11 x 7 inch baking pan,set aside,in a large mixing bowl prepare brownie mix according to directions on the package , using 2 eggs , 1 / 4 cup water and 1 / 2 cup oil,stir until smooth,spread half the batter evenly into prepared pan,unwrap candy bars and place them on top of the batter,top with remaining brownie batter,bake 40 minutes or until a toothpick inserted near center comes out with only a few moist crumbs clinging to it,remove pan from oven and let cool on wire rack before cutting into squares or other shapes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (106, 'the best banana bread or muffins', 'easy', '70 min', 'cream together butter and sugar,blend in eggs,add bananas , water , soda , salt , and baking powder,blend well,stir in flour,add nuts and / or chips , if desired,pour into 4 greased / floured loaf pans or lined muffin tins,bake at 350: loaves need 35-40 minutes , or until toothpick inserted in center comes out clean,muffins need only 18-20 minutes,with this recipe , i usually always make muffins to cut down bake time', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (107, 'the best chocolate chip cheesecake ever', 'easy', '90 min', 'preheat oven to 300,combine cookie crumbs& butter , press firmly on bottom of 9 inch springform pan,in large mixing bowl beat cream cheese until fluffy , beat in sweetened condensed milk , eggs& vanilla,in small bowl toss 1 / 2 cup of chocolate chips with flour , stir into cheesecake mixture,pour into prepared pan,sprinkle remaining chips on top,bake 1 hour , cool& chill,for topping beat one cup sour cream& 2tbsp,brown sugar , pour over cake , cook additional 10 mins,dripmelted semi-sweet chocolate over top,i usually decorate with fresh strawberries and serve slices with spray whipped cream,awesome !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (108, 'the elvis smoothie', 'easy', '2 min', 'place all ingredients in blender,blend until very smooth,serve immediately,for a vegan smoothie , make with soy milk and soy yogurt', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (109, 'the man s taco dip', 'easy', '40 min', 'mix cream cheese and sour cream until a soft mixture,add taco seasoning and bean dip,add 3 / 4 of cheese and pour into a baking dish,add remaining cheese on top,bake at 350 deg for 20 to 30 minutes or until golden brown,serve with torillla chips', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (110, 'the woiks dilly burgers', 'easy', '32 min', 'in a bowl , mix together the ground beef , montreal steak seasoning , bacon crumbles and dill weed,shape into four burgers,brush or spray the onion slices with olive oil,place the burgers and onion slices over medium hot coals,grill for 8-12 minutes or until burgers are well done and onion is tender , turning once,add cheese to each burger , one minute before cooking is complete,place the burgers on toasted hamburger rolls,top with lettuce , tomato and favourite condiments', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (111, 'tide me over indian chaat simple veggie salad', 'easy', '2 min', 'toss everything well in a serving bowl,grab a fork or large spoon and eat immediately , or refrigerate until hunger strikes , and then eat !,feel extremely pleased with yourself that you snacked on this instead of that bag of chips you were eyeing,proceed to eat several helpings of dessert after dinner as reward', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (112, 'to your health muffins', 'easy', '40 min', 'blend together in large bowl flour , bran , brown sugar , baking soda , salt , cinnamon , carrots and raisins,in second bowl , beat buttermilk , oil , egg and vanilla,add liquid ingredients to dry ingredients and mix just until moistened,spoon into 12 greased or paper-lined muffin cups,bake at 375f for 20 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (113, 'truth serum margaritas', 'easy', '30 min', 'mix limeade , lime juice , tequila and triple sec in a pitcher and refrigerate,serve in salted glasses with plenty of ice--skip the blender , just serve on the rocks,garnish with lime wedge& a splash of grand marnier', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (114, 'turtle squares', 'easy', '30 min', 'preheat oven to 350 degrees f,spray a 13 x 9 baking pan evenly with non-stick cooking spray,beat 1 cup brown sugar with 1 / 2 cup melted butter with an electric mixer on medium for 2-3 minutes,add the flour mixture and mix until smooth,press the flour mixture evenly and firmly into the prepared baking pan,sprinkle the pecans evenly oven the flour mixture in the pan,mix the 2 / 3 cup butter and 1 / 2 cup brown sugar in a saucepan and bring to a boil over a medium heat,stir constantly while boiling for about 1 minute,spread the boiling mixture evenly over the pecans,bake for about 20 minutes,cool,melt the chocolate chips in the microwave , stirring ever 30 seconds or so until almost smooth,remove the chocolate chips , stir thoroughly to smooth and spread evenly over the top of the squares,chill for 15 minutes until the chocolate sets and then remove from fridge,when squares have returned to room temperature cut into 36 squares', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (115, 'twisted american chop suey', 'easy', '60 min', 'cook noodles according to box , drain and set aside,brown meat in large skillet , drain fat and add noodles and set aside,in same skillet , saute onion and garlic in butter until onion is tender,add to beef and noodle mixture,stir in all remaining ingredients except cheese and mix well , i mix milk and tomato soup before adding with rest of ingredients,add 1 / 2 of cheese and mix,put into 3 qt casserole dish , sprayed with pam sprinkle with rest of cheese and cover,bake in 400 degree oven for 30 minutes or until hot in center , if you like cheese crispy uncover for 5-10 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (116, 'voodoo calamari ink pasta', 'easy', '160 min', 'separate tentacls and the body of the calamri , then gut them , setting aside the ink sak,wash calamari under cold water , dice the body into rings , and chop the tentacles,heat garlic in oil without browning,add parsley , ground pepper,cover and let it simmer for 45min,check from time to time,if it\'s sticking , add some hot water,once it has simmered , mix the tomato sauce with the white wine and add it to the pot,simmer for 20 minutes more , uncovered , then dilute the sauce with a little hot water and simmer for a half hour more , covered,30 minutes before meal , cook pasta al dante,now you can add the ink to the sauce , as much as you like,serve sauce over pasta with the rest of the white wine', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (117, 'wacky cake', 'easy', '40 min', 'sift together and make 3 holes in dry ingredients,in first hole , pour vegetable oil,in second hole , pour vinegar,in third hole , pour vanilla,pour cold water over all,mix well with fork or whisk , but do not beat,bake in greased 8 x 8 pan for about 35 minutes at 350 deg f', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (118, 'wait forever pork chops', 'easy', '100 min', 'brown chops with a little salt and pepper,in baking dish , put pork chops on the bottom , mix rest of ingredients and pour on top of chops,bake at 300f degrees for 1 hour or 1 1 / 2 hours,hold\"in warm oven until ready to serve , the longer the better !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (119, 'we thought it was a layer cake sandwich', 'easy', '330 min', 'you will also need: 1 8-inch round cake pan , 3\" deep,spray 8 inch cake pan with non stick spray,form the thawed dough into an 8-inch round loaf and press into cake pan,bake at 350f for 20 to 25 minutes or until bread sounds hollow when tapped,cool 5 minutes and then remove from pan and cool thoroughly,once cooled cut the loaf horizontally into 4 equal slices ,,to assemble the\"cake\" , line the same baking pan with enough plastic wrap to hang over all sides 8 inches,spread bottom slice of bread with 2 tbsp of butter and 2 tbsp of horseradish,top with roast beef , provolone& roasted red peppers,spread second slice of bread with remaining butter& horseradish and place it horseradish side down on top of roast beef layer,spread the top of the second bread slice with 2 tbsp mayonnaise and then top with turkey , swiss cheese and sprouts,spread third slice of bread with remaining mayonnaise and place mayo side down on top of turkey layer,spread top of third bread layer with 2 tbsp honey mustard and top with lettuce , ham and cheddar cheese,spread cut side of loaf top with remaining honey mustard and place mustard side down on top of ham layer,place assembled\"cake\" in plastic lined pan and bring plastic wrap around cake to cover,refrigerate 4 hours ,,to ice the\"cake\" , beat cream cheese with an electric mixer until light& fluffy,carefully remove cake from 8 in pan , unwrap and place on cake serving platter,using an offset spatula neatly spread the top and sides of the\"cake\" with cream cheese,using a#21,refrigerate until ready to serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (120, 'zupa ze swiezych grzybow polish mushroom soup', 'easy', '40 min', 'wash and coarsely chop mushrooms,saute over medium-low heat , covered , with lemon juice , butter , onions , and water for 20 minutes,transfer to a large saucepan , add the broth , and bring to a low simmer,blend the sour cream with the flour and mix well,blend in the 1 cup reserved stock until smooth,add slowly to the pot , stirring constantly,simmer for five minutes , stirring often,serve garnished with chopped dill,the richly flavored wild mushrooms that polish cooks used to use are difficult to find,you may substitute dried mushrooms for part of the fresh , reconstituted according to package directions , for richer flavor', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (121, '1 asian noodle salad', 'easy', '26 min', 'bring a large pot of water to boil,add rice noodles and cook one minute , or until just tender,drain well , then rinse gently in cold water to cool the noodles,drain again and place in a large bowl with remaining ingredients,gently toss to combine,this salad can be made several hours in advance,keep refrigerated until needed', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (122, '1 brownies in the world best ever', 'easy', '40 min', 'heat the oven to 350f and arrange the rack in the middle,line an 8-by-8-inch glass baking dish with aluminum foil,combine chocolate and butter in a medium saucepan and cook over medium-low heat , stirring frequently , until evenly melted,remove from heat and let cool to room temperature,combine eggs , sugar , cocoa powder , vanilla extract , espresso , and salt in a large bowl and briefly stir until just evenly incorporated,add cooled chocolate and mix until uniform in color,add flour and stir until just incorporated,transfer batter to the prepared baking dish,bake until a tester inserted in the center of the brownies comes out clean , about 25 to 30 minutes,remove from the oven and cool completely before cutting', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (123, '1 easiest dr pepper ham glaze ever', 'easy', '13 min', 'mix all 3 ingredients in a pan , bring to a boil , and glaze ham throughout cooking process of the ham,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (124, '1 favorite chinese steamed whole fish by sy', 'easy', '45 min', 'clean and scale the fish and remove the insides , however , leave the head and tail on,rinse under cold water and then pat dry,place the fish in an oblong oven proof / microwave proof dish and add a little rice wine to both sides,after 5 minutes , remove the wine,place two whole scallions under the fish to prop the fish up , which will allow steam to flow underneath,steaming the fish: place water in a large wok and using a flat round trivet on top of the wok , bring water to a boil,place the fish plate on the trivet and cover,steam the fish for about 10-15 minutes , use a fork to poke the flesh of the fish to see that it is done,remove the fish plate from the wok , pour off the cloudy liquid , discard the scallions and then place the plate in the kitchen sink,as an alternative for steaming , put plastic wrap over the fish plate and then into the microwave oven,microwave on high for about 5-6 minutes,check for doneness as,sprinkle the fish with pepper& salt,spread over the fish the scallions and ginger strips,in a small frying pan add the peanut& sesame oil and heat just to smoking,then pour smoking oil over the fish , be careful with the oil splattering,next add the soya sauce,serve hot with white rice and chinese vegetables toped with oyster sauce !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (125, '1 french onion soup', 'easy', '100 min', 'heat the butter and 2 tb olive oil in a large pan until melted,add the onions and sugar,cook over medium heat , stirring occasionally until they are \"caramalized,add the flour and stir for about 3 minutes,add the beef broth , and cook the soup over low-medium heat , partly covered , for about 45 minutes,add the sherry , cook for an additional 5 minutes,preheat the oven to 350 degrees,cut the french bread into 1\" thick slices,bake the bread on an un-greased cookie sheet for 15 minutes,brush the bread with olive oil and rub with the cut side of the garlic,turn the bread slices over and bake an additional 15 minutes,ladle the soup into oven proof crocks , top each with a slice of bread and sprinkle on parmesan , romano and swiss cheese,bake the soup for about 10 minutes or until the cheese begins to brown', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (126, '1 in canada chocolate chip cookies', 'easy', '45 min', 'pre-heat oven the 350 degrees f,in a mixing bowl , sift together the flours and baking powder,set aside,in another mixing bowl , blend together the sugars , margarine , and salt until light and fluffy,add the eggs , water , and vanilla to the margarine / sugar mixture and mix together until well combined,add in the flour mixture to the wet ingredients and blend until combined,scrape down the sides of the bowl and add the chocolate chips,mix until combined,scrape down the sides to the bowl again,using an ice cream scoop , scoop evenly rounded balls of dough and place of cookie sheet about 1 - 2 inches apart to allow for spreading during baking,bake for 10 - 15 minutes or until golden brown on the outside and soft & chewy in the center,serve hot and enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (127, '1 squash dressing', 'easy', '50 min', 'mix all together,put in 2 quart casserole dish,bake for 30 minutes at 350f,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (128, '10 can spaghetti sauce oamc', 'easy', '510 min', 'brown sausage in pan , crumbling with spatula , until no pink remains,drain and rinse,put into a 5 quart crockpot,saute onions and garlic in olive oil until translucent and golden but not brown,add all the spices and mix well,turn off the heat and let the spices mingle for about 10 minutes,the heat will let the oils release from the dried herbs,add the tomato sauce and spice mixture to the meat in the crockpot and stir to mix,cook on high for 1 hour and then low for 7-8 hours,use over pasta,if freezing , cool sauce and pour into quart sized freezer bags,remove all the air and place flat on a cookie sheet and put into freezer,when frozen , they will stand up like records in the freezer', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (129, '412 broccoli casserole', 'easy', '40 min', 'preheat oven to 350 degrees,spray a 2 quart baking dish with cooking spray , set aside,in a large bowl mix together broccoli , soup , one cup of cheese , garlic powder , pepper , salt , milk , 1 cup of french onions , and soy sauce,pour into baking dish , sprinkle remaining cheese over top,bake for 25 minutes or until cheese is lightly browned,sprinkle with rest of french fried onions and bake until onions are browned and cheese is bubbly , about 10 more minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (130, 'millionaire pound cake', 'easy', '120 min', 'freheat the oven to 300 degrees,grease a 10-inch tube pan with butter , dust the bottom and sides with flour , and set aside,in a large mixing bowl , cream the butter and sugar with an electric mixer and add the eggs one at a time , beating after each addition,alternately add the flour and milk , stirring till the batter is smooth,add the two extracts and stir till well blended,scrape the batter into the prepared pan and bake till a cake tester or knife blade inserted in the center comes out clean , about 1 1 / 2 hours,cool the cake in the pan on a rack for 5 minutes , then turn it out on the rack to cool completely', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (131, '1 000 artichoke hearts', 'easy', '25 min', 'squeeze as much liquid as possible out of the artichoke hearts and drain them on paper towels,roll each heart in egg wash , and then roll in breadcrumbs until well-coated,deep fry for one to two minutes until lightly browned and slightly crispy,melt butter and garlic in a small , individual saut pan,saut hearts for two minutes in the garlic butter , basting each heart and taking care not to burn the butter or garlic,serve right in the pan with firm bread such as french or italian', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (132, '1 00 tangy chicken recipe', 'easy', '280 min', 'combine vinegar , worcestershire , chili powder , salt , pepper , and hot pepper sauce in a small bowl,you\'ll have mixed all ingredients except bbq sauce,place chicken pieces in a large plastic bag and pour mixture over chicken,marinate in refrigerator for at least 4 hours , turning several times,spray grill with non stick cooking spray,grill chicken pieces over medium heat in covered grill for 30-45 minutes,turn occasionally while grilling,baste with your favorite bbq sauce for the last 10 minutes of grilling time', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (133, '100 broccoli casserole', 'easy', '50 min', 'cook broccoli until tender in the amount of water called for on the package , drain,mix together soup mix , cream cheese , sour cream and water chestnuts,add drained broccoli and stir well,place in lightly buttered casserole dish and top with grated cheese and cracker crums,bake at 350 for 30-35 minutes or until hot throughout and bubbly', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (134, '100 chocolate cake', 'easy', '35 min', 'mix all cake ingredients till well blended,bake in 2 greased round cake pans in 350f oven for 30 minutes,cool , while cake cools completely mix filling and spread between cooled cake rounds and frost with grandmas fudge frosting,must refrigerate if serve with pudding filling,prep time does not include cooling time', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (135, '20 000 prize winning chili con carne', 'easy', '175 min', 'in large saucepan or dutch oven , brown half the meat,pour off fat,remove meat,brown remaining meat,pour off all fat except 2 tbsps,add onion , garlic,cook and stir until tender,add meat and remaining ingredients except flour , cornmeal and warm water,mix well,bring to boil,reduce heat and simmer covered 2 hours,stir together flour and cornmeal,add warm water,mix well,stir into chili mixture,cook covered 20 minutes longer,serve hot', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (136, '2000 meatloaf', 'easy', '90 min', 'pan fry bacon , and set aside on a paper towel to absorb excess grease,mince yellow onion , red bell pepper , and add to your mixing bowl,chop garlic and set aside,put 1tbsp olive oil into a saut pan , along with chopped garlic , teaspoons white pepper and a pinch of kosher salt,bring to a medium heat to sweat your garlic,preheat oven to 350f,coarsely chop your baby spinach add to your heated pan , stir frequently for approximately 5 min to wilt,add your spinach to the mixing bowl,chop your now cooled bacon , and add it to the mixing bowl,add your meatloaf mix to the bowl , with one egg and mix till thoroughly combined,add your goat cheese , one egg , 1 / 8 tsp white pepper and 1 / 8 tsp of kosher salt and mix till thoroughly combined,transfer to a 9x5 meatloaf pan , and cook for 60 min or until the internal temperature is at least 160f,let stand for 5min,melt 1tbsp unsalted butter into a frying pan , and cook up to three eggs at a time,crack each egg into a separate dish , in order to prevent egg shells from reaching the pan , then add salt and pepper to taste,wait until the egg whites are firm looking , but slightly runny on top before flipping your eggs,after flipping , wait 10~20 seconds before removing each egg and placing it over your slices of meatloaf', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (137, '25 pumpkin pie', 'easy', '80 min', 'adjust an oven rack to lowest position and heat oven to 400f,prepare pie crust for blind baking,bake crust for 15 minutes,remove parchment from crust , prick any bubbles with a sharp fork and bake shell for 8 to 10 minutes longer , or until bottom just begins to color,remove crust from oven and brush lightly with egg white while still hot,process pumpkin , sugar , spices and salt ingredients in a food processor fitted with steel blade for 1 minute,transfer mixture to a 3-quart heavy saucepan,bring it to a sputtering simmer over medium-high heat,cook pumpkin , stirring constantly , until thick and shiny , about 5 minutes,as soon as pie shell comes out of oven , whisk heavy cream and milk into pumpkin and bring to a bare simmer,process eggs in food processor until whites and yolks are mixed , about 5 seconds,gradually pour hot pumpkin mixture through feed tube while still running,process 30 seconds,pour warm filling into hot pie shell,put a crust shield on completed pie and bake about 25 minutes,filling will be dry-looking and lightly cracked around the edge,the center will wiggle when pie is gently shaken,cool on a wire rack to a warm room temperature,serve with slightly sweetened whipped cream', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (138, '25 000 casserole', 'easy', '125 min', 'coat the meat with 1 / 2 c of flour and the paprika,brown in vegetable oil,transfer to a casserole dish,add can of onions,combine one can of the chicken soup and one can water,pour over meat and onions,bake at 350 for 45 minutes,while the meat is baking-- combine 2 c flour , the baking powder , salt , poultry seasoning , celery seed , onion flakes and poppy seeds,mix well , and add 1 / 4 c oil and 1 c milk,drop tablespoons of dough into breadcrumbs which you have mixed with melted butter,put dumplings on top of the meat,increase heat to 425 and bake for another 20 minutes,make sauce,combine one can of cream of chicken soup and sour cream,heat sauce and serve over meat and dumplings', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (139, '250 chocolate chip cookies recipe', 'easy', '6 min', 'blended oatmeal: measure and blend in a blender to fine powder,cream butter and both sugars,add eggs and vanilla,mix together with flour , oatmeal , salt , baking powder and soda,add chips , candy , and nuts,refrigerate for 1 / 2 an hour,roll into balls and place 2 inches apart on cookie sheet,bake for 6 minute at 375 degrees', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (140, '250 00 chocolate chip cookies', 'easy', '20 min', 'mix all ingredients together just until blended,spoon large tbspfuls onto a baking sheet,bake at 350 for 10-14 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (141, '300 icing', 'easy', '30 min', 'this first part is best made ahead to allow for cooling,in a small sauce pan , mix flour into milk , then heat on low heat , stirring constantly until mixture resembles a thick pudding,cover and let cool,in a separate bowl , cream butter with sugar,add vanilla and blend until smooth,add first mixture after fully cooled,decorate as usual,should be able to ice one 8x8 cake,excellent for carrot cake when using cream cheese', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (142, '5 tacos', 'easy', '20 min', 'cook meat,add taco seasoning,place meat into taco shells / tortillas,top with tomatoes , onions , lettuce , salsa and cheese,boil corn cobs 5-7 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (143, '50 chili for the crockpot', 'easy', '345 min', 'combine all ingredients in a 7-quart crockpot,it might be easier to combine in a larger vessel , mix , and then transfer to your crockpot,cook on \"high\" for 5 hours , or \"low\" for 8 hours,i typically serve the chili over a bed of whole tostito chips , with a layer of shredded cheese in between', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (144, '500 margarita bread', 'easy', '90 min', 'in a small bowl , combine dates , tequila , orange liqueur , water , lemon and lime zest,set aside,in large mixer bowl , beat sugar , shortening and egg until fluffy,in another bowl , combine flour , soda and salt,add to creamed mixture alternately with date mixture , using low to medium speed,stir in pecans,turn into greased 9\" x 5\" by 2-1 / 2\" loaf pan,bake at 350 degrees for 50-60 minutes , or until toothpick inserted in center comes out clean,or , bake 3 or 4 mini loaf pans 30-35 minutes,turn out on wire rack to cool,slice thin and serve with cream cheese spread,cream cheese spread:,in small mixer bowl , beat cream cheese , butter and sugar until smooth,stir in liqueur and lime zest,makes 1-1 / 4 cups,bread freezes well', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (145, 'ara s potato oup', 'easy', '135 min', 'cook potatoes , onions , celery , and carrots in water until tender,meanwhile , in other pan , put in milk , butter , cream of chicken , cream of celery , and bullion cubes on low heat,when potatoes and the vegetables are tender , pour in the milk , butter , the cream of chicken and cream of celery , with the bullion cubes into the pan with the potatoes,put on medium heat and stir in potato flakes occasionally,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (146, 'blepandekager danish apple pancakes', 'easy', '50 min', 'beat the eggs lightly and add the milk,combine the flour , sugar and salt,stir the flour mixture into the egg mixture , stirring in the cup of cream as you mix,fry the apple slices in butter in a skillet,preheat oven to 500 degree,cover the bottom of an oven-proof baking dish , or heavy skillet , with apples,pour the batter over slices and bake in a preheated 500 oven,when nearly done , remove from oven and sprinkle here and there with a mixture of sugar and cinnamon to taste,place dabs of butter on the pancake and return to oven until browned,just before serving , sprinkle with lemon juice , and cut into triangles', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (147, 'lplermagrone', 'easy', '50 min', 'a variant on the theme: in the swiss canton of nidwalden , aelplermagrone is prepared with equal amounts of macaroni and potatoes,dried apple slices are traditionally served as a side dish,bring the milk and one tablespoon of salt to a boil,add the noodles , reduce the heat , and cook over a low heat until done , stirring occasionally,the noodles should absorb enough milk so that the dish is still moist,while the pasta is cooking gently saute the onions in butter , and garlic cloves , keeps it low and slow so as not to burn the onion or garlic , which would make it bitter,empty the noodles into a pre-heated bowl: mix in cheese and pepper,top with onions which have been sauteed in butter , and garlic cloves,the aelplermagrone can be served at this point: often a green salad is served alongside,but if you prefer , you can also turn the mixture into a casserole and bake it in the oven long enough to brown the top nicely -- usually about twenty minutes at 400 f / 200 c', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (148, 'lplermagrone herdsman s macaroni', 'easy', '40 min', 'heat the oven to 100 c,boil potatoes in a saucepan without lid for 5 minutes,add macaroni and cook them al dente,until the liquid is almost absorbed,strain and return to pot,pour cream and muscat over the potatoes and macaroni , season to taste,alternating with cheese , place the macaroni in layers into a 2 litre dish,top with cheese,bake for approximately 10 minutes in the center of the preheated oven until the cheese has melted,optional onion ring topping:,melt the butter,mix onions and flour , shake off extra flour,fry in the butter at medium heat for about 5 minutes until crisp,place onions on paper towels and keep warm', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (149, 'lplermagronen', 'easy', '55 min', 'heat oven to 375f set a large pot of salted water to boil,heat butter / oil over medium-low heat in a frying pan,add onions and fry them until golden brown,add penne and potatoes to the salted water,stir to make sure pasta doesnt stick together,cook until tender , about 15 minutes,drain penne and potatoes,combine milk / cream with salt and pepper,in an ovenproof casserole dish , place 1 / 3 of the penne-potatoes , sprinkle with 1 / 2 of the grated cheese,make another layer with 1 / 3 of the penne-potatoes , sprinkle with the other 1 / 2 of the grated cheese,top with the remaining 1 / 3 of the penne-potatoes,pour the seasoned milk / cream evenly over the top,spread the browned onions on top,bake covered for 10-15 minutes until steaming hot and cheese is melted,serve with warmed applesauce', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (150, 'rter med flsk pea soup with pork', 'easy', '195 min', 'soak peas overnight , drain and add 3 quarts water,bring to a boil and cook rapidly,skim off any skins,after cooking for an hour , add pork and simmer and simmer for 2 hours or until pork is tender,add seasonings', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (151, 'rtsoppa swedish yellow pea soup', 'easy', '150 min', 'rinse and pick through the peas,if using whole peas , allow to sit in the water you\'ll use for your soup overnight,this is unnecessary if you\'re using split peas as long as you simmer the soup for 2-3 hours,fill a large pot with 8 cups water,add the peas , chopped onions , whole onion with cloves , carrot , and ham bone to the pot,bring to a boil , then simmer over low heat for 90 minutes,if using whole peas , skim off any pea skins that have risen to the surface,remove 2-3 cups of the soup , pure it , then return the pure to the pot,continue to simmer at least another 30 minutes,30 minutes before serving , remove the studded onion and the meat,chop the meat and return to the pot,season with thyme , ginger , salt , and pepper,simmer 15 more minutes,serve with mustard on the side so it may be added to taste', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (152, 'pinards en branche sauted spinach', 'easy', '50 min', 'pull away and discard any tough stems and blemished leaves from the spinach,rinse and drain the spinach,pour the water into a kettle and bring to the boil,add salt to taste and the spinach,stir down to wilt,bring to the boil , stirring occasionally , and cook about 5 minutes,empty the spinach into a colander and drain,press with the back of a wooden spoon to extract most of the liquid,squeeze between the hands to extract additional moisture,put the spinach on a flat surface and chop it coarsely,add nutmeg,put the butter in a skillet and , when it starts to brown , add the spinach,cook , tossing and stirring , just to heat through', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (153, 'der wiener schnitzel style chili dog sauce', 'easy', '55 min', 'in a large size dutch oven or large size deep sauce pan , brown ground beef and ground pork over medium heat , making sure that the meat is well crumbled,when the meat is completely browned cover saucepan and turn heat to low,after 5 minutes , remove the ground meat from the heat and drain off most of the fat,keep some of the fat in the pan for flavor ,,while the meat is still off the heat , add water and the cornstarch in a medium size mixing bowl,whisk the cornstarch thoroughly as it\'s added until it\'s dissolved into the water,now add the wondra flour to the water mix and whisk until all is dissolved,add water mixture to the pan of meat,return the pan to the burner over medium heat and add the remaining ingredients,bring mixture to a boil stirring often to keep it from sticking to the bottom of the pan,when chili begins to boil , reduce the heat and simmer for 40 minutes uncovered,when chili is done it will be thicker and darker,it is made by gold medal and can usually be found in the baking aisle next to the other flour,perfect chili for hot dogs !,makes about 8 cups servings,cook\'s', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (154, 'go to bbq sauce for ribs', 'easy', '13 min', 'mix all ingredients together,heat on medium heat in a saucepan until bubbly,turn down and keep warm until ready to mop onto your meat', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (155, 'add in anything muffins', 'easy', '15 min', 'set oven to 400 degrees,set oven rack to second-lowest position,grease 12 regular size muffin tins or line with paper muffin liners,in a bowl sift together flour , 1 / 2 cup plus 2 tablespoons sugar , baking powder , baking soda and salt,in another bowl whisk together melted butter with sour cream , egg and vanilla or almond extract,stir in the butter mixture into the flour mixture,stir with a wooden spoon just until combined,divide the batter between each muffin tin,if you want you can sprinkle with a topping,bake for about 20 minutes or until muffins test done', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (156, 'almost dairy queen blizzard ice cream cake', 'easy', '300 min', 'prepare a 13 x 9-inch pan,for the crust,in a bowl combine the crust ingredients until well blended,press gently into the bottom of the baking dish,place one 20-ounce bag of sandwich cookies in a food processor , then process until coarsely crushed remove a little less than half of the crumbs to sprinkle on top of cake,in a bowl mix 1 / 2-gallon of the softened ice cream with the coarsely crushed cookies,fold in half of the container cool whip topping until combined,transfer and spread over the cookie crust,sprinkle the reserved crushed sandwich cookies over the top,freeze for a minimum of 5 hours or until completely frozen,if you are planning to freeze longer then this must be covered tightly with foil or it will pick up any freezer odors', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (157, 'almost grilled cheese sandwich', 'easy', '5 min', 'toast the bread slices,spread one side of each bread slice very lightly with butter,put cheese slice between buttered sides of bread,heat in the microwave until cheese starts to melt,in my oven this takes no more than 15 to 20 seconds', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (158, 'ant kelly s london broil marinade', 'easy', '200 min', 'mix all marinade ingredients together,lightly score meat in a diamond pattern on each side,place meat in a resealable bag,pour in marinade,squish meat and marinade around to get all the nooks and crannies,marinate in refrigerator 2-3 hours or up to 24 hours , rotating occasionally,can be frozen in the marinade too,20-30 minutes before cooking take meat out of the refrigerator to come up in temperature,cook in the broiler or on the grill on high heat for 5-7 minutes per side depending on thickness and desired doneness,i have been asked about roasting temperatures , i have never done this , always grill or broil,for camping - place the fresh london broil and marinade in a zipperbag , squeeze out as much air as possible , seal , place inside a vacuum pack bag,vacuum pack and freeze,put frozen in the camping cooler , after a day or two it is defrosted and can be cooked on the grill with minimal preparation and mess', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (159, 'anything goes low fat mushroom sauce', 'easy', '35 min', 'in large non-stick skillet , saut mushrooms and garlic in margarine until tender,add 1 1 / 4 cup broth , rosemary , and thyme,bring to boil,cook until reduced by two-thirds,add 2 / 3 cup broth , sherry or additional broth , teriyaki , and hot pepper sauce,cook and stir over high heat until mixture is reduced by two-thirds,add remaining broth , reduce heat , and simmer 5 minutes,in bowl , combine milk powder and cornstarch,gradually stir in milk until well blended,stir milk mixture into sauce,bring to boil,cook and stir for 2 minutes , or until thickened,reduce heat , add cheese , mustard , and oregano,stir until cheese is melted,for vegetarian use the vegetable broth', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (160, 'atkins friendly cheesecake', 'easy', '105 min', 'for the crust:,preheat oven to 350f,put 1 1 / 2 cups of almonds in blender and grind to medium / fine texture,add 1 / 3 cup of vanilla flavored whey protein powder,add 4 tablespoons of melted butter,add 1 tablespoon of cinnamon and 1 tablespoon of nutmeg,add about 3 tablespoons of splenda and blend,spray pie dish with non-stick spray and pour in mixture,use your hands to make the crust,cook for 12- 15 minutes,let cool,for the cheesecake:,heat oven to 325f,put cream cheese in a large bowl and mix until smooth,beat in splenda and sour cream and mix well,beat in vanilla,beat in eggs one at a time,beat until very smooth , no lumps,pour into crust and put in oven with a pan of water on the lower rack,bake 1 hour,chill before eating', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (161, 'bake in oozy bread', 'easy', '35 min', 'preheat oven to 375f,place a medium skillet over medium-high heat and add bacon,cook until crisp , about 8-10 minutes and reserve,place a small saucepot over medium heat and add the maple syrup and the butter -- do not bring up to a boil,cook until butter is melted , then turn the heat off and reserve,butter or spray a 3x9-inch loaf pan,pour a couple tablespoons of the maple / butter sauce in the bottom,layer 3 of the biscuits in the bottom of the pan,tear up one of the biscuits and fill in any open spaces with the pieces,don\'t worry if any still remain , the ooze will fill those inches,sprinkle half of the reserved bacon onto of the biscuits and top with about a 1 / 2 cup of the butter syrup mixture,place the remaining biscuits on top , sprinkle the rest of the bacon over them and top with the remaining maple sauce,transfer to oven and bake for 25-30 minutes,remove and immediately turn over onto a serving dish', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (162, 'bar cheese', 'easy', '35 min', 'in a large sauce pan over low heat , melt the velveeta,add the jar of horseradish and mix,allow this to heat on low for 15 minutes , stirring often,add the mayo , worcestershire , and tabasco,mix and allow to heat another 10 minutes , stirring often,cool slightly and pour into 4 or 5 containers,refrigerate,serve on your choice of crackers', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (163, 'bbq spray recipe it really works', 'easy', '5 min', 'mix ingredients together and add to a clean spray bottle,spray and \"wet\" your bbq meat,seal the meat in a plastic bag and refrigerate at least 4 hours or overnight,grill the meat over indirect heat according to your recipe , spraying every 15minutes during the cooking time,remove meat from grill and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (164, 'berry french toast oatmeal', 'easy', '12 min', 'add 1 / 2 cup old-fashioned oats and 1 cup water into a large microwaveable bowl,cook in microwave on 50% power for 6 minutes,place frozen berries in small bowl and defrost in microwave until the juice from the berries is released,add defrosted berries , sugar free syrup , butter spray , and flax seed together and stir well,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (165, 'berry good french toast bake', 'easy', '45 min', 'generously grease 2 1 / 2 quart casserole of rectangular baking dish , 13 x 9,beat flour , milk , sugar , vanilla , salt , and eggs in a large bowl with a hand beater until smooth,stir in bread cubes until coated,pour bread mixture into pan,top evenly with cream cheese , berries , and nuts,cover and refrigerate up to 24 hours,heat oven to 400,uncover and bake 20 - 25 minutes or until,golden brown,sprinkle with powdered sugar and serve with syrup', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (166, 'better than a baked potato soup', 'easy', '30 min', 'peel potatoes and cut into large chunks,put potatoes in soup pot along with onion , celery , and chicken broth,if there is not enough broth to cover the veggies , add a little water,cover , bring to a boil , and let simmer for approximately 20 minutes , until vegetables soften,if you like thicker soup , drain off some of the liquid,if you like thinner soup , leave it as is and proceed,use a potato masher to mash up the spuds,mash more or less depending on how creamy or chunky you like your soup,add white pepper , salt , and liquid smoke to taste,add sour cream and velveeta , heat and stir until cheese melts,dip the soup into 4 bowls,top each bowl with shredded cheddar cheese , chives , and bacon bits,eat and smile :)', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (167, 'better than cinnabon cinnamon rolls', 'easy', '85 min', 'combine warm water , sugar and yeast,set aside,in microwave , melt butter,when butter is melted , add milk and warm to take the chill off,add beaten egg and yeast mixture mix gently and pour into pan of bread machine,add flour to bread machine pan , one half of the pudding mix and salt,place pan in machine and allow to complete dough cycle,(if dough is sticky add a 1 / 4 to a half cup of flour during kneading,when dough cycle is complete , roll out dough to approximately 17\"x10,spread dough evenly with 1 / 2 cup softened butter and sprinkle with brown sugar and cinnamon,roll up dough starting with the long side,cut into approximately 16 even pieces and place in a 9x13 pan,at this point you can cover and refrigerate until the next day or let rise 45 minutes,bake at 350f for 20 minutes until golden brown on top,make frosting , beat together cream cheese , butter , powdered sugar , remaining pudding mix and milk to a spreading consistency,frost rolls after the have cooled slightly,serve immediately for best results,it is my understanding that this recipe does not freeze well', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (168, 'better than spaghetti squash bake', 'easy', '70 min', 'prepare spaghetti squash by piercing the skin with a fork and boiling for approximately 25-30 minutes,split spaghetti squash lengthwise , spoon out the seeds and use a fork to remove the spaghetti strands from the squash,snap off the ends of the asparagus and cut into 1\" pieces,slice mushrooms , red bell pepper , and garlic thinly,saute all vegetables and garlic on medium-high heat in non-stick skillet until cooked and tender,lightly salt and pepper for added flavor,add spaghetti sauce to skillet and cook for about 5 minutes,place spaghetti squash strands in the bottom of a casserole dish and pour the sauce saute evenly over it,crush italian seasoning lightly in your palm and sprinkle over the casserole,spread shredded part-skim mozzarella and reduced fat grated parmesan cheese over the top,bake at 350f for about 25 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (169, 'better than tofu cheesecake', 'easy', '90 min', 'for crust:,melt margarine and blend well with graham cracker cumbs and sweetener,press well into bottom of spring-form pan or round cake pan,bake at 350f for 10 minutes,let cool,filling:,mash tofu with vegan cream cheese,add all other ingredients to tofu mixture and whip with hand mixer until well blended and very creamy,try to get all tofu lumps out,pour into crust and bake at 350f for 45-50 minutes,turn off oven and leave in for 15 minutes more to help set center,when done edges should be golden and starting to pull away from sides of pan , center should be soft set,cool about an hour then refrigerate another 3 hours to set center,keep refrigerated,helpful hints: draining the tofu well is important,too much liquid and the center won\'t set well,after slicing the cake place a paper towel in the cut out section before returning it to the frige,this will absorb any fluid that will condense on the plate or in the pan and keep the bottom of the cake from getting too soggy', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (170, 'big easy gumbo', 'easy', '68 min', 'heat oil in a large dutch oven over medium-high heat,gradually whisk in flour and cook , whisking constantly , 5 to 7 minutes or until flour is chocolate colored,do not burn mixture,reduce heat to medium,stir in onion and next 4 ingredients and cook , stirring constantly , 3 minutes,gradually stir in chicken broth,add chicken and next 2 ingredients,increase heat to medium-high and bring to a boil,reduce heat to low and simmer , stirring occasionally , 20 minutes,add shrimp and cook 5 minutes or just until shrimp turn pink,serve over hot rice', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (171, 'big mac meatloaf', 'easy', '60 min', 'combine all ingredients except for cheese,mix well,take approximately 1 / 2 of meat mix and flatten it out on a sheet of wax paper , sprinkle cheese on top,take one end of meat and roll to other end like a jelly roll,place in a cake pan of sorts,repeat with remaining 1 / 2 of meat,if you like a type of crust on meat loaf , i crush a few crackers add salad dressing and a bit of cheese,spread it on top of the meatloaves,bake at 350f for about 45 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (172, 'buckley s cajun salmon pasta', 'easy', '38 min', 'for the cream sauce:,saut minced garlic with butter until garlic is light brown,add heavy cream , basil , lemon juice , grated cheese blend , & white pepper,bring to a boil on medium high heat , stirring often,place on low heat after boiling & salt to taste,for the cajun salmon:,preheat oven to 375f,lightly coat salmon with cajun spice,remember , the amount of spice will determine the degree of spice & heat,so cook salmon at 375f for 8-15 minutes depending on desired doneness,for the presentation:,toss cooked pasta with the cream sauce,portion 8 ounces of pasta per serving,place the cooked salmon filets atop the portions,garnish with parsley & shredded parmesan cheese,a slice of garlic toast & a lemon wedge will further complement this dish', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (173, 'burek or feta cheese phyllo pie', 'easy', '65 min', 'first - let me explain the feta,we have an italian market that sells fresh fruits and veggies etc,and they have a fresh cheese section,i always buy a block of french feta cheese,i use half for this recipe and the rest for omelets etc,you can use the prepacked feta but if you want the full experience you\'ll need a lot,also , you may use other variety of feta the french is very salty which is why i add cottage cheese,it kind of balances out the saltiness abit,you just need 1 package of phyllo,mine says 32 oz , buy the long box not the country,preheat oven to 350f,in large mixing bowl beat eggs , add 2 cups milk and mix well,take your block of feta and cut in half,use one 1 / 2 and refrigerate the other,crumble the feta into the egg mix and add cottage cheese,make sure you have nice chunks,mix well , the mixture should be thick and very lumpy,if too thick add more milk,take a large deep baking dish,sprinkle oil on bottom only,lay one sheet phyllo and drizzle with oil , continue until you have 4 sheets,when you add the last sheet place your hand flat on the phyllo sheets and gently gather , without tearing by pulling the sides slightly toward center,:),use 1 full ladle of the egg / feta mixture onto the layer , you don\'t need to cover all the phyllo just don\'t leave the feta in one spot distribute,layer another phyllo sheet and sprinkle with oil,layer another sheet of phyllo and again crumple the center then sprinkle the oil,one ladle of the egg / feta mix,continue in this pattern,if you see that you have alot of the egg / feta mix left you can start to add more than the 1 ladle,your last layer should be 3-4 layers of phyllo,don\'t sprinkle with oil yet,take a soup spoon and with the handle , tuck in the sides,now sprinkle with oil,bake for about 30-40 minutes or until the top is puffed and nicely browned,your kitchen with smell wonderful,the burek will puff high off the top of the pan but once cooled will drop,you must cool completely or you will nto be able to cut with out it falling apart,it\'s moist and a bit salty and goes great with a nice cold beer ! you can serve as main meal with salad or as appetizer', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (174, 'california roll salad', 'easy', '12 min', 'prepare rice according to directions,pour rice into medium bowl and toss with 1 tbsp vinegar,set aside,thinly slice cucumber and avacado,break up crabmeat into chunks,mix lettuce leaves with seasoned rice , cucumber , avocado slices and crabmeat,in separate cup , mix together soy sauce and remaining 2 tbl of seasoned rice vinegar,drizzle this dressing over salad , and add pickled ginger on top of salad', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (175, 'can t fail holiday fruitcake', 'easy', '150 min', 'butter a 9 inch springform pan,line with wax paper,butter again,sift flour and baking soda,combine eggs , mincemeat , sweetened condensed milk , chopped walnuts and candied fruit,fold in dry ingredients,pour into pan,bake in 300f oven for 2 hours , until center springs back and top is golden,cool thoroughly,turn out and remove wax paper,refrigerate , well wrapped , at least 24 hours before decorating , slicing and serving', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (176, 'cancer curing matzah ball soup', 'easy', '195 min', 'how to make soup:,shred cooled chicken breasts and place in stock pot,cut up celery , onion and baby carrots into bite sized pieces and add to stock pot,add in 3 of the 32 oz chicken stocks into pot,fill those containers with water and put in stock pot as well so now you should have 1 and 1 / 2 gallons of fluid in your stock pot and brimming with vegetables,ensure you still have room in your pot for about 8 more cups of food,finally add your seasonings,cook on medium heat for about 90 minutes or until your vegetables are tender,add additional salt and pepper if needed,how to make matza balls:,regular,mix together the oil and eggs,slowly add the matzah meal,add the salt , sugar and baking powder,refrigerate for 1 / 2 hour till firm,with remaining 32 oz of broth pour into large pot and fill with 32 oz of water as well,with moistened hands , make balls do not pack them or they wont cook all the way,add balls to water cover,lower heat to a slow boil,cook for 45 minutes to 1 hour until fluffy,stuffed balls,when making the balls put in any chopped herb and form the ball around the herb and cook as stated,when balls are done:,add all broth and balls to soup mixture cook another 10 minutes and serve hot', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (177, 'cheeeezy potatoes', 'easy', '65 min', 'in a very large mixing bowl , mix sour cream and soup together,add potatoes,add in 1 cup of shredded cheese,add in poppy seeds,mix all together,pour into 9 x 13 baking pan,top with remaining cheese,bake at 350f for 1 hour', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (178, 'cheeseburger meatloaf for lactose intolerant cheese', 'easy', '70 min', 'preheat oven to 350f,thaw meat in advance and place in a large mixing bowl,stir in bread crumbs , sage , coriander , adobo , oregano , pepper and salt,use hands to mix in eggs , ketchup , soy sauce , soy cheese and red onion divide mixture in half and form into 2 loaves,place loaves side by side in a medium sized lasagna pan,use fingers to open the top of the loaves and sprinkle in the garlic and add 1 / 2 a tbs of olive oil to each loaf and squeeze closed,close loaves with hands and top with ketchup if desired,cook at 350 for 1 hour,let stand 5-10 minutes and serve warm !,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (179, 'cheesy tuna casserole', 'easy', '45 min', 'heat oven to 350f,prepare mac and cheese as directed on the package , except using 3 / 4 cup milk,cook onion , green or red pepper and celery in butter until tender,add to the prepared mac and cheese the remaining ingredients,mix well,pour into a 1 1 / 2-quart casserole,bake 30 minutes,garnish with pepper rings if desired', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (180, 'chef salad dressing', 'easy', '10 min', 'mix all ingredients until smooth and well blended,store in refrigerator,will keep up to 2 weeks', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (181, 'chic greek salad', 'easy', '12 min', 'arrange the cucumbers , tomatoes , onion , red pepper , artichoke hearts and parsley on a platter,squeeze the lemon juice over the platter,season with salt and pepper,place shallots , vinegar and oregano in a bowl and let stand for 5 minutes,whisk in olive oil in a slow stream,pour dressing over salad,garnish salad with chunks of tuna , pepperoncini peppers and olives', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (182, 'chicken fried fish fingers', 'easy', '135 min', 'put fish into a medium sized bowl,cover with buttermilk,chill for at least 2 hours,mix together flour , seasoning salt , and pepper in a large bowl,coat each piece of fish in flour mixture,set aside,in remaining buttermilk , add egg , mixing well,coat floured fish in buttermilk / egg mix,repeat step 4,heat oil till hot but not smoking in a large skillet,add fish six pieces at a time,do not crowd fish,cook until fish is golden brown and flakes easily', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (183, 'coal miners gnocchi', 'easy', '40 min', 'prepare potatoes per package instructions,add onions and 4oz of goat cheese,reserve 2 cups of the mashed potatoes to make your gnocchi,add 1 large egg yolk and 1 cup of flour to the mashed potatoes,add more flour if needed and a pinch of salt,the mixture should be a dough consistency,turn dough out onto a board and knead very little , just enough to get everything mixed together,cut dough into 4 pieces,roll each of the 4 pieces into log shapes about the size of your index finger,cut each log into 1 / 2\" pieces,bring a pot of water to a boil,while water is coming to temp , saute bacon till fat has rendered,defrost spinach in microwave,drain spinach and making sure all liquid is out of the spinach,beat 2 large eggs in a separate bowl,remove skillet of bacon and garlic from the heat add hot gnocchi and toss,when coated with fat add the spinach and the beaten eggs,whisk till thick and sauce is created,be careful not to scramble the eggs,crumble leftover goat cheese if you have and left,enjoy', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (184, 'country fried pig fingers', 'easy', '50 min', 'cut each chop into three strips lengthwise,with textured end of meat mallet , pound each strip -inch thick,mix milk and egg well,set aside,mix together flour , pepper , seasoning salt , and cajun seasoning if desired,coat each strip in flour mixture,then flatten each piece with palm of hand,dip each strip into egg mixture,coat again with flour mixture,sit strips on aluminum foil to let \"dry\" for 10 minutes,heat oil in large skillet over medium heat until hot but not smoking,add strips six at a time,fry until golden brown,turn and repeat,repeat step 12 , until all strips are cooked,drain on paper towels,serve with white gravy,white gravy:,dispose of oil except for 4 tablespoons,add 1 / 4 cup flour,whisk until paste is formed,add 1 to 1 1 / 4 cup milk,stir until desired thickness is reached,salt and pepper to taste', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (185, 'crab noodle bowl', 'easy', '7 min', 'in large non-stick pan , cook veggies on medium heat covered for about 3 minutes,mix 1 packet of seasoning with water,add water , ramen and crab to veggies and stir continuously until noodles are soft and most of water is absorbed,pour over marinade,heat through and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (186, 'cream of pumpkin or squash soup vegan', 'easy', '30 min', 'place all ingredients except for banana , apple and paprika , in a stock pot,cover , cook on low-medium heat until vegetables are soft , about 20 minutes,add banana , apple and paprika last 5 minutes of cooking,heat through,once heated , puree soup if desired,just before serving , season soup with salt to taste,garnish with cilantro leaves and pumpkin seeds,or , if you wish , garnish each serving with a swirl of pesto made with pumpkin seeds,', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (187, 'cream of mushroom soup', 'easy', '40 min', 'in a 4 quart pot , saut the mushrooms in butter till tender,add garlic,saut on low heat 5 minutes,in a blender , pure the cashews with the water until very smooth,add to the mushrooms,add the bouillon and cook on low heat , stirring frequently , until the soup begins to thicken,add parsley and nutmeg,serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (188, 'creamsicle smoothie', 'easy', '15 min', 'peel mangoes and remove as much flesh around pit as you can,peel oranges,if you have a good blender , don\'t worry about the orange seeds , they\'ll get blended up just fine , as well as the vanilla bean,put all ingredients in blender , blend to desired consistency and consume !,makes 3 large servings', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (189, 'creamy vegan potato leek soup', 'easy', '40 min', 'heat olive oil in a 4-quart pot,sautee the sliced leeks about 5 minutes or until slightly tender,add garlic and sautee another minute or so,add potatoes and broth,bring to a boil,reduce heat to medium and simmer 20 minutes or until potatoes and leeks are quite tender,add beans , rosemary , salt , and pepper , and more broth , if necessary,puree until smooth , using an immersion blender or in small batches in a regular blender,if necessary , return to heat until warm enough,sprinkle with soy cheese , if desired', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (190, 'creamy chicken curry', 'easy', '315 min', 'slice the chicken and place in a bowl,peel and crush the garlic , mix with the soya yogurt and turmeric and pour over the chicken,cover and leave to marinate in the fridge for at least 4 hours or overnight if possible,peel and slice the onions and place in a pan with the stock,cover the pan , bring to the boil and cook for 10 minutes,reduce the heat , uncover and cook gently for 20 minutes until the onions are tender and golden,finely chop ginger and crush coriander seeds,add all the spices to the pan and cook for 3-4 minutes,then add the chicken and soya yogurt marinade,cover and simmer very gently over a low heat for 15 minutes until the chicken is cooked,season with salt and pepper,serve immediately with freshly chopped coriander', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (191, 'da best chicago style italian beef', 'easy', '645 min', 'preheat oven to 325f,sprinkle the roast with garlic powder , oregano and pepper , then cook roast , uncovered , in a shallow roasting pan , about 30 minutes per pound,roast will be very rare-- don\'t overcook it !,let cool slightly , then thinly slice,add to the roast\'s pan drippings: the boiling water , bouillon cubes , oregano , thyme , pepper , tabasco sauce , garlic and worcestershire sauce,simmer for 20 minutes , scraping up the browned bits,taste for salt and add some if you wish,add the sliced beef,cover and marinate in da gravy overnight,reheat the next day and serve in crusty italian sandwich rolls', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (192, 'denauseating with ginger tea', 'easy', '10 min', 'bring water to boil with crushed ginger in it,let it simmer for 5-7 minutes on medium heat,strain and pour in the cup / mug , add tea bag and stir honey,you can add a dash of milk if you want,it is very good to sip anyway', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (193, 'dipstir crock pot dip', 'easy', '95 min', 'combine ground beef and sausage in a 10-inch skillet,brown and crumble meat,drain of excess grease,put ground beef and sausage into a crockpot and add cheese,put on low setting and let cheese melt through the meat , approximately 1 to 1 1 / 2 hours,if thinner dip is desired , add one tablespoon hot water', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (194, 'don t bother with the canned stuff sloppy joes', 'easy', '30 min', 'brown beef til no longer pink,strain away any fat and return meat to pan,add steak seasoning , onion and pepper,cover and cook about 5 minutes til veggies are tender,add remaining ingredients,simmer about 20 minutes till mixture thickens,serve on hamburger buns or rolls -- enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (195, 'dressed up salad with secret dressing', 'easy', '95 min', 'salad,in salad bowl , tear lettuce and add green or red onion and seasonings,toss and smooth greens so top is uniformly level,formal attire,proceed to \"dress up\" the salad by making a 1\" ring of grated carrot around edge of bowl thick enough to cover the greens,then make rings inside this of corn , then green pepper , then beets or tomatoes then mushroom slices piled in the center circle,if using beets and tomatoes both , make it tomatoes then a ring of mushrooms then a mound of shredded beets in center,make sure rings are thick enough to cover all the \"naked\" greens,you can use any vegetables of your choice to make the rings , such as radishes , olives or water chestnuts , but i prefer the varying colors and blend of flavors of the above,cover with plastic wrap and refrigerate until ready to place it on buffet or dinner table,secret dressing,make secret dressing by placing cut pieces of ginger root and vinegar in a blender and blend until smooth,press through a mesh strainer over a bowl , squeezing out pulp to get more liquid into bowl,pour liquid back into rinsed-out blender,add honey , garlic and soy sauce,blend well,slowly add oil while blender is on low to mix,pour into a jar with cover , shake and refrigerate,when ready to serve salad , shake jar and pour into a cruet for guests to pour their own,presentation,put salad on buffet or dinner table and after everyone oohs and aahs , toss well and serve with secret dressing in a cruet for them to pour on desired amount', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (196, 'drunken pork chops', 'easy', '30 min', 'season pork with salt and pepper,heat oil in heavy large skillet over medium-high heat,add pork,saut until brown and just cooked through , about 5 minutes per side,transfer pork to plate,tent with foil to keep warm,add onion and fennel seeds to same skillet and saut until onion is tender , about 5 minutes,mix in paprika,stir 15 seconds,add wine , broth and lemon juice and boil until sauce thickens slightly , scraping up browned bits , about 5 minutes,season sauce to taste with salt and pepper,spoon sauce over pork chops and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (197, 'egg cellent noodles', 'easy', '30 min', 'spray oven-proof skillet with cooking spray and pre-heat oven to 350 degrees,prepare ramen noodles according to directions,drain noodles and spread into the bottom of skillet,in mixing bowl , beat eggs,stir in pepper , olives , italian seasoning , and garlic powder,pour egg mixture over noodles,place pepperoni slices evenly over eggs and noodles,bake in oven for 15 minutes,remove skillet from oven,top with mozzarella cheese and tomato slices,return to oven and bake for 5 minutes or until cheese is melted and eggs are done', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (198, 'even i like these bran muffins', 'easy', '25 min', 'preheat oven to 375c,beat eggs , add sugar , oil , milk and molasses,mix thoroughly,in another bowl , add all flour , baking powder , baking soda , salt and bran together,mix thoroughly,add raisins , sesame seeds , and sunflower seeds to the dry mix,mix again,add dry ingredients to wet ingredients,mix well,mixture will appear quite wet , but will thicken up quickly,line muffin pan with muffin cups,fill 3 / 4 full,bake for 14-15 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (199, 'evil chicken', 'easy', '255 min', 'combine sherry , soy sauce , brown sugar , ginger , garlic , crushed peppercorns , onion , tea leaves , orange peel and juice from orange in a bowl and mix well,pour over chicken and marinade in refrigerator for at least 2 hours,if using a whole chicken bake at 350 for 1 1 / 2 to 2 hours or until chicken is done,if using boneless breasts i prefer to cook it in a slow cooker on low for at least 2 hours but you can also bake at 350 for at least 45 minutes or until chicken is done,use remaining marinade from roasting pan or slow cooker as a gravy', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (200, 'exotic fruits barbecue marinade', 'easy', '30 min', 'roast coriander , star anise , gloves and cardamom pods and ground afterwards,crush the lemongrass,mix all ingredients well,cover your meet with the marinade,do this for 4 - 48 hours , the longer the better,remove lime leaves and lemongrass before you barbecue,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (201, 'fake blueberry cheesecake', 'easy', '40 min', 'cook pudding according to package directions,cool,add cool whip to vanilla pudding and mix together,in a 9 x 12 pan , line the bottom with the graham crackers,add a layer of the pudding mixture , then another layer of graham crackers,continue layers , ending with pudding mixture,spread blueberry pie filling on top,sprinkle top with crushed graham crackers or shaved chocolate', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (202, 'fire sauce', 'easy', '10 min', 'combine the tomato paste and water in a saucepan,whisk until smooth,add the remaining ingredients to the tomato mixture,heat over medium / high heat until it begins to boil,continue to cook , stirring often , for 4 to 5 minutes,remove from heat,when sauce has cooled , pour into a glass airtight container and refrigerate,stores well in the refrigerator', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (203, 'flaky oatmeal raisin cookies', 'easy', '35 min', 'in a large saucepan , combine brown sugar and butter,cream until well blended,stir in eggs and mix well,combine baking soda , baking powder , salt and flour,fold into sugar-butter mixture,stir in vanilla , raisins , oats , corn flakes , coconut and walnuts,blend well,scoop out balls of cookie dough with an ice cream scoop or tablespoon onto cookie sheets,flatten each scoop slightly with palm or glass,bake at 350 for 13-15 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (204, 'flipped roast turkey', 'easy', '195 min', 'preheat oven to 450f,remove neck and giblets from cavity of turkey,rinse well with cold water and pat dry,using a pastry brush , coat entire outside of turkey lightly but well with olive oil,rub softened butter over the skin,peel onions and slice thickly,place onion slices in bottom of turkey roaster to form a \'bed,season turkey lightly all over with herbs and spices of choice,place turkey breast side down in roaster,cook at 450f for 30 minutes,remove from oven,reduce temperature to 325 degrees f,carefully turn turkey so that breast is facing up,return turkey to oven and cook until done,allow turkey to rest for at least 30 minutes before carving', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (205, 'free toe pie', 'easy', '35 min', 'start with loaf or casserole dish,layer the ingredients as listed,build 3 or 4 layers , depending upon the pan size,finish with even more cheese on top,you can add hot sauce or other spices between the layers but do not add salt , as the corn chips have plenty !,cover and bake for 15 to 20 minutes at 350f,uncover and bake 5 minutes more to brown cheese on top,serve promptly with sour cream and salsa on top,can be made up to 24 hours ahead and stored the the fridge', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (206, 'fried cauliflower', 'easy', '15 min', 'in a shallow medium bowl , beat egg lightly,place bread crumbs in a plastic or paper bag,dip cauliflower into egg to coat,place florets in bag with crumbs,seal or close bag and shake well,in 10 inch non-stick skillet , heat oil,add coated cauliflower and saute until browned on all sides,season with salt and pepper if desired,and if desired garnish with parsley sprigs', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (207, 'from the field green beans fresh herbs and walnuts', 'easy', '40 min', 'bring a large pot of water to a boil,add a pinch of salt and the beans,cook for 5 minutes,drain and set aside,while water is boiling , thinly slice both onions,melt the butter and olive oil in a large skillet,add onions and kosher salt and pepper,allow the onions to caramelize for around 20-25 minutes,add herbs and cook for an additional 5 minutes,add green beans and walnuts,mix well,heat for an additional 2 minutes and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (208, 'geebee special sandwiches', 'easy', '20 min', 'in skillet over medium heat , fry ham until lightly browned,separate ham into 6 mounds and lower heat,put one slice of cheese on each mound , cover and turn off heat,place each mound onto hamburger bun , top with relish , then ketchup , sprinkle of black pepper , and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (209, 'german barbecued carrots', 'easy', '55 min', 'preheat oven to 350f,cook bacon until crisp,drain grease and crumble into fine bits,peel and slice carrots , place into baking dish,add tomato soup , bacon and sugar and stir well,bake for 30-45 minutes until bubbly,eat and enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (210, 'glazed meatloaf', 'easy', '70 min', 'preheat oven to 375 degrees,in large bowl , mix first 5 ingredients together,place mixture into a 13x9-inch pan and form into a loaf,cover the loaf with a thin layer of ketchup and sprinkle desired amount of brown sugar on top of ketchup,bake the loaf at 375 degrees for one hour', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (211, 'go bears party ryes', 'easy', '25 min', 'brown meats and drain off fat,add meats and cheese in frying pan and stir over low heat until melted,mix in spices and worcestershire sauce,spread mixture on cocktail rye slices,place on cookie sheet and bake approximately 10 minutes at 400f until hot,serve hot or warm', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (212, 'golden circle pineapple upside down cake', 'easy', '70 min', 'preheat your oven to 180c,pineapple layer:,melt the butter and pour into the base of a 20cm round cake tin,also brush the butter around the sides of the tin,sprinkle the brown sugar over the base of the tin,arrange the pineapple rings in the tin and place a cherry into the centre of each ring,cake batter:,cream the butter and sugar until light and fluffy,beat in the egg and the vanilla,sift the flour and fold into the mixture , alternating with the milk,pour the cake batter over the pineapple and cherries,bake for 40 to 50 minutes , or until a skewer inserted into the cake comes out clean,remove the cake from the oven and loosen the cake from the sides of the tin,invert the cake onto a serving plate,enjoy either warm or cold', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (213, 'greens to go smoothie', 'easy', '6 min', 'add all ingredients , except greens to a blender,stuff the rest of the blender with greens - about three to five good handfuls - they shrink when blended ! lettuce , romaine , spinach , chard , kale , collards , parsley , or whatever you have in the fridge or garden,blend until smooth,you could use more fruit than greens and slowly add more greens as you get used to them', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (214, 'hawaiian chicken salad appetizer', 'easy', '15 min', 'combine ingredients except for the bread,chill in refrigerator,when ready to serve , cut the top part of the hawaiian king bread off leaving a hallow space to put in the chicken salad,cut up the bread into chunks,use the bread to dip into the chicken salad', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (215, 'healthy fried rice', 'easy', '25 min', 'heat 1 tbsp oil in pan and saut mushrooms until browned,remove from heat,heat remaining oil in pan and add rice,add egg and mix until rice is thoroughly coated with egg,cook for 5-10 minutes on high , or until egg is lightly browned,combine rice mixture and vegetables in large bowl and stir until vegetables are well mixed,add soy sauce to taste and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (216, 'healthy pumpkin pie', 'easy', '75 min', 'preheat oven to 425f,mix pumpkin , milk , and egg whites until smooth,gradually stir in splenda,add the pumpkin pie spice,taste and add more if need be,pour into crust and spread evenly,bake in the oven for 15 minutes then reduce the temperature to 350f and bake for another 45 minutes,let cool and serve your favorite way,to make to crust less likely to turn soggy , beat some egg whites and brush over the crust and bake at 350f for about 5 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (217, 'homebakes knock off beef stew and biscuits', 'easy', '35 min', 'preheat oven to 350f,pour stew into an 8 x 8-inch baking dish , i recommend glass,prepare biscuits according to package,spoon them onto the top of the stew,bake for 30 minutes or until biscuits are browned,let stand for 3-5 minutes,serve and enjoy', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (218, 'honey i m peanuts about you cake', 'easy', '70 min', 'cook\'s,preheat the oven to 350 degrees f,grease 2 round cake pans,as the oven preheats , begin to make the cake batter,dissolve the cocoa into the espresso,stir the buttermilk into the cocoa mixture and set aside to cool,whisk together the flour , baking soda and salt,in another bowl , beat the butter with an electric mixer at medium speed for about 6 minutes , while gradually adding the sugar,the butter mixture should be light and fluffy,slowly add the eggs and vanilla to the butter , while continuing to beat,be sure to scrape down the sides of the bowl as you go , so all the ingredients get incorporated,fold the flour and cocoa mixtures into the butter mixture with a rubber spatula , alternating from flour to cocoa in the following order: 1 / 3 flour mixture,1 / 2 cocoa mixture,1 / 3 flour mixture,1 / 2 cocoa mixture,1 / 3 flour mixture,do not overmix !,pour half of the finished batter into each of the cake pans and level the tops with the spatula,bake for 30-40 minutes in the center of the oven , rotating halfway through,check with a wooden toothpick for doneness,cool for at least 15 minutes before inverting onto a baking rack to cool completely,make the buttercream: with an electric mixer beat the peanut butter and butter in a large bowl until creamy,add the powdered sugar and beat until spreadable,with a serrated knife halve the two layers making 4,place 1 cake layer top down on the rack and spread 1 / 3 of the buttercream to the edges of the layer,top the first cake layer with another and repeat with the buttercream,continue layering with the remaining layers and buttercream , ending with cake,refrigerate covered in plastic wrap for at least 3 hours and up to overnight,remove the cake from the refrigerator and carefully transfer to a wire rack over a sheet pan,to make the ganache , chop the butter and scatter it into the chocolate pieces in a large bowl,heat the cream and corn syrup in a saucepan over moderate heat,as soon as the cream mixture begins to boil , pour it over the chocolate mixture and begin stirring vigorously,when the chocolate has melted and is combined thoroughly with the cream , stir in the vanilla,quickly begin pouring the ganache over the top of the cake , allowing it to flow down and cover the sides,pack the chopped peanuts onto the ganache to cover the sides of the cake , leaving the chocolate on top exposed,store in the refrigerator,serving suggestions: i like to reserve a little of the buttercream and a handful of whole honey roasted peanuts to decorate the top of the cake,try using a star,then , set peanuts into the buttercream border to form an interesting design', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (219, 'hot tamale burgers', 'easy', '60 min', 'bring rice and 3 cups water to a boil in medium sauce pan,reduce heat to low , cover and simmer 40 minutes or until water is absorbed by rice,meanwhile , heat oil in large skillet over medium heat,add onion , bell pepper , corn , chipotle , adobo sauce , garlic , cumin and salt,saut 2 minutes , then reduce heat to low,cover and cook 15 minutes or until vegetables are tender , stirring once or twice,whisk 1 / 2 cup cornmeal in bowl add to skillet mixture and cover and cook on low for 10 minutes more,stirring once or twice,remove from heat , and stir in hot rice , cilantro , lime juice and zest,cool 20 minutes,wet hands and shape mixture into 8 burgers,refrigerate 30 minutes,prepare grill to medium heat,brush burgers and grill rack with olive oil,grill 7 minutes per side or until crusty on the outside', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (220, 'i can t believe i made cream puffs', 'easy', '55 min', 'heat water and butter to rolling boil,stir in flour , stirring vigorously over low heat about 1 minute , or until mixture forms a ball,remove from heat,beat in eggs all at one time and continue beating until smooth,drop dough by scant 1 / 4 cupfuls about 3\" apart on ungreased baking sheet,bake at 400 for 35 to 40 minutes , or until puffed and golden,cool out of draft,cut in half horizontally , open , and remove any uncooked filaments of dough,make dream whip according to package directions,make pudding with only half the milk it calls for,quickly add the pudding to the dream whip and mix well,fill cream puffs , sprinkle with a little powdered sugar and refrigerate until serving -- if you don\'t eat them first !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (221, 'i hate miracle whip but i love this potato salad that s', 'easy', '40 min', 'boil potatoes until tender but not mushy , set aside to cool,for dressing: mix all ingredients in a bowl,any and all of the ingredients can be adjusted to your taste as my dressing never turns out the same way twice depending on whether i\'m in the mood for sweet , peppery , salty , etc,mix potatoes , celery , onion , egg , and dressing in a bowl and chill,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (222, 'i thought i had nothing to eat rice', 'easy', '35 min', 'boil water , take off heat and add tea bag,let steep,add rice and all other ingredients except butter , bring back to a boil,reduce heat , cover and simmer for 20 minutes,remove from heat , stir in butter until completely melted', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (223, 'impossible bisquick spinach feta pie', 'easy', '50 min', 'combine spinach , onion , red peppers , olives and seasonings in a greased 9 inches pie plate,top with feta,mix bisquick , milk and egg with whisk until smooth , then pour over other ingredients,bake at 400f for 30-35 minutes until knife in center comes out clean', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (224, 'it smells like christmas pumpkin bread', 'easy', '60 min', 'grease two 9x5x3-inch loaf pans,in a large bowl mix together all of the dry ingredients,blend in the water and oil , and mix in the eggs,blend in the pumpkin,fold in the pecans,divide the batter between the prepared pans,bake at 350f for 1 hour , or until a toothpick inserted in the center comes out clean', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (225, 'it s too easy pork chops rice casserole', 'easy', '55 min', 'preheat oven to 350f and spray baking pan with non-stick cooking spray,in frying pan on medium to high heat , sear to brown pork chops in oil on both sides,while pork chops are browning , take baking pan and layer rice , then sprinkle with black pepper , then dry onion soup mix over all,in small saucepan , bring water to boiling and stir into rice mixture in baking pan just as pork chops are browned,place browned pork chops over all , cover with foil and bake at 350f for 45 minutes , until tender,lift up pork chops to stir rice mix in pan and taste,add more water if needed,when the rice is done , the pork chops are usually very tender,i\'ve found that over the years cooking times may sometimes vary', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (226, 'jamaican me hungry chicken bake', 'easy', '65 min', 'for the rub , combine all ingredients in a ziploc bag,reserve 2 tsp for topping,place chicken into ziploc bag and rub mixture into chicken,let sit in fridge for at least 1 hour or overnight,for topping , saut garlic , peppers , and onion in olive oil until tender,add remaining ingredients and cook until slightly thickened,to bake , place seasoned chicken in a 9x13 baking pan,divide topping equally on top of each breast,bake 30-45 minutes or until chicken is cooked through,eagerly anticipate your meal as the aroma wafts through your house !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (227, 'jamba juice at home lime it up smoothie', 'easy', '10 min', 'pour the limeade mix in the blender,add the strawberries , mangoes , sherbet / sorbet and ice cubes,blend until you have a smooth consistency,pour into glass and drink up', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (228, 'jamba juice at home strawberries wild smoothie', 'easy', '10 min', 'pour the apple juice in the blender,add the strawberries , bananas , frozen yogurt and ice cubes,blend until smooth with a thick consistency,if vegan use suitable sugar', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (229, 'jeera on cubes barbecue marinade', 'easy', '30 min', 'roast coriander and cumin and ground afterwards,mince chilli,mix all ingredients well,if you marinate your meet longer than 8 hours add the garlic 4 - 8 hours before you barbecue,cover your meet for 4 - 48 hours , the longer the better,barbecue the cubes until done,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (230, 'joe s peppermint cookies n cream brownies', 'easy', '50 min', 'preheat oven to 350f,line a 913-inch baking pan with aluminum foil , and grease lightly,in a medium-large saucepan over low heat , melt together butter and chocolate , stirring occasionally,stir in sugar , salt and vanilla & peppermint extracts,remove from heat,whisk in eggs one at a time , waiting until each is fully incorporated before adding the next,stir in flour and cocoa powder until mixture is uniform,stir in crushed cookies,spread batter into prepared pan,if desired , crush 3-4 additional cookies finely and scatter on top of batter,you can also crush 1 candy-cane and sprinkle it on top,it will melt slightly but still be pretty and festive,bake for about 35 minutes , until a toothpick inserted into the center comes out with moist crumbs , but not coated with batter,cool brownies in pan on wire rack for 20 minutes , then lift brownies in the foil out of the pan and place on a wire rack to cool completely before slicing', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (231, 'just trust me bistro chicken salad', 'easy', '80 min', 'marinade,create a marinade , by mixing oil , orange juice , vinegar , & salt,whisk to blend,toss into cooked chicken and allow to marinate for several hours in a plastic bag in the refrigerator before adding other ingredients,assembly,in a very large bowl , gently toss all ingredients except mayo and reserved juice,dressing,whisk together mayonnaise and pineapple juice,pour over mixed ingredients and toss,let rest,cover and refrigerate for 1 hour before serving', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (232, 'kelly s creamy cheddar pea salad', 'easy', '20 min', 'in large bowl , combine mayo , relish , sugar , seas,salt and mustard,gently fold in rest of ingredients adding peas last so they don\'t get broken up and mushy,chill,if you like it extra creamy , double the sauce', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (233, 'kicked up oven fried chicken', 'easy', '345 min', 'in a large bowl whisk the buttermilk , oil , hot pepper sauce , minced garlic , dijon mustard , 1 teaspoon salt and about 1 / 2 teaspoon black pepper,add in sliced onion and chicken pieces,turn to coat / mix well,cover and refrigerate for a minimum of 4 hours or up 24 hours , turning occasionally,place a cookie rack on a foil-lined 15x10-inch baking sheet,in a bowl mix together dry breadcrumbs , parmesan cheese , flour , thyme spice , paprika , cayenne pepper , 1-1 / 2 teaspoon seasoned salt salt and garlic powder,remove the chicken pieces from marinade , allowing any excess marinade to drip off the chicken,dip the chicken pieces into the breadcrumb mixture and turn to coat completely,arrange chicken on rack or racks on the baking sheets,let chicken stand for 30 minutes , no more no less !,set oven to 425f,drizzle the melted butter over the chicken pieces,bake until crisp , golden and cook through about 45 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (234, 'kicked up oven baked pork baby back ribs', 'easy', '80 min', 'set oven to 425f,line a baking sheet with foil , then arrange the ribs in a single layer,season with season salt and pepper,bake for about 25 minutes,turn the ribs over and bake for another 15 minutes or until browned,meanwhile in a bowl combine ketchup , hoisin , lemon juice , garlic , louisiana hot sauce , habanero chili hot sauce , cinnamon , allspice and seasoned salt,mix well to combine,baste the ribs with about half the sauce,cook for another 10 minutes more,turn over and baste with the remaining sauce and continue to bake for another 15 minutes or until the ribs are thoroughly cooked through', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (235, 'kitchen sink soup', 'easy', '40 min', 'saut onion , garlic and celery together until limp,add carrots , and saut a few minutes,add in spaghetti sauce and stock,bring to a boil,add seasonings,add noodles , broken up , and peas and corn,boil until noodles are almost done,add red pepper and cook through,serve hot with buns,this is just how i used up my left overs,:)', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (236, 'korney spinach dip stuffing side dish', 'easy', '35 min', 'in mixing bowl add spinach dip and sour cream,mix and add corn and mix again,melt margarine in microwave,add stovetop dressing or dressing cubes , pour over the melted margarine,mix well,add 1 / 4 tsp salt or salt substitute,add pepper to taste,mix,preheat oven 375f,spray pam in a round deep 1 1 / 2 quart casserole dish,pile into casserole dish,place foil on top,cook 25 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (237, 'laings english pickled onions copycat', 'easy', '45 min', 'peel and rinse onions under cold water and fill 1ltr sterilized pickle jars as full as possible,to each jar , add 2 tbs of pickling spice mix,add white vinegar to fill each jar,seal tightly , leave at room temperature for 7-10 days,give jars a shake to stir up spices once a day,after 7 days , taste test the pickles,if the center of the onion tastes like a pickle , with little or no onion taste , you\'re done -- refrigerate jars to stop pickling process,lasts for 3-4 months in fridge,liquid may become slightly murky over time but pickles are fine,they\'ll likely be all gone before then', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (238, 'leftover lo mein for two', 'easy', '9 min', 'combine everything but pasta on stove top and heat until bubbling,add pasta and serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (239, 'leftovers dessert', 'easy', '5 min', 'combine cream cheese and cool whip,fold fruits into cream cheese mixture,crumble half of the cake or any other sort of sweet crumbs in a glass,layer some of the fruit mixture , the rest of the cake , then the rest of the fruit,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (240, 'lemon coconut custard pie', 'easy', '60 min', 'whisk together squash , sugar , eggs , flour , lemon and coconut flavorings , and butter,pour into pie crust,bake at 350 f for 30-45 minutes,pie should be set and barely golden brown on top,can be served with cool-whip or other favored whipped topping', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (241, 'lite cretons', 'easy', '185 min', 'this is a quick and easy version of the original recipe for cretons,simply place the veal into a 2-quart saucepan,add all the ingredients at one time , plus one can of water as suggested on the soup can,mix well and cook uncovered on the stovetop over a very low flame until all the liquid is absorbed and mixture is very thick in consistency,approximately 3 hours,cool slightly and pour into individual covered plastic containers and chill overnight,this can be frozen for freshness and defrosted easily', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (242, 'little bear s seafood soup', 'easy', '60 min', 'saute onion and garlic in olive oil over medium heat until onion is almost tender,sprinkle in 2 tablespoons old bay seasoning and stir constantly for about 30 seconds,add in chicken stock , red wine vinegar , oregano , parsley , and tabasco,bring to almost boiling over medium heat,while this is heating , lay out frozen seafood mix , shrimp , and catfish on a cutting board,sprinkle with the juice from one lemon,then sprinkle with remaining one tablespoon old bay seasoning and black pepper,let this stand while mixture is heating,when liquid is almost boiling add in the seafood mix , rice , tomato soup , canned tomatoes and okra,be sure to add all liquid from both the tomatoes and okra,lastly , add in the gumbo fil,simmer for 30 minutes , stirring occasionally', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (243, 'loaded deviled eggs', 'easy', '20 min', 'transfer egg yolks from halves to mixing bowl & combine with remaining ingredients,add the sour cream or buttermilk last & use more as needed to reach desired smoothness,spoon yolk mixture into halves,the bulk will have grown substantially , so pile it high & \"dust\" with a sprinkle of paprika', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (244, 'lupo s chicken spiedies', 'easy', '25 min', 'dice chicken breasts into 1\" cubes,whisk all other ingredients together to form marinade,set some aside for basting or sauce if desired,add marinade to chicken and refrigerate overnight , stirring occasionally,thread 5 or so cubes onto metal or soaked bamboo skewers and grill for a few minutes either side , just until meat is firm,place two skewers on a fresh bread roll or italian bread , grip the meat firmly with the bread and pull out skewers,enjoy !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (245, 'ma s oatmeal cake and icing', 'easy', '45 min', 'in a small bowl combine quick oats , margarine , and boiling water,cover and allow margarine to melt , and mixture to cool a bit,mix remaining cake ingredients and mix well,spread into 9x13 greased and lightly floured cake pan,bake at 350f for approximately 35 minutes or until done,for icing: mix icing ingredients until well blended,spread over cooled cake and put under broiler until coconut browns', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (246, 'man rice krispies treats', 'easy', '20 min', 'over low heat , carefully melt butter,add marshmallows and stir until just melted,remove from heat , stir in cereal and spread into a 10,5 x 15 inch pan that has been buttered or sprayed', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (247, 'margarita dip for fresh or grilled fruit', 'easy', '70 min', 'beat cream cheese , limeade concentrate and orange juice in medium bowl with electric mixer on medium speed until well blended,gently stir in cool whip topping,cover,refrigerate at least one hour,serve with cut-up fresh fruit,to grill fruit:,peaches , nectarines and plums get a deep caramel-like flavor when cooked on the grill,here\'s how to do it,put pieces of fresh fruit on skewers,use fruit that\'s just staring to soften , so that it stays firmly on the skewers,sprinkle fruit with cinnamon or nutmeg,place fruit on the grill for a minute to sear,check the underside,once it\'s golden with grill marks , turn it over to finish cooking', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (248, 'meal in a bowl guacamole salad', 'easy', '25 min', 'to make the salad: have all ingredients chilled,break the lettuce into a serving bowl,add other ingredients except cheese,toss lightly with avocado dressing,top with grated cheese,to make the avocado dressing: put all ingredients in the blender and blend well', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (249, 'middle eastern twice baked potatoes', 'easy', '110 min', 'preheat the oven to 200c,wash the potatoes to remove any dirt , pat dry with paper towels,prick the potatoes all over with a fork , brush with olive oil and season to taste with salt and pepper,place the potatoes on a lightly greased baking tray and bake for about an hour or until cooked through,cool for about 10 minutes,while the potatoes are roasting , drain the chickpeas , place in a large mixing bowl and mash with a fork,add the ground coriander , the cumin , the crushed garlic and half the fresh coriander,cover the bowl with with plastic wrap , and set aside,once they have cooled , taking care to keep the shells intact , halve the cooked potatoes and scoop out the flesh,mash the potato flesh until smooth and gently mix with the chickpea mixture,fold in the yoghurt and tahini , and add a little more of either of these if the mixture seems too dry , season with the pepper and salt , to taste,place the potato shells on a lightly greased baking tray and fill them with the potato and chickpea mixture,place the filled potato shells in the oven and bake for 10-15 minutes , or until heated through,serve the potatoes with the remaining half of the chopped coriander', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (250, 'more lish ous cornbread', 'easy', '40 min', 'preheat oven to 425f,in a mixing bowl , beat the eggs , mayo , buttermilk and oil until smooth,combine the cornmeal , sugar , baking powder and salt,add to the egg mixture and beat until just combined,pour into a large greased cast iron skillet or greased round baking dish,bake at 425f for 25-30 minutes or until a toothpick inserted into the center comes out clean', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (251, 'nat s king cole coleslaw', 'easy', '80 min', 'whisk together vinegar , maple syrup , soy sauce , sesame oil , and gingerroot in a small bowl,in a large bowl , combine cabbage , onions , carrots and apple,pour dressing over salad and mix well,refrigerate for 1 hour before serving', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (252, 'near east rice pilaf low fat', 'easy', '25 min', 'in a non-stick pot , heat oil,add orzo and sautee until browned,add the rice,to the 3 cups of boiled water , add the chicken soup mix , garlic powder , turmeric , black pepper , and turmeric,add seasoned water mixture to the pot , cover , and simmer for 20 minutes until all water has evaporated,don\'t open lid,remove from heat after 20 minutes and allow to rest 10minutes,fluff with fork', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (253, 'no copycats here homemade chicken tortilla soup', 'easy', '65 min', 'add 1 tbsp of olive oil to your soup pot , let heat on medium heat for about 3 minutes prior to adding chicken,salt and pepper chicken breasts,i like to cut the cooking time down , so i slice my chicken in half to thin it out,sprinkle with cumin on both sides and add chicken to the pan,cook until both sides are golden brown,remove the chicken from the pan and set aside for at least 10 minutes to cool prior to cutting in thin slices,cut up celery , bell pepper , onion and jalapeo and add to the pan on medium heat,let this cook for about 5 minutes prior to adding the corn,cut the corn off the cobb and add to the hot pan,let all veggies cook for 10 minutes on medium heat,chop up the two chipotle peppers and add to the pan with the one teaspoon of the sauce that covers the peppers,let cook for two minutes prior to adding the can of crushed tomatoes,let this all simmer together for 2 minutes and then add the box of chicken broth,add in 2 tbsps of the chopped cilantro and let soup boil for about 3 minutes,bring soup down to a simmer for about 20 minutes to let the flavors melt together,serve by garnishing with the remainder of cilantro and an avocado slice', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (254, 'no harm eggplant parm ww', 'easy', '70 min', 'preheat oven to 375,slice ends off of eggplant , and cut it lengthwise into 1 / 2-inch strips,use a paper towel to blot eggplant slices on both sides,spray a large baking pan with nonstick spray,season crumbs with garlic powder , salt , pepper and , if you like , additional seasonings,coat eggplant slices on both sides -- first with egg whites , and then with fiber one crumbs,place slices flat on the baking pan , and cook in the oven for 30 minutes,then , flip slices over and bake until browned on both sides,remove pan from oven , but leave oven on,spread 1 / 4 cup of sauce over the bottom of an 8x8-inch baking dish sprayed lightly with nonstick spray,arrange half of the baked eggplant slices evenly over the sauce,continue to layer ingredients evenly in this order: sauce , mozzarella and parm topping , sauce , eggplant , sauce , and cheeses,cover dish with foil and return to the oven,bake for 25 minutes , or until heated throughout,allow to cool slightly , and then cut into quarters', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (255, 'no name beef recipe loco moco', 'easy', '30 min', 'cook rice according to package directions,divide ground beef in half and make two patties seasoned to your own taste,cook patties in a large skillet until done and then set aside leaving fat in pan,cook onions in pan until tender and set aside,fry both eggs in same pan until done , but with soft centers,heat gravy in sauce pan or microwave oven,use two dinner plates , making a bed of the cooked rice on each,place one of the beef patties on each bed of rice,divide cooked onions and place each half around each of the patties,top each patty with one of the fried eggs,divide beef gravy and pour each half over the plates of food', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (256, 'not your average ham bean soup', 'easy', '80 min', 'place ham bone , onion , celery , carrots and water in a large stock pot,bring to a boil and reduce heat to simmer , skimming foam occasionally,when meat is starting to separate from the bone , remove bone and allow to cool,add bouillon , i used ham flavored better than bouillon , garlic salt and pepper,add beans , whatever kind you like , tomatoes and continue to simmer,remove ham from bone and return ham to soup mixture along with cubed ham,at this point i recommend you taste test the soup for seasonings , but be careful , it doesn\'t bite your tongue , it grabs your throat !,i served this with corn bread and fresh fried potatoes with bacon & onion,it gets better after a day or two in the refrigerator', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (257, 'not your every day chicken salad chicken salad', 'easy', '245 min', 'blend mayonnaise , vinegar , garlic and dill,refrigerate for several hours or overnight,stir together chicken , peppers and cheese and blend with the chilled dressing,serve !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (258, 'not lasagna', 'easy', '80 min', 'preheat oven to 350f,spray an 8-inch glass baking dish with non-stick spray,measure 1 / 2 cup spaghetti sauce from jar and spread evenly on bottom of dish,brown ground beef in a skillet over medium heat,drain and return to skillet,add remaining spaghetti sauce , italian seasoning and garlic salt,simmer for 5 minutes,layer half of ravioli on the sauce in the dish,spread half of the beef mixture over the ravioli and top with 1 cup of the mozzarella cheese,repeat layers one more time , ending with cheese,bake for 1 hour,allow to stand for 5 minutes before serving', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (259, 'old ladies on a bus chicken', 'easy', '75 min', 'skin chicken , if desired,arrange chicken on a foil-lined 13x9x2-inch baking pan,set aside,in a small bowl , combine marmalade , barbecue sauce , worcestershire sauce , and lemon juice,pour over chicken,bake , uncovered , in a 350 degree oven for 45 minutes , spooning sauce over chicken occasionally,increase oven temperature to 400 degrees,bake for 15 minutes more or until chicken is tender and no longer pink', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (260, 'outback steak rub', 'easy', '5 min', 'mix , sprinkle lightly on your favorite cut of beef , then cook as desired !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (261, 'party taco dip', 'easy', '10 min', 'in a large mixing bowl blend the following ingredients: cream cheese , sour cream , mayonnaise,stir in dry ortega taco seasoning mix,spread in 9x13-inch pan and top with any / all of the optional ingredients listed above,portions should be to your liking-- put on as little or as much as you would like,serve with tostitos white corn chips !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (262, 'pass me another hot clam dip', 'easy', '15 min', 'mix together and bake until cheese melts,best when served warm with assorted crackers,can be used chilled as a spread', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (263, 'pasta with shrimp eggplant', 'easy', '50 min', 'heat oil in a nonstick skillet over medium high heat and add eggplant and cook until almost soft,bake spaghetti squash at 450f for 1-2 hours until firm to the touch , let cool and then scoop out pulp,add peppers , onions and oregano to eggplant and saut until tender,stir in shrimp,cover and steam , stirring every so often,add in spaghetti squash and cook for less than a minute,add olives and parsley: toss again & serve !', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (264, 'perfect chocolate frosting', 'easy', '15 min', 'place a large bowl , filled halfway with ice , in the sink,in a medium size pot over medium low heat , melt chocolate , cream , and butter,stirring constantly , cook the mixture until all of the butter and chocolate melts and thickens,cook for 5-6 minutes,do not let boil,remove pot from heat,whisk in the sifted confectioners\' sugar until mixture becomes smooth , then put the pot on top of the bowl of ice,beat with an electric mixer on low speed for 4-5 minutes until frosting becomes smooth , thick , and fudgy,remove from ice,spread onto cooled cake layers,the frosting will thicken as it sets up,if the frosting gets too hard to spread , put back on low heat and stir constantly until you get the spreading consistency desired,i have been adding 1 tbs,of light corn syrup to the initial heavy cream and chocolate mixture to add more glossiness to the frosting', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (265, 'pink stuff cherry pie filling pineapple dessert', 'easy', '5 min', 'combine all ingredients and mix well,serve chilled,your family and friends will go nuts', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (266, 'pizza pan potato skins', 'easy', '60 min', 'preheat oven to 375f,cook the diced bacon until crispy , remove from bacon fat and drain on paper towel,forget everything you were ever taught about peeling potatoes , and peel them with a knife leaving a good bit of potato on the skin,retain center of potatoes for another recipe , or slice them into wedges and cook in the same manner as the potato skins,deep fry the potato skins until crispy and golden,drain thoroughly and salt to taste,spread the potato skins evenly on a pizza pan,sprinkle evenly with the green onions , cheese and bacon,bake for 10-15 minutes until hot and cheddar is melted,serve hot with sour cream for dipping', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (267, 'pizza steak', 'easy', '30 min', 'combine flour , salt , & pepper,pound into steaks,in large skillet , brown onions in oil over medium heat,remove & set aside to drain,add steaks to skillet , & brown well on both sides,return onion to skillet , piling them on top of steaks,pour pizza sauce over all,cover skillet , reduce heat to medium low , and simmer 10-12 minutes , until steaks are cooked through,uncover and top evenly with parmesan and mozzarella,cover , and cook 3-5 minutes until cheeses are melted', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (268, 'posh pork roast crockpot', 'easy', '315 min', 'in a medium sized bowl combine all gravy ingredients and set aside,in a large gallon size plastic zipper type bag , combine flour , seasoned salt , pepper and shake well to combine,place meat into bag and shake well to coat pieces,heat grease until hot but not smoking , and cook meat until lightly browned on all sides,put half of meat into crockpot , and top with half of gravy mixture,top with rest of meat and gravy mixture,cook for 5 hours on low', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (269, 'puddingkuchen custard bake', 'easy', '75 min', 'in a bowl combine eggs , sugar , flour and milk,grease a stoneware dish with all the butter,pour in the dough and add fruit , raisins or almonds to taste,bake in the cold oven at 180c for about 60 minutes or until custard has set,you might need to cover the dish after 40 minutes or so,allow to stand and set for at least 10 minutes before serving', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (270, 'quick and healthy picker uppers apple treats', 'easy', '30 min', 'cut apples into small slices , (about 8 slices to an apple not minuscule as they will mush when cooked,shred baby carrots into a bowl,in a bowl , mix sugar , cardamon , and cinnamon , whisk together,unroll crescent rolls onto a slightly floured surface or silpat and separate into 8 triangles , brush dough with melted butter,divide apples evenly over dough,sprinkle carrot shreddings over apples,drizzle 2 tsp honey over apple / carrot mixture,sprinkle cinnamon / cardamon / sugar mixture over apples and carrots,roll from fat side to narrow side encompassing apple / carrot mixture,place on nonstick cookie sheet,cook for 20 min at 350f,remove from oven and let cool,drizzle remaining honey over rolls,enjoy !,check turnovers after 15 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (271, 'quick biscuit bread', 'easy', '20 min', 'preheat oven to 400 degrees,lightly grease a cookie sheet,remove the buiscuits from the can and separate,place one buiscuit in the center and place the remaining buiscuit around it slightly overlapping,now flatten them out with your fingers into a 10 inch circle,brush with the olive oil,sprinkle with the remaining ingredients,you can use any kind of cheese you have on hand,chili powder and monterey jack and some chopped chillies give you a great tex-mex bread,bake about 15 minute until edges are nice and brown,pull apart to serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (272, 'quick buns', 'easy', '150 min', 'grease or parchment paper 1 or 2 cookie sheets , depending on the size,dissolve sugar in warm water,sprinkle yeast over liquid,combine milk , salt , and butter in saucepan and heat until warm,add yeast and flour,work and knead dough for about 10 minutes,cover and let rise in warm place for about 30 minutes,turn on floured surface and pat to 3 / 4\" thickness,cut with round cookie cutter and place on prepared sheets,let rise in warm place for about 45 minutes or until double in size,i usually put some flour in a hand sieve and sprinkle the tops before baking,bake at 375 degrees for 15-20 minutes', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (273, 'real new york style cheesecake supreme', 'easy', '75 min', 'make crust:,combine first three ingredients,cut in butter until mixture is crumbly,add egg yolk and vanilla,blend thoroughly,pat 1 / 3 of the dough on bottom of 9-inch springform pan,bake in hot oven , 400f , about 8 minutes or until golden,cool,butter sides of pan , attach to bottom , and pat remaining dough on sides to height of 1 3 / 4 inches,turn oven up to 450f place a 9x13 inch pan of hot water in bottom of oven , this helps to keep the custard creamy,make filling:,beat softened cream cheese until creamy,add vanilla,mix next 4 ingredients , , gradually blend in cheese,add eggs and egg yolks one at a time , beating after each just to blend,gently stir in whipping cream,turn into crust-lined pan,bake at 450f for 12 minutes,reduce heat to 300f and continue baking for 1 hour,may need a little time longer because of water,remove from oven,cool,loosen sides with spatula after 1 / 2 hour,remove sides at end of 1 hour,this cheesecake is at it\'s best if refrigerated overnight', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (274, 'red river shoot out pigskins', 'easy', '15 min', 'in a 4-cup glass measure , stir together chili sauce , honey and mustard,microwave on high for 3 minutes,stirring after every minute,add \"little smokies , \" microwave on high for 2 minutes or until heated through,keep warm', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (275, 'red robin drink recipe mai tai', 'easy', '1 min', 'add grenadine and orgeat into a bottom of glass,mound ice into glass,add white rum and orange curaco,add oj , sweet and sour , and pineapple juices,float\" bacardi dark rum and myers dark rum on top,should go in a glass aprox 13- 15 ounces', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (276, 'roast pork and apple dinner', 'easy', '30 min', 'spray large nonstick skillet with cooking spray,add chops,cook on medium-high heat 4 minutes on each side or until browned,add onion , mushrooms and dressing,cook an additional 3 minutes,stir in rice , broth , water , apples and thyme,reduce heat to medium,simmer 10 minutes or until heated through', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (277, 'russian dressing ww', 'easy', '135 min', 'in small bowl or jar with tight-fitting cover , combine juice , mayonnaise , green bell pepper , red bell pepper , tomato paste , yogurt , horseradish , onion , mustard , chili powder and pepper,whisk or cover and shake to mix well,refrigerate , covered , 23 hours,whisk or shake before serving,each serving provides: 1 fat , 1 / 2 vegetable , 10 optional calories,per serving: 49 calories , 1 g protein , 3 g fat , 5 g carbohydrate , 148 mg sodium , 3 mg cholesterol , 1 g dietary fiber,1 points', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (278, 'sangria fruit cups non alcoholic', 'easy', '260 min', 'bring orange juice to a boil,add to jelly powders in a medium bowl,stir at least 2 minutes until jelly is completely dissolved,add cold water,spoon fruit into 12 clear cups and pour jelly mixture over fruit,refrigerate at least 4 hours or until set,top with whipped topping just before serving,store leftovers in refrigerator', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (279, 'sausage and gravy low fat', 'easy', '500 min', 'mix ground turkey and spices together and let sit in fridge overnight for flavors to meld,brown meat mixture in a large fry pan,once brown , sprinkle with flour,stir in milk and evaporated milk,bring to a boil , stirring constantly and simmer till desired thickness,serve with your favorite reduced fat biscuits , toast , rice or noodles', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (280, 'secret ingredient bbq meatloaf', 'easy', '75 min', 'preheat oven to 350 degrees,while oven is preheating , mix in a large bowl all ingredients except for the 1 / 8 cup of bbq sauce,spray a 2 quart baking dish with the cooking spray,pour meatloaf into dish , and free form into a loaf shape,bake for 45 minutes , then drain if needed,take remaining bbq sauce and spread over top and sides,return meatloaf to over and bake for 10 to 15 minutes,let meatloaf \"rest \" for 10 minutes , serve and enjoy,:)', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (281, 'secret ingredient beef stew', 'easy', '240 min', 'in a big pot or dutch oven , brown meat in salad dressing,add the next 9 ingredients and bring to a boil,reduce heat and simmer for 1-2 hours or till meat is tender,add the potatoes , carrots , pepper and onion,cover and simmer another hour or until veggies are tender,combine flour and cold water in a shaker , stir into stew and bring to a boil till thickened,serve', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (282, 'seva bean vegetable stew', 'easy', '50 min', 'cook onions& garlic with ghee on low heat,when onions golden , add carrots and shortly after potatoes,after 2 minutes add beans,do not rinse beans,add bean\"juice\" as well,cover veges with water plus a little bit,add curry / garam masala,bring to a boil,simmer for 20 minutes or until veqes are done,salt , pepper and spice to taste,if needed , add corn starch to thicken', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (283, 'sexy greek cocktail', 'easy', '5 min', 'just mix together ouzo and orange juice and pour over ice in a collins glass,garnish with an orange slice and get friendly', '2025-10-05 13:35:11', '2025-10-05 13:35:11', NULL);
INSERT INTO `re_recipes` VALUES (284, 'she crab cream of crab soup', 'easy', '45 min', 'combine all ingredients in double boiler,simmer until heated through,enjoy', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (285, 'skinny meatloaf', 'easy', '105 min', 'preheat oven to 350f,coat a broiler pan with nonstick spray and line the bottom of the pan with foil for easy clean up,combine the ground meats , crumbs , parsley , onion , egg whites , milk , worcestershire , salt and pepper in a bowl , using your hands to mix,transfer the mixture to the prepared pan , shaping it into a 9x5\" loaf,stir ketchup , mustard , and brown sugar together in a bowl , then spoon on top of the meatloaf,bake until meatloaf reaches 160f on an instant read thermometer , about 1 hour,let rest at least 5 minutes before slicing,mushroom sherry sauce:,fry bacon in a skillet over medium heat until crisp , about 5 minutes,transfer bacon to a paper towel-lined plate and return pan with drippings to the burner,add mushrooms , shallots , and saute until mushrooms are browned , about 5 minutes , stirring occasionally,stir in flour and tomato paste,cook 1 minute,deglaze with sherry and simmer until evaporated,gradually add brother , scraping up brown bits from the bottom of the pan,bring to a simmer and cook until slightly thickened , about 5 minutes,finish sauce with reserved bacon , butter , vinegar , salt , and pepper,serve with meatloaf', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (286, 'skordy new potatoes w rosemary lemon olive oi', 'easy', '35 min', 'preheat oven to gas mark 8,cut your potatoes into 1 inch chunks,toss in a bowl the potatoes in the oil with the rosemary and lemon juice and lemon zest and garlic,chuck the lot onto a baking tray not forgetting to scrape herbs and oil from the bowl,bake for twenty minutes while listening to funky tunes and enjoying the yumminess that is to come,check that potatoes are firm yet \"give\" with a fork,squish them a little bit with a fork and put back in oven for another 10 minutes on gas mark 3,listen to more tunes,serve with a squirt of fresh lemon and with greek or curry or vegan stuff or just eat out of pan,i suggest tatskiki,you can pulverize this into a dip using more olive oil and lemon juice or eat it chunky,i like chunks,i reckon this would make an ace potato salad base,i absolutely hate mayonnaise , so there\'s no chance of me making that ever ! however you\'re welcome to try--i\'ll let you', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (287, 'slightly spicy black bean burgers', 'easy', '20 min', 'place beans in a large bowl and sit aside,heat oil in a large frying pan,add onion , garlic , corn and cumin,saut about 2-3 minutes over medium heat,add your green chili sauce and saut another minute or two,place in bowl with beans , let cool and mash with stick blender , it is okay if not every piece is mashed,add salsa , chili powder , flour and breadcrumbs,stir to blend ingredients with a rubber spatula,form in 4 patties and place on wax paper,store in tupperware until ready to cook,to cook , spray on one side and saut on medium heat until browned , repeat on other side,i serve these on toasted burger buns with pepperjack cheese , mayo , lettuce and tomato but serve it as you like', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (288, 'sloughed tortellini salad', 'easy', '75 min', 'cook and drain tortellini as directed on package,rinse with cold water,drain,place spinach in boiling water,cover and cook 1 minute,drain,immediately rinse with cold water,drain,place tortellini , spinach , onions , olives , bell pepper and shrimp in large glass or plastic bowl,toss lightly,mix remaining ingredients,toss with tortellini mixture,cover and refrigerate at least 1 hour to blend flavors but no longer than 24 hours', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (289, 'south beach stuffed bell peppers', 'easy', '30 min', 'wash the peppers , cut the tops off , and place in oiled glass dish,cover and microwave the peppers for 5 minutes,saute the veggies and ground turkey with a dollop of olive oil,add the tomatoes and seasonings,cook for 3-4 minutes to evaporate some of the liquid,stuff the peppers and top with cheese,bake at 350 for 10 minutes or until the peppers are soft and the cheese is toasted,add ins: you could add cooked rice or stir in extra cheese to the mixture before baking', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (290, 'splenda d cheesecake sugar free low carb', 'easy', '80 min', 'grahm cracker crumb crust:,mix together: crumbs , splenda , spices , and almonds,stir in butter , mix well,press into bottom and slightly up sides of 10 inch spring form pan,set aside,filling:,first beat heavy whipping cream until it starts to look frothy , then add cup splenda and 1 teaspoons vanilla extract,continue beating until firm peaks form,set aside,filling:,preheat oven to 350f,in a separate bowl , thoroughly beat remaining filling ingredients with a mixer , for about 5 minutes,scraping down the sides occasionally,take half of whipped cream mixture and fold into filling,set aside other half of whipped cream mixture,pour filling into prepared pan,bake at 350f for 35 - 40 minute,remove from oven and let cool for 5- 10 minute,reset oven to 475f,while cheesecake is cooling prepare topping,topping:,mix together topping ingredients and pour over cake,return cheesecake to oven and bake at 475f for 8 - 12 minute,cool , and chill cake for at least 4 hours before serving,just before serving decorate with remaining whipped cream and fruit of your choice,i prefer blackberries,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (291, 'sticky chicky dump chicken', 'easy', '55 min', 'for immediate cooking:,preheat oven to 350f,combine sauce ingredients and blend until smooth,toss chicken with sauce and place into a large baking dish,bake until chicken juices run clear,for freezing:,combine sauce ingredients until smooth,place sauce and chicken into a 1-gallon freezer bag,shake to coat chicken,lay flat in freezer,to thaw and cook:,thaw completely,preheat the oven to 350f,empty the contents of the bag into a large baking dish and bake until the juices run clear', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (292, 'stove top stuffing', 'easy', '20 min', 'melt 1 tablespoon butter in saute pan,stir in minced onions and celery seed,in a large mixing bowl , mix parsley , salt & pepper , sage and thyme,stir into butter mixture in pan,stir in chicken broth and 1 / 4 cup butter,once everything is mixed together in pan then add in bread crumbs,stir to combine and then cover,remove from heat and let sit 8 - 10 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (293, 'sun dried tomatoes', 'easy', '250 min', 'core the stem area out from each tomato,cut each tomato in half crosswise,take each tomato half in hand- with the cut-side out- and give it a quick , gentle squeeze to force out the seeds,use a finger to sweep remaining seeds out,place each tomato , cut-side up , on a cookie sheet,spray or drizzle olive oil across the top of each tomato half,sprinkle garlic , basil , oregano across the tomatoes,season with salt and pepper to taste,bake in a 200f oven for 4-6 hours or until the tomatoes are\"dry\" to the touch,when they are cool , cut each tomato half in quarters and store in fridge-- or start nibbling immediately', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (294, 'tastes like mounds bar kahlua cake', 'easy', '150 min', 'preheat over to 350f,put all ingredients for the cake in a bowl,mix on low for 1 minute to combine,scrape bowl,mix on medium high for a full 3 minutes to make it light and fluffy,spray an angel tube pan or bundt pan with baker\'s spray,pour batter in pan and bake for 45 to 50 minutes until done,let cool in pan and then turn out onto you serving platter,while cake is cooling , make topping and frosting,put chopped chocolate in heatproof bowl,heat cream in a saucepan on medium high until it starts to boil,as soon as it starts to bubble , pull it off the heat and pour the hot cream over the chocolate,stir immediately with a whisk to incorporate the cream into the chocolate,stir until completely melted,let it cool,when it gets to spreading consistency you want to coat your cake,for the topping , combine sugar , cornstarch and salt to a heavy saucepan,add the coconut milk and cream of coconut,heat on medium heat and stir until smooth and starts to boil,stir until it thickens , about 5 - 7 minutes,keep stirring so that it does not stick to pan,take the pan off the heat and pour the mixture into a larger bowl and add shredded coconut,stir to combine,let this cool completely,take about a half cup of the topping and stuff it into the middle of the cake,fill it to the rim and flatten off with a table knife,then frost cake , the frosting will be smooth and runny so the technique here is to place a dollop of frosting on the top of cake , coax it over to the side with knife so it starts to run down the side,spread smoothly along the side of cake,take cake and put it in the refrigerator until the frosting firms up just like the candy bar,this will take about 30 minutes or so,after that , take cake out of refrigerator and you are going to mound the remaining half of your coconut topping on the top of the cake,place back in the refrigerator for about 30 to an hour,i know that this sounds like a lot of work , but this cake is truly decadent !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (295, 'tastes like v 8 juice', 'easy', '25 min', 'blend well and chill,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (296, 'the bomb pumpkin soup', 'easy', '35 min', 'melt butter in large , leavy pot over medium-high heat,add carrots and next 6 ingredients and saut until vegetables are softened , about 10 minutes,discard bay leaf,transfer mixture to processor and blend until smooth,return mixture to pot,add stock and all remaining ingredients,boil soup over medium-high head to blend flavours , about 15 minutes,cool slightly,working in batches , puree soup in blender until smooth,return soup to pot,season to taste with salt and pepper,bring soup to simmer,divide among serving bowls , and sprinkle with roasted pumpkin seeds that have been hulled or roasted peanuts,this is so very yummy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (297, 'the mooch zucchini sandwich', 'easy', '30 min', 'working in batches , pan fry the garlic and zucchini until lightly browned , turning once to brown both sides,while sauting the above , toast the bread,on each slice of bread spread layer of mayonnaise , salt and pepper to taste , and coat with layer of parmesan cheese,on one half of sandwich put sauted zucchini,on one half put fresh tomato slices,put halves together and you have a marriage of flavor made in heaven', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (298, 'the u of l game day dip', 'easy', '15 min', 'fry sausage in skillet then drain,cut cream cheese in cubes and put in crock pot,then add all other ingredients and let set and get warm', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (299, 'the works crock pot chili', 'easy', '370 min', 'cook ground beef , garlic , onion , and red pepper over medium high heat,drain excess fat and put in crockpot,combine all remaining ingredients in crockpot and stir well,cook on low for 6-8 hours', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (300, 'the carrot cake', 'easy', '1500 min', 'make sure the eggs are room temperature put parchment paper in the bottom of your cake pan,mix together the flour , baking powder , baking soda , cinnamon , nutmeg and sugar , salt , set aside,in another bowl beat the eggs for ~30 sec , add the melted butter , add the shredded carrot,bake at 350f for 35-40 minutes , then check the cake , it is done when it springs back when lightly pressed in the center and the toothpick comes out clean,fill and cover with cream cheese frosting,other recipes i have seen for cream cheese frosting use tons of powdered sugar , i use 2-3 cups maximum , because i don\'t like it over sweet , but you add as much as you think it needs', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (301, 'the creamed dried beef chipped beef recipe', 'easy', '75 min', 'melt butter in 2 quart sauce pan or larger,shred dried beef by hand into small pieces,add dried beef to melted butter and cook over medium-high heat until edges curl,stir in flour and mix thoroughly,add milk , reduce heat to medium low and continue stirring frequently until mixture is smooth & bubbly,when it\'s as thick as you\'d like , bring to a boil , stirring constantly and boil 1 minute,remove from heat and serve over toast and / or home fried potatoes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (302, 'thicker than pea soup pea soup', 'easy', '140 min', 'throw all the ingredients into a large pot , bring to a boil , then simmer for about 2 hours , or until the peas have completely softened,make sure you stir this frequently as it will have a tendency to stick to the pot,add more water if gets too thick', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (303, 'this old house dressing', 'easy', '30 min', 'dressing,combine first 11 ingredients and let rest for a day before making salad to allow flavors to blend,salad,combine lettuce , tomatoes and red onions,just before serving add eggs , {salad crunchy mix -,top with bacon and tortilla strips,serve immediately', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (304, 'trini burgers', 'easy', '50 min', 'in a 5-quart stainless steel bowl , gently but thoroughly combine the ground beef with the worcestershire sauce , thyme , cumin , and cayenne pepper,gently form the ground beef mixture into eight 4-ounce , 3 / 4-inch-thick patties,use a metal spoon to make a small indentation in the center of 4 of the beef patties,combine the onions and cheddar,divide this mixture into 4 equal portions and place a portion in each indentation,top with another patty and gently form into a burger , making sure to seal all open edges,season the burgers with salt and white pepper,cover the burgers with plastic wrap and refrigerate until needed,grill the burgers over a medium wood or charcoal fire,cook to the desired doneness: about 5-6 minutes on each side for rare , 6-7 minutes on each side for medium , and 9-10 minutes on each side for well-done,remove the burgers from the grill,toast the buns , cut side down , on the grill or griddle or in a nonstick saute pan until golden brown , about 1 minute,spread 1 / 2 tablespoons,mayonnaise onto each burger bun half,place 1 of the lettuce leaves on the bottom half of each bun , then top each with a burger , 2 of the tomato slices , 2 of the papaya slices , and the top half of the bun,serve immediately accompanied by\"trini tropical fruit salad', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (305, 'we hate zucchini bread zucchini bread', 'easy', '45 min', 'preheat oven to 350f,grate the zucchini , and measure out four cups,add to large mixing bowl,add eggs , fat , cinnamon , salt , baking soda , vanilla and sugar,stir together well,add flour to the mixture , a bit at a time,stir until all ingredients are mixed,the mixture should resemble thick pancake batter,if it is too thick , add another egg,add nuts , if desired,lightly grease and flour your bread pans , or spray them with nonstick cooking spray,carefully spoon the mixture into bread pans , stopping when the mixture is about 3 / 4 of the way to the top,bake for 35 minutes , or until a golden brown,take out loaves , and let them cool five minutes before removing the bread from the pans to finish cooling on a wire rack', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (306, 'white sangria', 'easy', '5 min', 'pour wine , vodka , schnapps and peach coulis in a pitcher with the slices of fruits 12 hours before serving the sangria,keep in the fridge,just before serving , add ice , fruit juices and complete with lemonade', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (307, 'wild game moose sloppy joes', 'easy', '15 min', 'brown moose and onion in skillet and drain,add other ingredients and simmer for 5 minutes,serve over buns or any other type of bread,you can also use venison / red deer hamburg in this recipe', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (308, 'windy s sweet and sour meatballs', 'easy', '50 min', 'combine beef , eggs , salt , pepper , onion , garlic and breadcrumbs,shape into 48 meatballs and brown till no longer pink inside,drain off excess fat on paper towels,combine vinegar , brown sugar , ketchup , soy sauce , reserved pineapple juice and cornstarch,simmer till thickened , stirring occasionally,add meatballs , pineapple and sweet pepper and simmer until thoroughly heated', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (309, 'world s best and easiest teriyaki chicken wings', 'easy', '75 min', 'mix sauce and sugar together , brush on both sides of the wings , then pour over wings in pan,cook in a roasting pan / cookie sheet with a\"lip\" so the sauce doesn\'t spill and make a mess of the oven 350 degrees cook for 1 hour,i usually cook face down for about 40 minutes and then flip over,then when done throw all the gooey sauce into the crock pot with the wings and simmer on low heat for as long as you want,this is what makes them fall apart in your mouth , but you don\'t have to do it to cook them,they should be done after an hour in the oven', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (310, 'you bring the macaroni salad macaroni salad', 'easy', '20 min', 'honestly , i never measure \"exactly,,also , use as much or as little cheese as you would like,cook macaroni according to directions,when draining , run cold water over to keep it from sticking together and to \"chill\" it,mix mayonnaise , miracle whip , onion , pickle juice and sugar together to make \"sauce,,after macaroni is completely drained , mix macaroni , \"sauce\" , eggs and cheese until everything is coated and mixed well,the longer it chills , the better it gets !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (311, 'you can t eat just one ice box cookies', 'easy', '90 min', 'cream butter and sugar,add eggs , and vanilla , and mix well,sift salt , soda , and flour , add nuts,mix dry ingredients into butter mixture,divide dough in 4 parts,make into logs 1 inch or so wide in wax paper,put in \"ice box\" overnight , or if in a hurry , freezer for 15-30 minutes,preheat oven to 350f,turn out cooled dough onto very lightly floured board,slice very thin , not potato chip thin , but no more than 1 / 4 inch,space them 1 inch apart,bake until crisp and very , very lightly browned , about 5-6 minutes,the thicker you slice them , the longer the cooking time,enjoy with milk,share with your family , friends , and coworkers , but make sure to save some for yourself', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (312, 'yummy n easiest warm blueberry sauce', 'easy', '20 min', 'place all ingredients in a saucepan,bring to a boil,reduce the heat and simmer for 5 minutes,yum , it is ready !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (313, 'zucchini mix in tomato sauce', 'easy', '60 min', 'chop or partially puree tomatoes to your liking,heat oil in large pan,add onion and celery , saute for about 10 minutes or until onion and celery are soft,add zucchini and cook until soft,add tomatoes , sugar and salt,bring to boil , and turn down to a simmer,simmer for 30 minutes,cool and pack into freezer containers,freeze up to 3 months', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (314, 'like money for nuthin fudge', 'easy', '25 min', 'in a medium saucepan , mix together sugar and condensed milk,stir constantly over medium-low heat until all sugar is dissolved and mixture begins to boil,boil for 6 minutes , then add marshmallows , chocolate chips and margarine,line the bottom of cookie sheet or baking pan with wax paper and pour mixture evenly,allow to cool completely and cut into squares,use an air-tight container to store', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (315, '007 martini', 'easy', '5 min', 'rinse martini glass with extra dry vermouth,add vodka , gin , and lillet blanc to a cocktail shaker filled with crushed ice,shake vigorously,pour into prepared martini glass', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (316, '21 apple pie', 'easy', '171 min', 'add the cold butter cubes and , with a pastry blender , blend in the flour until mixture becomes mealy ans butter forms peas-size nuggets plainly visible in the flour,the water should be added to the flour slowly to ensure that only the minimum amount of water is used,do not over-mix the dough,when the dough has been mixed just sufficiently to combine the ingredients , form it into a ball and wrap in a piece of plastic wrap and refrigerate for several hours,to prepare the filling , melt the butter in a large saute pan until it begins to brown,add the sliced apples and cook over medium heat until they begin to soften , about 2 to 3 minutes,in a bowl , combine the lemon juice , sugars , southern comfort , and cinnamon,add this mixture to the apples and cook 2 to 3 minutes over medium-high heat until the apples are completely caramelized and covered with all the sugar,remove filling from the heat and allow to cool,preheat the oven to 375 degrees,when ready to use , remove the dough from the refrigerator , lightly flour a pastry board and a rolling pin , and unwrap the dough,divide the dough into 2 equal pieces and begin to roll out into a circle by rolling evenly outward from the center and turning the dough in small 1 / 8th turns to keep the rolling even,when the dough is rolled out to an even thickness and is about 12 inches in diameter and 1 / 8-inch thick , it is ready to be transferred to a 10-inch pie pan or plate,lightly butter the pie plate , partially roll the dough up on the rolling pin , lift the dough and center it in the pie pan and unroll,roll the second half of the pie dough into a round slightly larger than the pie pan,fill the bottom crust with the cooked apples using a slotted spoon to drain the apples,reserve juices if desired , for sauce,brush an egg wash coating over the lip of the dough,this is where it will be sealed to the top crust,cover the apples with the top half of the pie dough,trim any excess from the top crust before using both hands to crimp the edges of the two crust together to seal,with a sharp knife , make several crosshatch slits in the top crust,brush with the egg wash and bake for 35 to 40 minutes,remove from the oven and cool 20 minutes,serve with vanilla ice cream,reserved juices can be reduced with heavy cream for a sauce for the pie', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (317, '5 things hot mexican green chile dip', 'easy', '40 min', 'preheat oven to 350 degrees,in mixing bowl , first combine the sour cream and vegetable soup mix,then drain the excess liquid off of the rotel and green chiles and stir both cans in with the sour cream mixture,lastly , add 2 cups of the cheese and stir everything together,pour mixture into a 10\" round baking dish , top with additional 1 / 2 cup or more of cheese,bake for 30 minutes,allow the dish to cool for at least 20 minutes before serving with your favorite tortilla or corn chips,happy dipping !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (318, '5 minute bread pizza', 'easy', '45 min', '1,cover the top of your pizza stone or , if you dont have one , the inside of a cookie sheet with a good dusting of flour,2,pre-heat your oven to 425 degrees f,3,pour 3 tablespoons of evoo into a small bowl,4,cut out a chunk of your 5-minute bread dough , big enough to be the size somewhere in between a baseball and a softball,5,with your fingers flatten the dough to fit on top of your pizza stone or cookie sheet,from this point on , the crust will remain on the stone or cookie sheet until the pizza is done,6,with a pastry brush , cover the top of the flattened dough with a thin layer of the olive oil,7,turn the dough over and brush the other side with olive oil,8,partially bake the dough for about 7 minutes and take it out of the oven,9,using a large spoon or a ladle , spread the pizza sauce on top of the partially-baked crust and cover it as evenly as possible to within one inch of the edges,10,distribute the rest of the ingredients all over the top of the pizza sauce,be creative , my grandchildren like it when i make smiling faces with the pepperoni , black olives and the peppers,11,cover the top of the pizza completely with the mozzarella all the way to the edge,12,place the pizza stone or cookie sheet in the 425 degree oven and bake for approximately 20 minutes or until the cheese is bubbly and the edges of the crust have turned a dark , golden brown,if the edges are very light , this may mean that the center of the crust is still raw,13,take the pizza out of the oven and place it on a fire-resistant surface,let it rest for approximately 10 minutes , slice and enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (319, '99 bananas foster oatmeal', 'easy', '10 min', 'cook oatmeal in amount of water called for on your oatmeal , and add the divinci syrup,slice the banana into the oatmeal so it can cook into the oats,cook , over low heat , for 6-8 minutes , stirring frequently,add rest of ingredients , except the whipped topping,bring to a gentle boil , and remove,top with a generous serving of chocolate flavored whipped topping which will melt into the oatmeal giving it a delicate but delicious chocolate flavor', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (320, 'almost boston market creamed spinach', 'easy', '50 min', 'in a saucepan melt butter over medium heat until sizzling,if you are adding in the fresh garlic and a pinch of cayenne pepper then saute in butter for about 2 minutes but do not brown the garlic,whisk in the flour and 1 / 2 tsp seasoned salt until creamed together and smooth,stir in the half and half , or milk a little at a time,increase heat to medium and constantly whisk until the mixture becomes thick and smooth,remove from heat,set aside,place 2 tbsp butter in saucepan over med heat,add the 2 tbsp minced onion , and cook until transparent,add spinach and water to pan , lower the heat , and cover,stirring several times until the spinach is cooked,when the spinach is almost done , add the prepared white sauce , sour cream and parmesan cheese,stir well , and simmer until completely blended,season with more seasoned salt or white salt if desired and black pepper', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (321, 'almost outback steakhouse shrimp sauce', 'easy', '1440 min', 'mix all ingredients in a glass bowl,cover and chill for 24 hours before serving,delicious !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (322, 'almost starbucks frappuccino', 'easy', '5 min', 'in a blender combine coffee with ice cream and chocolate syrup,blend until smooth,add in sugar and blend slightly until combined,place about 1 cup crushed ice in two large tall glasses,divide the mixture into the glasses,top with a dollup of whipped cream', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (323, 'amerikaner german vanilla biscuit', 'easy', '25 min', 'preheat the oven to 180c / 350f,in a big bowl cream butter , sugar and vanilla,little by little add the milk and the eggs,in a second bowl mix flour , baking powder and starch,add to the butter-mixture and stirr in until just blended,using 2 tablespoons drop 6 heaps of dough onto each paper-lined baking sheet,make sure to leave enough space in between the heaps as dough will spread during baking,bake for 15 minutes or until golden brown,transfer to a wire-rack and allow to cool,if using the glaze stir together icing sugar and lemon juice and spread this onto the even side of the amerikaner,idea: for children you can spread the curved side of the biscuit with a chocolate icing and stick slivered almonds into them to make them appear like little hedgehogs,:)', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (324, 'amigos crisp chicken burritos', 'easy', '12 min', 'let cream cheese come to room temperature,drain the canned chicken,mix cream cheese , green chiles , green onion and chicken until well blended,cut two sides of the tortillas so you have two straight sides on each side,spread chicken mixture thinly on 3 / 4 of the tortilla,roll tortilla up starting with the end you spread the chicken mixture on,seal the plain end with water,heat oil to about 375-400 degrees,drop burritos into hot oil and fry for about 2 minutes,keep turning so they fry evenly,when they start to turn golden , they are done,drain on a paper plate covered with a paper towel,these are so easy and goes great with salsa , guacamole , or ranch dressing', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (325, 'amish cake frosting icing', 'easy', '5 min', 'beat cream cheese , sugar , vanilla& salt until fluffy,fold in cool whip', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (326, 'any type nut butter', 'easy', '15 min', 'cream butter in a small bowl with an electric mixer,transfer to blender or food processor,add remaining ingredients and blend well,place butter in plastic wrap and form into a log shape or place in a ramekin and cover tightly', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (327, 'any muffins', 'easy', '40 min', 'bake 15 to 20 minutes in a 400 oven,for the muffins: grain: use 2 to 2 1 / 2 cup of white flour,or --,substitute oatmeal , cornmeal , whole wheat flour , rye flour , or flake cereal for 1 cup of the white flour,or --,substitute 1 cup leftover cooked oatmeal , rice or cornmeal for 1 / 2 cup of the white flour and decrease liquid to 1 / 2 cup,milk: use 1 cup,or --,substitute buttermilk or sour milk,or substitute fruit juice for part or all of the milk,fat: use 1 / 4 cup vegetable oil or 4 tbsp melted butter or margarine,or substitute regular or crunch peanut butter for part or all of the fat,the fat can be reduced or omitted with fair results if using a \"wet addition, egg: use 1 egg,or --,substitute 1 heaping tbsp of soy flour and 1 tbsp of water,if using a cooked grain , separate the egg , add the yolk to the batter , beat white until stiff , and fold into the batter,sweetener: use between 2 tbsp and 1 / 2 cup sugar,or --,substitute up to 3 / 4 cup brown sugar,or -- substitute up to 1 / 2 cup honey or molasses and decrease milk to 3 / 4 cup,baking powder: use 2 teaspoons,if using whole or cooked grains or more than 1 cup additions , increase to 3 teaspoons,if using buttermilk or sour milk , decrease to 1 tsp and add 1 / 2 tsp baking soda,salt: use 1 / 2 tsp , or omit if you have a salt-restricted diet,optional ingredients: the following ingredients are optional,additions can be used in any combination , up to 1 1 / 2 cups total,if using more than 1 cup of wet additions , decrease the milk to 1 / 2 cup,dry additions: nuts , sunflower seeds , raisins , coconut , and so on,moist additons: blueberries , chopped apple , shredded zucchini , shredded carrot , and so on,wet additions: pumpkin puree , applesauce , mashed potato , mashed bananas , mashed carrot , and so on,if using 1 / 2 cup drained canned fruit or thawed shredded zucchini , substitute the syrup or zucchini liquid for all or part of the milk,spices: use spices that complement the additions , such as 1 tsp cinnamon with 1 / 4 tsp nutmeg or cloves,try 2 tsp grated orange or lemon peel,jellies and jam: fill cups half full with a plain batter,add 1 tsp jam or jelly and top with 2 more tbsp batter,nonsweet combinations: use only 2 tbsp sugar and no fruit,add combinations of the following: 1 / 2 cup shredded cheese , 2 strips fried and crumbled bacon , 2 tbsp grated onion , 1 / 2 cup shredded zucchini , 2 tbsp parmesan cheese,spices could include parsley , marjoram , rosemary --,alena kibbler\'s additions: hawaiian muffins: use 1 / 2 cup mashed banana , 1 / 2 cup drained crushed pineapple , and 1 / 2 cup flake coconut , and 1 tbsp vanilla or rum flavoring,use the pineapple juice instead of milk,cherry vanilla chip muffins: 3 / 4 cup pitted chopped cherries , 3 / 4 cup vanilla chips , 1 tsp vanilla,elvis muffins: use about 3 / 4 to 1 cup mashed banana , 1 / 2 cup chopped peanuts or walnuts,and substitute 1 / 4 peanut butter for the oil', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (328, 'apple pie', 'easy', '43200 min', 'mix ingredence together except everclear and pour in to a ceramic jug that light will not penetrate close with cork or lid put jug in a cool dark place for 1 month,after 1 month shake up mixture and strain with cloth add everclear and serve cold', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (329, 'aunt johnnie s pound cake', 'easy', '120 min', 'preheat oven to 300f,lightly grease and flour a 10 inch bundt pan,cream shortening , butter and sugar until light and fluffy with an electric mixer,add eggs one at a time , beating well after each addition,beat in almond extract,in another bowl , combine baking powder and flour,stir into creamed mixture alternately with the milk , starting and ending with flour,pour batter into prepared pan,bake in the preheated oven for 1 to 1 1 / 2 hours , or until a toothpick inserted into the center of the cake comes out clean,allow cake to cool in pan for 10 minutes , then turn out onto a wire rack and cool completely', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (330, 'aww shucks crescent dough dessert', 'easy', '50 min', 'heat oven to 350,grease one 13x9 inch pan,roll out first can of crescent dough into bottom of pan , and slightly up sides,beat cream cheese , 1 cup of the sugar , and vanilla together,spread over crescent dough,microwave jam or preserves for 45 seconds , stirring once after twenty five seconds , to make it slightly liquid,spread jam on top of cream cheese , taking care not to mix the two together but keeping them layered,with your hands , gently stretch second can of crescent dough and place on top of jam layer,this does not have to cover perfectly , in fact , open seams here and there look quite pretty with the jam peeking through,mix melted butter , remaining 3 / 4 cup sugar , and cinnamon together , making sure to incorporate all the butter,gently spoon butter mixture over dough , spreading to cover,bake , uncovered , for 35 minutes , until top is browned nicely,let it cool for fifteen minutes , cut and serve !,tastes best warm or room temp , but cold is delicious , too', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (331, 'bacon cheeseburger and fries soup', 'easy', '60 min', 'in a large skillet , cook bacon,drain,crumble,set aside in a medium bowl,do not discard grease from skillet,in same skillet with bacon grease brown beef , onion , celery , garlic powder and pepper,remove with slotted spoon to bowl with bacon,be sure to remove all solids from skillet , leaving fat,add tomatoes to the beef mixture,peel potatoes and cut into 1 / 2\" dice,when fat in skillet is very hot again , fry potato cubes on all sides until well browned,drain,remove to bowl with bacon and beef,in soup pot , melt butter and add flour,whisk for 1 minute to cook flour,add chicken broth and half-and-half,cook , whisking constantly , until you see the first signs of thickening,begin adding grated cheeses , a little at a time , whisking constantly , until soup is bubbling , creamy and thick,remove from heat,add parsley , mustard and relish,stir well,add bowl of bacon and beef mixture and potatoes,stir,cover and let stand 5 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (332, 'bailey s hot fudge sauce', 'easy', '30 min', 'over medium low heat melt butter and chocolate squares , take off heat,add 1 / 3 of the sugar and 1 / 3 of the evaporated milk , mix with a whisk until smooth,add remaining sugar and milk , stir until smooth,return to heat and simmer for 8 to 10 minutes,pour into canning jars or other container , let cool and close jar,recipe can be doubled', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (333, 'baked apple cinnamon oatmeal', 'easy', '10 min', 'core and peel apple,place in a microwaveable safe bowl and sprinkle brown sugar and cinnamon in apple,stuff it with cranberries and oats and top it with butter,cover with saran wrap and microwave for about 3 1 / 2 minutes,let it rest for about 2 minutes,chop the apple and add it to the dry instant oatmeal,follow the packet directions and add the juice from the cooked apple to the bowl,microwave about 1 1 / 2 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (334, 'basic beet borscht', 'easy', '55 min', 'cut off beet greens from the beets but leave about an inch or two of the tops on the beets,option:mince removed beet tops to add later,scrub the beets well,in a large pot , add beets and cover with cold water,bring the water to a boil and boil this for about 15-25 minutes until the beets are cooked,remove the beets from the water,save the water from the beets,remove the skins from the beets,strain the\"beet juice\" into a pot,peel and grate the onion,grate the beets,put the grated onion and beets into the pot with the strained beet juice,option:you can add the finely chopped / minced beet tops , if you want to use them,bring all to a quick boil,add the salt , lemon juice , pepper , and honey , simmer until the honey has dissolved and all is well heated,serve , garnished with a dollop of sour cream', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (335, 'bbq pork', 'easy', '70 min', 'trim fat off pork,cut into bite sized cubes,i always season my pork with salt , pepper and garlic powder to taste,put celery salt , brown sugar , chili powder and onion flakes in a big ziploc baggie,add pork,shake well to coat,in a casserole or oven proof dish add the soup and vinegar,stir,add contents of baggie to dish,stir,cover and bake 1 1 / 2 hours @350,baking time is alot -- it was very cooked so check after 1 hour,serve over rice,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (336, 'beat the blues blue cheese risotto', 'easy', '40 min', 'nb: i like to use a fairly strong flavoured , but creamy blue cheese , like gorgonzola , but stilton is also nice,stock-wise , you may need a little more or less than in the ingredients list,bring stock up to a simmer,halve the leeks and remove any gritty bits from inside the rings,cut the leek into fine strips rather than semi-circles , of approx 1-2 inches in length,melt half the butter with the olive oil and cook the leeks for approx 10 minutes over a low-medium heat until soft and tinged with brown,add bacon to pan and cook for about 5 minutes,stir in garlic and rice , cook for a further minute or two , stirring the rice until it\'s coated in the butter and oil and starts to go slightly translucent,add the wine to the pan , turning up the heat to bubble most of it away,add a ladleful of hot stock to the leek and rice mixture at a time , stirring more or less constantly,add more stock each time that most of the liquid has been absorbed,add the fresh sage,keep doing this for approximately 15 - 25 minutes , until the risotto is creamy , but the rice grains still have a slight bite,you\'ll need to start testing the rice after about 15 minutes , but it may take a little longer,turn off the heat,stir in the lemon juice , zest , remaining butter , parmesan and blue cheese,leave the risotto for another 2 minutes until rich , creamy and luscious,season to taste with black pepper and salt if needed', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (337, 'beefy seitan log', 'easy', '94 min', 'preheat the oven to 325f,mix together the dry ingredients in a large bowl,mix together the liquid ingredients in a smaller bowl , then stir them into the dry ingredients until completely blended,knead the dough in the bowl for a couple minutes , then place on a sheet of foil and shape into a log about 6 to 8 inches long,wrap the foil tightly around the log and twist the ends,bake for 80 minutes,slice or chop as desired , and serve immediately or store in the refrigerator or freezer', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (338, 'berinzila eggplant and ham', 'easy', '60 min', 'preheat oven to 350 dg,peel eggplants , slice , sprinkle lightly with garlic salt and set aside about 15 minutes on paper towels,saute onion in 1 t butter or oil , add ham and wine , and cook until wine nearly evaporates,add tomatoes and simmer 10 minutes,meanwhile , pat eggplant dry , dust with flour and fry in 2 t butter or oil until golden,drain,layer eggplant , then a portion of ham mixture , another layer of eggplant , etc,in greased casserole dish and cover with parmesan cheese,bake at 350 dg,for 30 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (339, 'berry good smoothie', 'easy', '5 min', 'mix all ingredients in blender until smooth', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (340, 'better than a can homemade sloppy joes', 'easy', '50 min', 'to start the sauce: heat a 2 1 / 2-quart nonreactive saucepan over medium heat and , when hot , add the oil,when the oil is hot , stir in the onion , green and red pepper , celery and garlic,cook until the vegetables are softened and fragrant , 4 to 5 minutes,stir in the tomato puree , tomato paste , ketchup , vinegar , molasses and worcestershire sauce,bring the mixture to a simmer , reduce heat to very low and simmer with the cover ajar for 1 hour,to saut the mushrooms: heat an 8 - 10 inch skillet over high heat and , when hot , add the olive oil,when the oil is hot , add the chopped mushrooms and cook , stirring frequently , until the mushrooms are golden , 2 to 3 minutes,remove from the heat and set aside,to finish the sauce: after the sauce has simmered 1 hour , add the sauted mushrooms , chopped plum tomatoes , oregano , better than bouillon seasoning and some freshly ground black pepper,return to a simmer and cook with the cover ajar for 30 minutes more,to brown ground meat: heat a 10-inch non-reactive deep-sided skillet over medium heat,when hot , add the ground meat and break it up with a wooden spatula,cook the meat until separated and no longer pink , about 4 minutes,then remove from the stove and drain out any excess fat from skillet,return skillet to the stove , over low heat,stir in the sauce and bring the mixture to a gentle simmer , uncovered,cook gently until the flavors mingle and the mixture is piping hot throughout , about 10 minutes,add some more freshly ground black pepper and serve immediately,to assemble sloppy joes and serve: while the sauce is simmering , open the hamburger buns and spread both opened sides lightly with butter,lay the buns , buttered sides up , on a shallow baking sheet,broil the buns until the buttered sides are nicely toasted,spoon the ground beef mixture lavishly over buns and serve hot,if serving 4 , you will need 1 cup of sauce and 1 lb,of ground beef,the remaining sauce can be frozen for later use and ease,freeze cooled sauce in tightly sealed containers', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (341, 'better than bouillon gravy', 'easy', '10 min', 'measure 4 cups of water into saucepan and heat at med-high to gentle boil,while waiting for water in saucepan to boil , whisk together 1 / 4 cup water with 2 1 / 2 t better than bouillon in a bowl until smooth,whisk this mixture into the boiling water , stir while bringing to a gentle boil again,reduce heat to low,mix the corn starch with 1 / 2 cup cold water in a bowl or large measuring cup,whisk well until the corn starch is thoroughly dissolved,gently pour the cornstarch mixture into the saucepan , adding a little bit at a time while you continue to whisk,increase heat and whisk for 2 minutes until thickened,add pepper to taste', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (342, 'better cake mix', 'easy', '35 min', 'add these 3 ingredients to boxed caked mix,mix as usual', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (343, 'better than crack brownies', 'easy', '50 min', 'combine brownie mix , water , oil , and eggs until moistened,bake for 20-25 minutes in a 9x13 baking dish,remove brownies from oven , top with peanuts and peanut butter cups,bake for 4-6 minutes more,melt chocolate chips , peanut butter , and butter,stir in cereal,remove brownies from oven and pour chocolate-peanut butter mixture over hot brownies,refrigerate for two hours , then serve', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (344, 'biggest loser fish tacos', 'easy', '50 min', 'to make the fish: place the fish in a shallow baking dish and sprinkle with the lime juice , paprika , salt , black pepper , and chill powder,cover , refrigerate , and marinate for about 30 minutes,preheat the grill to medium-high heat,lightly coat a 24\' x 12\" piece of foil with olive oil cooking spray,place the fish in a single layer in the center of the foil,fold the foil over the and fold the ends upward to seal in the fish,place the foil packet on the preheated grill,cook for 7 to 10 minutes , or until the fish is opaque,remove from the grill,to assemble the tacos: warp the tortillas in foil and place them on the grill to warm for 2 minutes,spread about one-eighth of the mashed avocado on each tortilla and top with one-eight of the the fish,sprinkle each with cheese , salsa , cilantro , cabbage , and hot sauce , if desired', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (345, 'blond minestrone', 'easy', '60 min', 'chop onions,heat oil in dutch oven over medium heat,add onion to pan and saute until softened - about 3-5 minutes,add oregano , basil and garlic , saute about 1 minute,stir in squash , zucchini , carrot and corn,saute until veggies are tender -- about 5 minutes,stir in broth bring to a boil , then reduce heat to low and simmer about 20 minutes,add pasta and beans to pan,cook about 10 minutes or until the pasta is tender,remove from heat,stir in spinach , add salt and pepper to taste,ladle into bowls,top with a dollop of pesto,garnish with freshly ground black pepper,if you must have tomatoes -- add 3 cups tomato to 2 of the 6 cups of broth , process in blender / food processor until smooth,add an additional cup of chopped tomatoes to the soup', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (346, 'boo tiful jell o cups', 'easy', '50 min', 'add boiling water to gelatin mix in large bowl,stir 2 minutes until completely dissolved,add ice,stir 3 to 5 minutes or until gelatin is thickened,remove any unmelted ice,whisk in 1 / 3 cup cool whip until blended,pour into 4 dessert dishes,refrigerate 30 minutes or until firm,drop remaining cool whip by spoonfuls onto desserts to resemble ghosts,add chocolate chips for the eyes,kraft kitchens,how to thaw cool whip whipped topping:,the best way to thaw frozen cool whip whipped topping is in its container in the refrigerator,depending on the size tub you havem the thawing time varies,recommended thawing times are: 8-ounce tube - 4 hours,12-ounce tub - 5 hours,16-ounce tub - 6 hours,we do not recommend thawing cool whip whipped topping in the microwave', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (347, 'buffalo wild wings medium wing sauce copycat by todd', 'easy', '30 min', 'combine first seven ingredients for the sauce your choice in a small saucepan,heat sauce over medium heat until boiling , reduce heat and simmer for 5 minutes,remove from heat and allow it to cool , uncovered , for 10 minutes,while the sauce cools , whisk egg yolk with 2 teaspoons water in a medium bowl until pale yellow,whisk in cornstarch until dissolved,drizzle the hot sauce mixture into the egg yolk mixture in a steady stream while rapidly whisking,cover the sauce and chill until ready to serve', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (348, 'buffalo wing mushrooms', 'easy', '30 min', 'in a medium-large mixing bowl , add in panko breadcrumbs and set aside,in a medium sized bowl , mix together flour , cornstarch , salt and black pepper,slowly whisk in water , making sure that it is not clumpy,in batches of three to four , drop in hen of the woods mushrooms into slurry then promptly into breadcrumbs,toss mushrooms in panko until the mushrooms are completely coated,remove the mushrooms from bowl and set out on a baking tray , making sure not to stack them up,bring four cups of canola oil up to 350f in a two-quart pot and drop in mushrooms,fry until golden brown and toss in hot sauce', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (349, 'buffalo stuffed eggs', 'easy', '30 min', 'except for the diced celery , combine & mix well all other ingredients,spoon mixture into egg halves & garnish w / diced celery', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (350, 'call the fire department hot wings', 'easy', '75 min', 'in a bowl , combine flour , cayenne pepper , paprika , salt and pepper,mix,rinse off wings and coat in flour mixture,spray a large baking sheet with non-stick cooking spray and place wings on baking sheet,preheat oven to 375f,bake wings for 40 minutes , turning once 1 / 2 way through cooking,while wings are baking , combine butter , frank\'s hot sauce , and tabasco in a plastic bowl with lid,once wings are finished baking , place 8-10 wings in the bowl,cover and shake to coat,serve with ranch dressing !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (351, 'caramel apples', 'easy', '7 min', 'pierce apples with popsicle sticks , set aside,melt butter in a medium saucepan,add remaining ingrediants , and gently bring to a boil , stirring frequently,cover , reduce heat and simmer for 3 minutes,do not uncover to stir !,remove from heat,mixture should be thin , but sticky , and saucepan sides should be steamy,stir well , and allow to thicken slightly before dipping apples,apples may be double dipped if desired,refrigerate 1-2 hours until caramel is set', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (352, 'chmeur s pudding', 'easy', '62 min', 'preheat oven to 325f,mix flour and baking powder , set aside,in a bowl , beat eggs , sugar , and margarine,incorporate flour , alternating with milk,without spreading it , pour preperation into a greased 13\"x9\" pan,mix all the ingredients for the sauce in a saucepan,boil for 2 minutes,pour over top of the dough,bake 45 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (353, 'cheese sauce dairy free', 'easy', '10 min', 'heat \"milk\" or broth on med,heat,take a couple tbsp of the hot liquid and mix it with the cornstarch until it dissolves,set aside,add yeast flakes and spices to hot liquid,stir until dissolved,add cornstarch to mixture and let it bubble on low heat until it reaches the thickness you want,you can use more or less liquid , depending on just how thick you want it to be,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (354, 'cheeseburger cookies and fries', 'easy', '20 min', 'place coconut into a ziploc sandwich bag and drop in several drops of green food coloring,roll around in your hands until all the coconut is tinted,set aside,in a separate bowl , tint some frosting red like ketchup and in another bowl , tint frosting yellow like mustard,set frosting aside,decide how many cookies you need , unwrap that many peppermint patties and set out twice as many wafter cookies,set half the wafer cookies , flat side up , onto a cookie sheet,put a small dab of vanilla frosting onto cookie and gently press down a peppermint patty,spread some \"ketchup\" and some \"mustard\" on top of the patty , sprinkle some \"lettuce\" on it and then place another cookie on top,brush a little honey on the top \"bun\" and sprinkle some sesame seeds onto them,set aside,take triangularly cut sheets of paper and fold them to resemble a french fry \'bag,if you want , use markers first to draw some golden arches and write \"mc ___ on them,then , tape them together and fill with some potato sticks,place a cheeseburger and bag of fries on a small paper plate and serve !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (355, 'cheeseburger stuffed french bread', 'easy', '40 min', 'cook hamburger and onion , drain grease,add soup and spices , simmer 5-10 minutes,meanwhile , slice top third off bread , hollow out bottom half of loaf , leaving a 3 / 4-inch shell , save bread chunks , or feed to the birds !,spread top slice of bread , with butter,place hollowed out bread on cookie sheet and broil till lightly browned,take out of oven and fill with meat mixture , top with cheese slices,place buttered top next to it , put back in oven at 350,bake till heated through and top is toasted a little,put the top on , slice into wide slices for sandwiches , about 4-5 inches wide,4-6 servings', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (356, 'cheesecake factory crab cakes', 'easy', '10 min', 'measure all the ingredients for the crab cakes-- except the panko and vegetable oil-- into a large bowl,use a spatula to carefully fold the ingredients together,be sure not to over stir the mixture or those tasty lumps of crab will fall apart,the best crab cakes have nice big chunks of crab in\'em,use your hands or a spoon to fill six cups of a clean muffin tin with equal amounts of the crab mixture,press down a bit on each crab cake so that the top is flat,don\'t press too hard or the crab cakes will be hard to get out,cover the muffin tin with plastic wrap and pop it in the fridge for a couple hours,this step will help the cakes stay together when they\'re browned in the oil,after the crab cakes have chilled through , heat up about 1 / 4-inch of vegetable oil in large skillet over medium / low heat,fill a shallow bowl with the panko breadcrumbs,carefully turn the crab cakes out onto a plate,gently roll each crab cake around in the panko breadcrumbs,each crab cake should be wearing a light coating of panko,test the oil by dropping a pinch of panko into the pan,it should sizzle,saut the crab cakes in the hot oil for 1 1 / 2 to 3 minutes on each side or until the cakes are golden brown,drain crab cakes on paper towels or a rack very briefly , then serve them up hot with the remoulade sauce alongside in a little dish,makes 6 small crab cakes,serve with remoulade sauce', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (357, 'cheesy vegan lasagna', 'easy', '75 min', 'slice carrots and steam , set aside,saute parsley and garlic for 1 minute in an oiled pan,add carrots and veggie broth,simmer uncovered for 5 minutes,add tofu , vegan cream cheese , and lemon juice,stir well,cook over medium heat stirring constantly until \"cheese\" starts to melt,stir in nutmeg and nutritional yeast,remove from heat,keep warm,place 3 lasagna noodles in bottom of 11x7 baking dish,layer carrot mixture , noodles , tomato sauce and spinach until done,top with spaghetti sauce,cover and bake 15 minutes at 375 degrees,uncover and bake an additional 30 minutes until thoroughly heated', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (358, 'chic to be greek salad from salad creations', 'easy', '10 min', 'put your lettuce in serving dish and layer the rest of the ingredients on top,also at salad creations , what were known for is our chopped salads,usually we would chop this up altogether , and then serve it', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (359, 'chinese popcorn', 'easy', '65 min', 'preheat oven to 250 degrees f,in a large shallow roasting pan , combine popcorn , chow mein noodles , and peanuts,melt butter,add sesame oil , soy sauce , lemon juice , and ginger,pour over popcorn mixture,toss to coat evenly,bake for 1 hour , stirring every 20 minutes,spread on paper towels to cool,store in airtight container', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (360, 'chipotle style chicken burrito bowls', 'easy', '40 min', 'cut up chicken and add cumin , taco seasoning salt + pepper , paprika , and adobo , set to the side,cook rice according to the directions on the box,in a large saute or frying pan on med-high heat , estimate and add 2 tablespoons extra virgin olive oil,add chicken,while chicken is cooking , peel avacados and make guacamole according to package directions,refrigerate,open cans of black beans , corn , diced tomatoes with chiles and cilantro and put in small bowls,if you\'d like , you can warm , the can of beans and corn,don\'t warm the can of diced tomatoes , unless you like warm salsa / tomato mixture,once chicken and rice is done , you can start plating,letting everyone add the toppings of their choice is part of the fun of the meal !,p,s,suggestion for plating - put shredded lettuce in bowl or plate first - then add rice , then chicken , then toppings', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (361, 'cloud nine', 'easy', '4 min', 'mix cream cheese and pineapple juice until well blended,add whipped cream and crushed pineapple mix well,chill till ready to serve', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (362, 'comfort able kamikaze', 'easy', '2 min', 'shake for 15 seconds,serve straight up or on the rocks , whichever you prefer', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (363, 'company green beans', 'easy', '20 min', 'cut bacon slices cross-ways into 1 / 2 inch pieces,fry bacon in a sauce pan until just crisp,remove bacon from pan and let drain on paper towels,pour off all but a couple teaspoons of bacon fat,add onion to pan and cook just until translucent and soft,if using whole tomatoes , cut them up using a sharp knife while they\'re still in the can,add tomatoes to the pan along with the drained can of green beans,add bacon and heat until all ingredients are thoroughly heated,serve in small bowls because it\'s kind of \"soupy', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (364, 'company s coming rice', 'easy', '50 min', 'preheat oven to 350 degrees,place rice , uncooked , in a baking dish,pour in soups , add water chestnuts,cut butter into chunks and drop onto soups,bake uncovered for 45 minutes or until it is bubbling and top has browned', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (365, 'country style onion soup', 'easy', '35 min', 'slice onions in half latitudinally , peel , cut off tops,cut in half again , the other way,turn on the flat side and cut each quarter into thirds or fourths , to get fairly uniform , fairly thin half-rings of onion,in a sturdy saucepan over medium-high heat , melt butter,watch carefully to make sure it doesn\'t separate,just before butter melts completely , add onions,cook , stirring fairly frequently , until they are soft , clear , and just on the edge of caramelizing,add flour all at once to the middle of the pan,carefully and evenly work onions and butter into the flour , stirring constantly , until all onions are completely coated with flour-butter paste,cook this mixture , stirring constantly , until it is a medium golden-brown,add stock slowly while stirring constantly to avoid lumps,add water until soup is just a little thinner than desired consistency,salt lightly,cover , and bring just to a boil,reduce heat to medium,simmer , partially covered but vented , about 20 minutes or until soup is desired consistency,taste for seasoning and salt to taste', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (366, 'crabby bread', 'easy', '35 min', 'for the body , join 2 rolls together and press into a flat football shape,place body on a large sprayed baking sheet,with the next roll , cut enough dough off to form 2 small eyes,roll each piece into a round ball and place on front of body,to secure eyes , stick a small piece of toothpick in each ball and then stick it into the body,cut the rest of the roll in half to form 2 arms,place each arm to the side of the eyes but before the ends of the body,cut another roll in half to form 2 claws,then cut each claw off-center almost in half and place at the end of each arm , putting the small part of the claw closest to the body,roll the last roll into a 12-inch rope,divide rope into 6 equal lengths for the legs,arrange 2 legs curving forward and 1 leg curving back on each side,tuck legs slightly under the body,brush crab with melted butter , cover loosely with plastic wrap and let rise for 30-45 minutes , or til doubled,brush crab with beaten egg and sprinkle lightly with paprika,bake at 350 for 20 minutes,toothpick olive halves onto ends of eyes of dough,cut-side facing outward,place crab onto lettuce-lined platter,place mound of your favorite crab dip between claws,surround with decorative shells , crackers and fresh dill sprigs if desired !,i made this for me and my hubby for a \"special treat\" lunch ! i\'m allergic to crustaceans , so we had it with my lemon-dilled tuna salad and had a ball ! it was so much fun tearing off the pieces and spreading them with tuna , instead of the plain \'ol plain \'ol tuna sandwiches !,you could make a nice seafood appetizer platter with this , too ! shrimp cocktail and fried oysters would be a great addtion !,hope ya try it ! :) it\'s really easy ! and fun !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (367, 'crabby cracker spread', 'easy', '20 min', 'mince crabmeat in food proccessor,combine all other ingredients and mix well with electric mixer,add crab and mix well to combine,may be formed into ball , if desired,to serve , pour cocktail sauce over top to cover , and serve with wheat thins or triscuit crackers', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (368, 'crack lasagna', 'easy', '70 min', 'brown and crumble sausage in a skillet,wash and chop greens,remove sausage from pan and drain on paper towels,wipe out skillet,heat olive oil in skillet and saute garlic,add greens to skillet,cook uncovered till wilted down,add 1 / 3 cup water to skillet,cook on low heat covered till greens are tender,add the sausage back into the cooked greens,set aside 1 / 2 cup to 1 cup of the greens sausage mixture for the top,mix cottage cheese , ricotta , pesto and egg together,salt and pepper to taste,line the bottom of a lasagna pan with the lasagna noodles,put half of the sausage / greens mixture on top of noodles followed by ricotta mixture,layer with more lasagna noodles,top with sausage / greens mixture followed by remaining ricotta mixture,place another layer of noodles on top,cover with monzerella cheese , reserved sausage / greens mixture and pine nuts if desired,bake for 1 / 2 hour till melty and bubbly', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (369, 'crazy easy lo mein', 'easy', '20 min', 'combine the cooked hamburger , both jars of beef gravy , soy sauce , thawed veggies and all the spices in a large , deep skillet,cover and simmer mixture for 8-10 minutes,while the sauce is simmering , cook the spaghetti noodles,add the cooked drained noodles to the meat / veggie sauce and stir well', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (370, 'cream of whatever soup', 'easy', '10 min', 'in a small saucepan over medium heat , melt butter,add minced garlic and saute 1 minute,add flour and stir quickly , forming a paste and mixing well,slowly add milk a little at a time , while stirring constantly to avoid scalding,once milk is added and mixed well , reduce heat to medium-low and add herbs,add salt / pepper to your liking,turn off the heat and let the soup simmer for a couple of minutes , stirring occasionally,use as a soup base or pour into your casserole', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (371, 'cream of chicken soup', 'easy', '40 min', 'saute onion in oil until clear,add water and rice and cook until soft,blend with hand blender or puree in food processor and return to pot,mix in remaining ingredients and bring to a boil,simmer 10 to 15 minutes,you can add less water , if you like a thicker soup', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (372, 'creamed spinach', 'easy', '12 min', 'i keep drained yogurt available in my fridge all the time,i use a coffee filter and a wire strainer,i usually drain it over night , but even a half hour makes a big difference,once you drain the yogurt , it becomes very thick and much less tart,cook spinach according to package directions,while it cooks , saute chopped onions until slightly browned,drain spinach well and combine with all other ingredients while still hot', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (373, 'creamy broccoli soup', 'easy', '55 min', 'heat oil in a large pot over medium heat,add carrots , onion , garlic and celery,add chicken broth and water,bring to a boil,stir in broccoli and rice and reduce heat to medium low,simmer 10-15 minutes or until veggies are tender,stir frequently,take small batches of soup and put in a food processor or blender,blend until pureed,return all blended soup back to pot,add salt and pepper if you\'re going to,add milk and cheese and cook until heated through', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (374, 'creamy fiddlehead soup', 'easy', '30 min', 'in a large heavy bottom saucepan , saut onion in butter or oil until soft but not brown , about 5 minutes,add potatoes , fiddleheads , bay leaf , and enough chicken stock to make the vegetables just swim,bring to a boil , reduce heat , and barely simmer , partially covered , for one hour,remove from heat and cool slightly,remove bay leaf,in a blender , process mixture in batches,return mixture to saucepan and slowly bring to a simmer , stirring frequently,add milk , a little at a time , until it reaches the consistency you like,add salt and pepper to taste,serve in heated soup bowls , garnish as desired', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (375, 'creamy mushroom soup', 'easy', '35 min', 'chop mushrooms finely,spray a large non-stick pot with cooking spray and place over medium heat,add 1 / 2 cup of the chopped mushrooms and cook until tender,remove to a bowl,add the butter to the pot , along with the garlic and onions,cook for 3 minutes , stirring,add the mushrooms and cook , stirring , until tender,add the mushroom broth , white beans , and seasonings,bring to a boil , reduce heat , cover , and simmer for about 8-10 minutes , letting the flavors cook together,remove from heat and let cool slightly,with an immersion blender or a food processor , puree the soup,if you have reserved mushroom pieces , stir them back into the soup as you reheat over medium,garnish with parmesan cheese if desired !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (376, 'death by chocolate copycat dark chocolate sauce', 'easy', '5 min', 'mix cocoa and sugar thoroughly,stir in water in small amounts , until desired consistency is reached,keep in tightly sealed container in refrigerator,best served on second day , to make sure sugar completely dissolves', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (377, 'diamond creme brulee', 'easy', '80 min', 'whisk together the eggs and sugar in a large stainless steel or glass bowl,place the bowl over a large 3 or 4 quart saucepan filled with simmering water,with the heat on low , whisk the mixture vigorously and continuously until you can form ribbons,this is where you can lift the whisk out of the mixture , write your name , and it doesnt disappear for about 5 to 10 seconds,this can take as long as 30 minutes,my son and i used a black and decker gizmo and it took about 15 minutes but was somewhat messy,slowly whisk in the cream,split and scrape the vanilla beans into the mixture,put the vanilla beans in there too,stir often with the whisk until the mixture can coat a spoon with only a slow drip,it will be about the consistency of vegetable oil,remove the custard from the stove and whisk in the butter , one pat at a time,when the butter is fully melted , strain the mixture through a sieve and transfer it into ramekins or custard cups,be sure to leave about inch for the last step,you can transfer it into a bowl and chill first before putting it in ramekins,place in refrigerator until cold,remove the cups from the refrigerator and sprinkle sugar on top until it is about 1 / 8 inch thick,heat the tops of the custard with a kitchen torch until the sugar is caramelized', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (378, 'dirty broccoli', 'easy', '13 min', 'microwave broccoli spears and water , covered , for 5 minutes on high,drain and set aside,while the broccoli is cooking , heat the oil in a large skillet over medium-high heat,add the garlic and cook for 1 minute,add the bread crumbs , oregano , salt , and pepper,cook , stirring until the crumbs are toasted and golden brown -- about 2 minutes,add the broccoli and toss to coat with bread crumbs', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (379, 'don t knock it until you try it beet cake', 'easy', '65 min', 'heat oven to 350 , grease and flour 13x9 baking pan,beat eggs , sugar and oil until light and fluffy,sift together flour , baking powder , baking soda and cinnamon,add to egg mixture and mix well,add vanilla , beets and walnuts,beat for 1 minute on medium speed,pour into pan , bake for 45 minutes , or until a pick comes out clean', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (380, 'dorito popcorn seasoning', 'easy', '5 min', 'combine all seasonings and blend in a coffee grinder , or blender , to make a fine powder,store in a seasoning jar,sprinkle seasoning over freshly popped popcorn and toss to coat', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (381, 'dressed up greek style salad', 'easy', '30 min', 'cut red onion in half , then slice thinly,prepare other vegetables,place torn romaine / greens in serving bowl , keeping top as smooth a layer as possible,salt and pepper greens to your liking,starting at edge of bowl , make circular rings of sliced onion , then tomatoes , carrots , green peppers , olives and in the center a dollop of feta cheese,cover with plastic wrap until ready to serve then present with greek salad dressing of your choice served on the side', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (382, 'duffins donut muffins', 'easy', '60 min', 'preheat oven to 375 degrees f,line 2 12-cup muffin tins with paper liners,spray lightly with non-stick spray,combine butter and applesauce,add sugar and beat for 1-2 minutes , until fully incorporated,beat in egg whites and whole egg for another 2 minutes,mix in vanilla and buttermilk,stir in flour , baking powder , salt , nutmeg , and baking soda until combined,be careful not to overmix when adding the dry ingredients or muffins will be tough,scoop batter into prepared muffin tins , about two thirds full,bake muffins for 13-15 minutes , or until batter starts to pull away from the liners and tops spring back when poked,while muffins are baking , mix 1 / 4 cup sugar and cinnamon,sprinkle tops of muffins with cinnamon sugar right after removing them from the oven,cool for 2 minutes in pan , then remove to cooling rack,refrigerate', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (383, 'elephant ear dutch baby', 'easy', '25 min', 'preheat oven to 425,mix the eggs , flour and milk in a blender on medium speed until just blended,melt 2 tablespoons of butter in a 12-inch cast-iron skillet,pour the batter into the skillet over the melted butter,place the skillet in the oven and bake until the top is puffy and golden brown , about 20-25 minutes,melt the remaining 2 tablespoons of butter,when the dutch baby is done , spread the butter over it with a pastry brush,then sprinkle with the cinnamon sugar,you can cut the dutch baby into equal servings , but in our family , we like to put the whole thing on a large plate and just tear pieces off :-)', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (384, 'elmer s summertime sweet onion salsa', 'easy', '21 min', 'in a medium bowl , combine the tomatoes , jalapeno , green onion , sweet onion , cilantro and garlic,in a measuring cup , stir together the lemon juice , lime juice , sugar , coriander , cumin and salt,stir until the sugar and salt dissolve , and then pour over the tomato mixture,stir gently to combine,transfer to a serving bowl , cover , and set aside for at least 1 hour to allow the flavors to meld', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (385, 'emerald ecstasy green smoothie', 'easy', '6 min', 'turn the machine quickly from variable speed 1 to 10 then flip the switch to high,push the ingredients down into the blades until the entire mixture is blending,i find it easier to push the food continuously down one corner of the container and eventually it begins to blend,the apple may require a bit of \"pounding\" before it begins to mix,when the mixture is first blending it should be so thick and slushy that it is thick like a thick \"slushy,if it is too liquid at the beginning , add more ice so it is thick and \"slushy,this allows you to blend for 1-2 minutes without warming the drink up from the friction of the blades,it also allows you to break the foods down to the most bioavailable level,this is a \"beginner\" green smoothie that 98% of the population will love !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (386, 'extraordinary macaroni and cheese', 'easy', '30 min', 'melt butter in 4-qt saucepan over med heat,add onions and saute until transparent,stir in flour and salt,cook 1 minute stirring constantly,add milk , stir to blend,add tomatoes , juice and all,bring to a low , steady simmer,add uncooked pasta,cover and continue to simmer gently for about 8 to 10 minutes , stirring occasionally,remove from heat,add cheese,stir gently until cheese is melted,let sit 5 minutes fefore serving,for an italian twist try substituting the cheddar cheese with 1 cup fontina cheese and 1 / 2 cup of freshly grated parmesan cheese', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (387, 'fabulous brownies', 'easy', '35 min', 'preheat oven to 350 degrees,grease a 9x13 pan,mix together sugar , butter , and water,beat until smooth and creamy,add eggs and vanilla to sugar mixture,beat in completely,mix dry ingredients in a separate bowl until evenly combined,add dry ingredients to sugar mixture , mix thoroughly,pour batter into the 9x13 pan and spread well,bake 18-25 minutes , until a wooden pick inserted in the center comes out clean', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (388, 'fall ing for spice cake', 'easy', '50 min', 'for the cake:,preheat oven to 350,mix all the ingredients together until well combined,place in a 9 x 13 pan coated with nonstick spray,bake for 35 minutes or until tests done,cool in pan,for the frosting:,combine yogurt and dry pudding mix until thoroughly combined,fold cool whip free into the yogurt mixture,ice cooled cake with frosting,store cake in the fridge,when ready to serve let cake sit on the counter for 10 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (389, 'famous garlic noodles', 'easy', '20 min', 'loosen the yakisoba noodles in a large pan,in a large saut pan , add the cooking oil , cook in medium heat,add the fresh garlic , about 10 seconds , add the granulated garlic,add the noodles right away , then , add the chicken broth,stir the noodles around to blend with the garlic mix,add the soy sauce , and then the fish sauce,stir constantly but be careful not to break the noodles apart,cook until noodles are smooth and coated,add the oyster sauce and stir about 5 more minutes,serve plain or with any of the toppings mentioned above', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (390, 'faux sourdough', 'easy', '130 min', 'all ingredients should be at room temperature before starting,add the ingredients to the pan in the order listed,select \"white bread,press \"start', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (391, 'first skillet cornbread', 'easy', '25 min', 'heat oven to 400 degrees f,in 8\" cast iron skillet over medium heat , cook bacon until crisp,transfer to paper towles to drain,crumble,remove all but 1 1 / 2 teaspoons bacon drippings,brush sides and bottom of pan with remaining drippings,place skillet in over for 5 minutes,meanwhile , in medium bowl , stir together cornbread mix , mexicorn , jalepeno , egg , cheese , milk , and bacon until combined,spoon batter into heated skillet and bake 15 minutes , or until golden,trade the jalapenos and cheese for fillings that taste best with your summer feast,garlic lover ? stir 2oz shredded provolone cheese , 1tsp,italian seasoning , and 1 clove minced garlic into batter until just combined,like it hot ? stir 2 oz diced or shredded pepper jack cheese , 1 / 2 teaspoons southwest chipotle seasoning , and 1 tsp whole mexican oregano , , into batter until just combined,subtle more your style ? stir 2oz shredded gruyere cheese , 1tsp,herbes de provence and 1 / 2 teaspoons seasoned pepper blend into batter until just combined', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (392, 'fish herb crust', 'easy', '30 min', 'mix all ingredients and place it in a seal tight ziploc bag , and refrigerate at least 30 minutes before using,use half of the mixture on one or more filets of fresh fish , as a thin crust,bake in a preheated 350 f degree oven for 20 minutes,serve warm over a bed of rice , couscous , or any other grains of your choice', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (393, 'foodies succotash', 'easy', '25 min', 'heat oil in electric skillet and saute the red onion until translucent,add the garlic and cook about 1 minute,add the remaining ingredients and simmer until heated through', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (394, 'fooled me flourless peanut butter cookies', 'easy', '15 min', 'beat egg,add splenda , dark brown sugar , baking powder and vanilla,beat with a fork until free of lumps,add both peanut butters to the egg / sugar mixture,beat with a fork until well combined -- about 40 strokes,refrigerate dough for 30 minutes,preheat oven to 350 degrees f,cover 11x17 baking sheet with parchment paper,divide chilled dough into fourths,from each fourth , shape 4 balls of dough,space balls of dough evenly on prepared baking sheet,flatten dough slightly with tines of fork,make a second set of tine marks at a 90-degree angle to the first set,bake cookies for 9-10 minutes,let cool for two minutes on baking sheet , then transfer cookies to wire rack to complete cooling,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (395, 'fraicheur vinaigrette', 'easy', '5 min', 'in an airtight container , combine vinegar , sugar , salt , mustard , paprika , and garlic,close container and give it a good shake,add oil , close container , and shake until evenly blended', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (396, 'fried bacon in the oven', 'easy', '20 min', 'to avoid grease splatters on the top of your stove or having to wash an extra splatter screen , simply put bacon in a cast iron skillet with the lid on in a preheated 450 oven for about 15 minutes,remove the skillet , drain the bacon , and the oven stays clean and so does the top of your stove,enjoy now and / or you can crumble up the leftover bacon to use in omelets or other recipes for later,simply put them in a freezer bag and use later,it\'s especially efficient when you\'ve already heated the oven for another dish', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (397, 'fried pork chops and gravy', 'easy', '40 min', 'in a blender combine the marinade ingredients,blend until smooth,place pork chops in a resealable bag and add marinade,squeeze out as much air as you can and seal the bag,refrigerate for 4 to 8 hours,preheat oven to 425,remove chops from bag and discard marinade,blot chops with paper towel to remove excess moisture,place well-beaten eggs in a pie plate,combine pancake mix , paprika , and salt in another pie plate,dip each chop in pancake mix , shake off excess,dip in egg , coating both sides,dip in pancake mix again , coating well,move to wire rack to set for 5 minutes,meanwhile , spray a 9 x 13-inch glass baking dish with non-stick spray,put the butter in the baking dish and place in the preheated oven to melt,place chops in one layer in melted butter in baking dish,bake for 10 minutes,turn chops over carefully and bake for 10 minutes more,remove to wire rack placed over paper towels to drain,in a saucepan over medium high heat combine 2 tablespoons drippings from baking pan with flour,stir to make a smooth paste,add chicken broth , beef granules , marjoram and sage,bring to a boil , turn heat down , simmer and whisk until thickened and smooth , about 5 minutes,serve chops with mashed potatoes and pass the gravy,enjoy', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (398, 'from the field balsamic vinaigrette', 'easy', '5 min', 'mince herbs,measurements are approximate,use appropriate amount to match your taste,combine vinegars and mustard,gently whisk in oil,add rest of ingredients and mix well', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (399, 'fronch toast', 'easy', '40 min', 'pour the soy creamer and soy milk into a wide , shallow bowl,mix the cornstarch and stir until dissolved,add the chickpea flour and mix until mostly absorbed,some lumps are okay,heat a nonstick skillet over med-high heat,add enough oil to creat a thin layer on the bottom,soak the bread slices in the mixture and transfer to the skillet,cook each side for about 2 min,if they are not brown enough when you flip them , heat for 1 to 2 more minutes on each side,they should be golden brown with flecks of dark brown,serve immediately', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (400, 'full cool macaroni and cheese', 'easy', '25 min', 'in a medium saucepan , soften the onion in butter,add flour and stir 1 minute,add warm milk,stir until the mixture has thickened,meanwhile , in a large saucepan , cook pasta in a large quantity of salted boiling water until al dente,drain pasta and add to the sauce,add all cheeses , paprika , cayenne pepper and salt,stir until cheese has melted', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (401, 'funny bones cake', 'easy', '60 min', 'for the filling: beat the cream cheese and peanut butter until combined,add the powdered sugar and vanilla and beat until combined,beat in milk , 1 t at a time , until you reach desired consistency,set aside,for the cake: preheat oven to 350 degrees,spray a 12 cup bundt pan with cooking spray for baking,mix cake mix , oil , sour cream and eggs in a bowl,beat 1 or 2 minutes at medium speed,reserve 2 cups of the batter,pour remaining batter into the prepared pan,put peanut butter filling in a ring on top of batter,spoon reserved batter on top,bake for 40-50 minutes,cool 20 minutes and remove from pan onto wire rack,for the glaze: mix powdered sugar , vanilla and lt,cream until smooth,add more cream as needed to desired consistancy,when cake is cool , place on serving platter and drizzle with glaze', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (402, 'gilded zucchini', 'easy', '20 min', 'wash and peel the zucchini and cut into long strips,season with salt and pepper,mix the eggs , milk and salt , dip the zucchini strips into the mixture and then roll in the breadcrumbs,saute until crisp on the outside but not overcooked , about 2-3 minutes,serve', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (403, 'gimme a cheap weeknight dinner quick', 'easy', '35 min', 'brown ground beef , along with garlic , celery and green onions,add cream of potato soup and milk and bring just to a boil,lower heat to a simmer and add worcestershire sauce , pepper and onion powder,in a pot of boiling water , cook egg noodles halfway,about 5-6 minutes,drain noodles and add to skillet with ground beef mixture,add peas , corn , cheese and water and stir well,allow to simmer for 15 minutes , stirring occasionally', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (404, 'gobble up turkey cottage pie', 'easy', '80 min', 'in a large pot of boiling , salted water , cook potatoes until fork tender,drain & pour back into hot pot,add cream cheese , butter , milk & salt & mash well until potatoes are fluffy,cover pot & keep potatoes warm,meanwhile , while potatoes are cooking , in a large skillet heat oil over medium heat,add onion , celery & carrot & cook , stirring , until vegetables begin to soften,crumble ground turkey over vegetables & cook until meat loses it\'s pink color,sprinkle flour over cooked turkey & stir to combine,dissolve turkey base in the boiling water & stir into meat,simmer , stirring , about five minutes , until mixture thickens slightly,pour meat filling into a 2-3 quart casserole & sprinkle peas over,carefully spread warm mashed potatoes over filling , sealing potatoes to edge of dish,bake in preheated 350 degree oven for 30 minutes , until heated through & bubbly at edge of dish,remove from oven & sprinkle cheese on top,bake an additional 5 minutes , just until cheese melts', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (405, 'good morning muffins', 'easy', '40 min', 'mix the first 5 ingredients together in a large bowl,in another bowl , combine the eggs , apple sauce , oil and vanilla,in another bowl mix carrots , apple , pineapple , raisins , walnuts and coconut,add egg mixture to dry ingredients and mix until partially incorporated , using as few strokes as possible,add fruit mixture to egg-flour mixture and mix , using as few strokes as possible , until batter is just moistened and fruit is incorporated,don\'t over mix if you want light , fluffy muffins,fill greased muffin cups two-thirds full,bake at 350 for 20-24 minutes or until toothpick inserted in middle comes out clean', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (406, 'goulash heart healthy version', 'easy', '40 min', 'cook macaroni until al dente , drain and reserve,brown ground turkey,add onion and garlic powder , cook until onion is translucent,add tin of tomatoes , with their juices,return cooked macaroni to pot , heat through,add cheez whiz , stir until melted,season with salt and pepper , to taste', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (407, 'goulashy beef stew for the slow cooker', 'easy', '430 min', 'combine all ingredients except noodles in slow cooker,cook on low for 6-7 hours , stirring occasionally if you can , until beef is cooked through and vegetables are tender,add noodles and cook on low for 1 hour , or until soft', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (408, 'granny squash creamed squash', 'easy', '20 min', 'combine water , squash and onions in a saucepan,bring to a boil,cook for about 10 or 15 mins until squash is tender,drain water and return mixture to the pan,smash squash mixture with a fork until thoroughly broken down,stir in evaporated milk,season with salt and pepper', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (409, 'green eggs kid friendly high in iron', 'easy', '8 min', 'combine cream , water , parmesan , salt and pepper in blender,blend until smooth,about 15-30 seconds,add eggs and blend until mixed,gently heat small frying pan,add butter and olive oil spray to coat,add egg mixture and cook gently over low-med heat , as you would cook scrambled eggs', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (410, 'green soup', 'easy', '60 min', 'cook the barley in the stock for about 15 minutes,add onion , celery , pepper and garlic and cook 15 minutes,add potatoes and simmer till the potatoes are almost done,add your greens and cook 5-7 minutes,you can mix whatever greens you like,if using artichokes , add when you add your greens,taste and correct seasoning,you may need to add additional stock as you cook', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (411, 'grey cup sourdough', 'easy', '75 min', 'carefully slice top off bread loaf,using a sharp knife , slice around rim leaving 1 / 2 inch sides,pull out bread and cut into 1 inch cubes,toast bread cubes on a cookie sheet for 15 min at 350,set aside,combine remaining ingredients,fill hollowed loaf and wrap in foil,bake 1 1 / 2 to 2 hrs at 325,serve warm with toasted bread , tortilla chips , or crackers for dipping,break up the crust from the bread bowl and eat that too !,enjoy', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (412, 'grilled salmon', 'easy', '15 min', 'just spray cast iron skillet with cooking spray and turn burner on high,rub seasonings on both sides salmon,when pan is smoking hot , add salmon,cook for about 2-3 minutes,turn and cook for another 2-3 minutes,turn again if needed to prevent meat from burning,turn electric burner off,immediately cover skillet and leave it on the hot burner another 4-5 minutes or until meat is done,do not overcook , as the meat will dry out,it will look as if it were cooked on the grill , nice and brown on the outside and juicy on the inside,i also use this same method to cook boneless , skinless chicken breasts and boneless pork loin chops and vary the seasonings to complement the meat,with just a tiny bit of practice , you\'ll know exactly how long to let the skillet sit on the burner after you have turned it off-- so you get the meat done and it\'s still very juicy', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (413, 'guilt free ice cream wannabe', 'easy', '5 min', 'combine greek yogurt , cocoa powder , and splenda in bowl and stir until well mixed,stir in mixed berries until well distributed,top with sprinkles of fiber one cereal,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (414, 'ham solo savory cake', 'easy', '215 min', 'make the cheese garnish:,place 1 cups of cheddar cheese in a microwave safe bowl and microwave in 15 second intervals , stirring in between , until smooth and pliable,scoop the cheese into the mold , pressing and spreading into the bottom,you dont want to fill the entire mold - just the han solo indentations and enough to cover the entire rectangle,microwave for 15 seconds then tap on the counter,freeze until solid at least 1 hour,carefully remove the cheese from the mold and set aside in the fridge,make the savory cake:,preheat the oven to 350 degrees f,line a 7x11 inch cake pan with parchment paper and spray with nonstick spray,combine the bisquick , milk , sugar , egg , and salt in a large bowl and beat with an electric hand mixer until combined,add the gruyere cheese , sauted onion , ham , and chives and fold with a spatula to combine,pour the mixture into the prepared cake pan and bake until lightly golden brown , about 30-35 minutes or until a toothpick comes out clean,let the cake cool completely in pan,meanwhile , take the han solo cheese garnish out of the fridge and let come to room temperature,run a small offset around the edges of the cake and invert onto a cutting board,remove parchment paper and then invert again,if needed , level the top of the cake with a serrated knife,place the cheese garnish on top of the cake and trim the cake with a serrated knife so that the cake and cheese have the same dimensions,set the cheese garnish aside and spread the softened butter over the top of the cake,place the cheese on top of the butter , pressing to adhere,transfer the cake to a platter and serve with more ham and butter', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (415, 'hamburger buns zero carb', 'easy', '35 min', 'preheat oven to 350 degrees,separate your eggs making sure there is absolutely no yolk in the white mixture,in a small bowl , mix together egg yolks , cottage cheese , and sweetener until creamy,in a larger bowl , add egg whites and cream of tartar and beat the whites with an electric mixer on high until fluffy,you want this mixture to be well whipped and quite stiff - under mixing will result in a very runny mixture,carefully fold egg yolk mixture into the egg whites with a large spatula , until evenly mixed,try not to over-mix , you don\'t want to loose the \'fluffiness\' of the egg whites mixture,spray two cookie sheets with pam,with a large spoon \"scoop\" the mixture into 10 even rounds on the sheets,place cookie sheet the middle rack and set timer for 20 minutes,now you will need to watch them , because the cooking time may vary on any two batches,basically , you want them to bake until they become nice and golden brown color,remove from the pans and cool on a wire rack', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (416, 'harak mas curry sri lankan beef curry', 'easy', '130 min', 'cut steak into 2 inch squares,heat the ghee in a saucepan and gently fry the onions , ginger and garlic until just beginning to turn golden,add curry powder , turmeric , mustard seeds and fry over a low heat for 2-3 minutes,add salt and vinegar and stir well,add steak and fry , stirring to coat meat well,add chillies and tomatoes , cover pan and simmer on a very low heat for about 2 hours,if the gravy is too thin when the meat is tender , cook over a high heat , uncovered until reduced,serve with rice', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (417, 'he proposed red velvet cake', 'easy', '50 min', 'in a large bowl add flour , baking soda , baking powder , salt & cocoa powder,whisk until well combined,set aside,in a separate large bowl , add sugar and oil,mix until combined,add in eggs , buttermilk , vanilla & red food coloring,stir until combined,next add in the coffee & vinegar,stir until combined,next add in the coffee & vinegar,stir until combined,pour the flour mixture into the sugar mixture a little at a time,beating until well combined,pour the batter into 2 greased & flour 9 inch round cake pans,bake for 30-40 minutes at 350 or until toothpick inserted into center comes out clean,another way to check for doneness is to lightly press the cake on top , if it springs back then it is done , if the dent remains in the cake then it is not done,do not overbake,when the cakes are done let them cool in the pan for about 10-15 minutes,then remove them from the pan and let them finish cooling on a wire rack', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (418, 'healthified decadent hot chocolate', 'easy', '15 min', 'mix together the sugar and cocoa in a 2-quart saucepan,stir in the skim milk and half and half until well blended and cook until heated,do not bring to a boil,remove pan from heat,whisk in chocolate chips and stir until chips are melted and the milk mixture is smooth,stir in vanilla and pour into 4 mugs to serve', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (419, 'healthy 5 minute mug cake', 'easy', '5 min', 'mix dry ingredients well in a large mug,add all wet ingredients to mug and mix until batter is smooth,place in microwave for approximately 3 minutes on high,carefully remove mug and allow 2 minutes for the cake to cool , then flip over onto a plate and enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (420, 'hershey s special dark chocolate chip cookies', 'easy', '30 min', 'heat oven to 350f,beat butter and shortening in large bowl until well blended,add brown sugar and granulated sugar,beat thoroughly,add sugar and vanilla , beating until well blended,combine flour , baking soda & salt,gradually beat into butter mixture,stir in chocolate chips and nuts , if desired,drop by teaspoons onto greased cookie sheet,bake 10-12 minutes or until lightly browned,cool slightly,remove from cookie sheet to wire rack,cool completely,serve with ice cold milk and enjoy', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (421, 'hershey s triple layer cheesecake', 'easy', '125 min', 'preheat oven to 350f,prepare chocolate crumb crust:,stir together 1-1 / 2 cups vanilla wafer crumbs , 1 / 2 cup powdered sugar and 1 / 4 cup hershey\'s cocoa,stir in 1 / 3 cup melted unsalted butter,press mixture onto bottom and 1-1 / 2 inches up sides of a 9-inch springform pan,bake 8 minutes,then cool,prepare cheesecake:,beat cream cheese and sugar in large bowl until smooth,add eggs , sour cream , flour , vanilla and salt,beat until smooth,stir together 1-1 / 3 cups batter with melted butterscotch chips in medium bowl,to melt chips: place chips in microwave-safe bowl,microwave at high for 1 minute,stir,if necessary , microwave at high an additional 15 seconds at a time , stirring after each heating , just until chips are melted when stirred,pour butterscotch mixture into cooled crust,then in another bowl stir together 1-1 / 3 cups batter with melted chocolate chips,pour over butterscotch layer,stir together remaining batter with melted white chips,stir until smooth,pour over chocolate layer,bek 55-60 minutes or until center of cheesecake is almost set,remove from oven to wire rack,with knife , immediately loosen cake from side of pan,cool to room temperature,prepare triple drizzle - optional:,place 1 tablespoon hershey\'s butterscotch chips with 1 / 2 teaspoon shortening only , in a small microwave-safe bowl,microwave at high 30-45 seconds,stir,if necessary microwave an additional 15 seconds at a time , stirring after each heating , just until chips are melted when stirred,repeat procedure with the two other chips,drizzle triple drizzle , one flavor at a time , over top of cheesecake , if desired,refrigerate until cold , about 3 hours,cover,refrigerate , leftover cheesecake', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (422, 'hey nic add the chicken leek and potato soup', 'easy', '120 min', 'first you need some home-made chicken stock,don\'t use store bought powder , it\'s not hard to make - i promise you this as a former kitchen assassin turned food-lover !,to make stock:,bring 3 l of water to a boil in a 4-6 l pot,add the chicken frames , a good dash of salt and the bay leaves,you will add more salt later but this helps to extract the maximum flavor from the chicken,reduce heat to simmer for 1 hour covered , skimming occasionally,do not simmer for too much longer than this or the bones start to decalcify and make the stock bitter flavoured,in the meantime:,clean and rough chop 2,5 kg of potatos , set aside,clean and rough chop 1 large leek , set aside,you\'re going to puree it all once it\'s nice and soft from cooking so don\'t obsess over getting perfect , small diced cubes you just want it chopped up enough so that they\'ll cook out nicely in the pot,back to the stock: your hour of simmering is done and voila -- you have stock !,now remove the chicken frames , set aside,strain the stock so that you catch any fine bones that may have come loose while simmering,add the leek,add the potato,boil till soft,once the chicken frames are cool to a temperature you can handle them , chip whatever meat there is off,set the meat aside,pluck out the bay leaves,whiz soup till smooth,we use a bar mixer personally,return chicken meat to pot,add salt and pepper to taste - for those who aren\'t familiar , this means add a bit , stir it well , let the flavors mingle for a minute or two , spoon a bit out and taste to tell if it suits your preferences,don\'t be afraid of the salt -- one of the basic tenants of cheffing is that salt equals flavor,soup is now ready to eat but if you prefer a thicker soup , allow to simmer uncovered to reduce , till it\'s as thick as you like', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (423, 'hibachi style salad dressing', 'easy', '15 min', 'to make ginger juice , peel some fresh ginger and cut into small pieces,put pieces in a garlic press and squeeze,combine all ingredients except mayonnaise in a small bowl and whisk until honey is dissolved,add mayonnaise and whisk again until smooth,good on green salads , cucumbers , and just about anything else !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (424, 'hindu spaghetti casserole', 'easy', '65 min', 'fry the chopped onion in one stick of butter until golden,add the ground beef , the chopped garlic salt and pepper,brown sufficiently and then add the tomato paste and the water,cook for 20 minutes,make a white sauce,melt the stick of butter and add the flour,when it has cooked add milk to make a medium sauce,cook the spaghetti according to package directions,in a buttered casserole put 1 / 2 of the pasta , top with a layer of meat sauce , add the other part of the pasta and top with the balance of the meat sauce,top with the white sauce and bake at 350 for about 20 minutes or until bubbly', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (425, 'homemade hamburger helper', 'easy', '40 min', 'start water boiling for pasta,heat oil or butter in skillet,add onions and garlic and saute,when wilted , add beef and seasonings,cook pasta according to package directions,drain and prepare with milk , butter and cheese sauce packet,set aside over low heat,when beef is only slightly pink , add tomatoes,continue cooking till meat is done,stir beef mixture into mac and cheese , add extra cheese and stir until melted', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (426, 'human puppy chow', 'easy', '15 min', 'melt together the butter , chocolate chips and peanut butter,after it is melted , pour over and entire box of rice chex,stir to coat,place powdered sugar in a paper bag,pour coated cereal in and shake,lay cereal on wax paper until cool', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (427, 'i am tired of living cocktail', 'easy', '50 min', 'frost two 8-ounce crystal glasses in your freezer for at least 30 minutes or so,brew the tea and chill it in the freezer,stir in the powdered sugar after it cools,in a separate carafe , blend the rum , tequila , grand marnier and the grenadine,pour this mix into the two glasses , an equal amount in each,fill each glass the rest of the way with the chilled tea,garnish with a couple of the cherries on a toothpick in each glass', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (428, 'i can t believe it is butter margarine spread', 'easy', '25 min', 'if you make your own buttermilk , mix vinegar to milk and let it stand at least 20 minutes and stir,in large mixing bowl , add softened margarine , buttermilk , vegetable oil and butter buds flavoring,mix on slow speed until well mixed,put in a container with lid in refrigerator,preparation time includes making your own buttermilk', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (429, 'i coulda had a stuffed pepper stuffed peppers', 'easy', '85 min', 'preheat oven to 350,cut the stems off the peppers , remove the seeds and membranes from inside , then rinse well with water to wash,set aside,if you choose to use the lemon juice and sugar , combine them with the vegetable juice cocktail and set aside,in a bowl , add the ground beef , onion , salt , pepper , rice , egg , 3 tablespoons of water and cup of the vegetable juice cocktail mixture,mix until very well combined,stuff each prepared pepper with 1 / 6 of the meat mixture,place the stuffed peppers , cut side up , in a baking dish that will hold the peppers in one layer but keep them fairly close together,pour the remaining juice mixture around the peppers,it should come to about 2 / 3 up the sides of the peppers,spoon just a bit of the juice onto the meat in each pepper and place in the oven,bake for about an hour , basting every 10 minutes or so , until the meat is cooked through , the rice is soft , and the sauce has thickened up a bit,it should look more like sauce at this point than juice,serve and enjoy,after adding the juice , bring to a boil , then lower the heat , baste , cover and simmer , and continue basting every 10 minutes or so until done', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (430, 'i don t believe it s lemon tofu cheesecake', 'easy', '155 min', 'preheat the oven to 350f,in a medium bowl , combine graham cracker crumbs , maple syrup and almond extract,mix until the graham cracker crumbs are moistened,prep a 9 inch springform pan by spraying the bottom and sides with nonstick oil spray , or by oiling with a paper towel,bake the crust for 5 minutes , then remove it from the oven and set it aside to cool while you prepare the filling,blend all the filling ingredients in a food processor for about 30 seconds , or until smooth,pour filling into the springform pan over the cooled crust,bake for about 30 minutes or until the top of the cheesecake is lightly browned,remove the cheesecake from the oven and allow it to cool,place the cooled cheesecake in the refrigerator for at least 2 hours until it is thoroughly chilled and firm,to serve , take a long knife and heat the blade in hot hot water,slide the blade of the knife along the edge of the cooled cheesecake to ensure that it will separate from the pan,release the springform ring , slice , sprinkle with slivered almonds if desired and serve cold', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (431, 'i don t have any tahini hummus', 'easy', '15 min', 'drain chickpeas and blend,add remaining ingredients and blend until smooth,to make it a tahini recipe , add 1 / 4 cup tahini,or you could add 1 cup cooked carrots', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (432, 'i fooled the carnivores vegan barbecue', 'easy', '35 min', 'saute onions until they are clear and soft,add ginger and garlic , saute on medium heat for about 3 minutes , making sure not to burn the garlic,add the veat to the mixture , and make sure you have the onion / garlic / ginger mix dispersed evenly within the veat,add ketchup , maple syrup , tabasco , vinegar , salt , pepper , and crushed red pepper to veat and stir well,i am just guessing at these measurements,taste the mix now -- if it needs more of something then feel free to add it !,since there is no meat involved , the bbq does not have to cook for a certain amount of time , but i prefer eating mine hot , so i get it bubbling , and then serve on a bun !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (433, 'i ve only got a quarter meal', 'easy', '35 min', 'roll ground beef into very small balls , just a touch bigger than the peas,brown on medium heat in non-stick pan sprayed lightly with oil,keep them moving while browning,add rest of ingredients , slowly stirring until all is well incorporated,serve over rice , pasta,or toast points,and that\'s all there is , folks !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (434, 'if you like pina coladas protein smoothie', 'easy', '5 min', 'pour water into blender,add protein powder and oat flour,blend on medium for 15 seconds,add pineapple and coconut extract,blend for 30 seconds,add ice and blend on high for 30 seconds,pour into tall glass and serve', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (435, 'in the pink lemonade', 'easy', '5 min', 'mix all ingredients together well in a 2 quart pitcher,chill until ready to serve', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (436, 'indian macaroni and cheese', 'easy', '30 min', 'first you want to take the block of cheese and cut about 1 1 / 2 to 2 inches of the cheese,for ease of melting cube into small pieces,bring water to boil and add macaroni and follow direction according to packaging,when macaroni is done about 8-10 minutes drain,in the same pot heat the milk to a simmer and add the cubed cheese,takes about 5 minutes to melt,add the macaroni,if there are still small lumps of cheese that\'s fine,they should finish melting by the time to eat if not its a nice surprise,let stand for about 5 minutes for sauce to thicken,should be thick and creamy', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (437, 'it still feels like winter vegan oatmeal muffins', 'easy', '40 min', 'put the water , vinegar and salt in a blender,add 1 / 4 cup of the walnuts,blend this mixture on high for about a minute,this is your nice , slightly nutty tasting \"buttermilk\" for your muffins,pour your walnut \"milk\" into a large bowl,add the oats and stir to blend,let set about 10 minutes,add the applesauce , brown sugar and margarine to the oatmeal mixture,mix well,in a medium sized bowl , mix the flour , baking soda and baking powder together,add these dry ingredients to the wet oatmeal mixture,mix until well blended,stir in the raisins and remaining walnuts,spoon mixture into muffin tins,bake at 350 for 15 to 20 minutes,cool and serve !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (438, 'it s a keeper fish stick casserole', 'easy', '60 min', 'in lg,bowl , stir together all ingredients except for half of the cheese and the fish sticks,spread into 13x9 baking dish,top with frozen fish sticks in 3 rows of 6 longways,sprinkle evenly with the rest of the cheese , spreading , making sure some of it gets down in between and around fish sticks,bake at 350 , uncovered , for about 35-40 minutes,serve with coleslaw and garlic bread', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (439, 'it s greek to me baked feta chicken', 'easy', '450 min', 'combine all ingredients in a gallon sized ziploc bag,marinate in fridge for 6 hours , turning 2-3 times,preheat oven to 350 degrees,pour bag contents into a 13 x 9 x 2 inch baking dish,cook uncovered , spooning juices over chicken occasionally , for about 30 minutes,remove pan from oven , garnish with lemon slices and crumbled feta,i serve this over white rice with pan juices and a final dash of black pepper', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (440, 'it s not a secret brisket', 'easy', '265 min', 'heavily coat all sides of the meat with the seasonings,place fat side down in oven bag,pour liquid smoke into bag and over meat,seal bag and allow to marinate overnight,place fat side up in pan , cook at 325 degrees for 4 hours for smaller brisket , longer if 8 lbs,test with fork through the bag , should be easily pierced and tender , with no blood oozing,allow to rest 10- 20 minutes outside oven,always cut brisket against the grain,serve and enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (441, 'it s that easy graham cracker delight', 'easy', '2 min', 'first , mix cream-cheese and powder-sugar in bowl,then , evenly distribute cream-cheese onto graham-crackers,to top it off , try slices of strawberries , pears , etc', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (442, 'italian ized pork chops', 'easy', '67 min', 'salt and pepper the chops and brown both sides,add all other ingredients and mix to combine,simmer for one hour , until chops are tender and falling off the bone,serve over cooked noodles or mashed potatoes,i also sometimes add a small can of mushrooms,you can also add or remove garlic per preference', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (443, 'janie marzetti', 'easy', '50 min', 'preheat oven to 350 and spray a square glass baking dish,cook the pasta al dente , drain , drizzle with a little oil and set aside,meanwhile , heat the rest of the oil over medium in a skillet and saute the tempeh and peppers a couple minutes,while these are cooking sprinkle herbs over them and stir,add the wine , if using,let it all sizzle and add the mushrooms and garlic , stir , and cook until tender--do not overcook,turn off the heat and pour in the sauce,mix the sauce mixture , pasta and mozzarella and pour it into the baking dish,sprinkle parmesan and parsley over top,bake 25-30 minutes , cover if the cheese starts to brown,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (444, 'jiffy deluxe pizza sticks', 'easy', '33 min', 'preheat oven to 375 degrees , grease one baking sheet,mix pizza crust mix , garlic powder , pepperoni and mozzarella cheese,add hot water and mix well,spread parmesan cheese onto greased baking sheet,drop dough onto parmesan cheese and knead dough into cheese to reduce stickiness,roll dough out on same pan , to 1 / 2 inch thickness,using a pizza slicer , cut dough into 1 inch strips , but don\'t separate,bake 15-18 minutes and remove from oven,mix topping ingredients and spread over hot breadsticks', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (445, 'johnny depp in a bundt pan a k a black russian cake', 'easy', '60 min', 'preheat oven to 350f,prepare bundt pan,mix cake mix , pudding , oil , and eggs together until smooth,add kahlua , creme de cacao , and espresso,pour into a bundt pan and bake for 50 minutes or until toothpick inserted comes out clean,mix together confectioner\'s sugar , kahlua , creme de cacao , and espresso until smooth and spoon over cooled cake,serve in low light,play some barry white,wear something low-cut,or , if you are male , wear something low cut !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (446, 'just peachy cobbler', 'easy', '70 min', 'preheat oven to 350f,melt the butter in a 9x13 pan,sift together the flour , baking powder , salt and sugar,whisk eggs and milk together,add to dry ingredients and mix by hand till blended,pour batter evenly over melted butter,mix sugar and cinnamon together and combine with the peaches,spoon peaches evenly over the batter , but do not stir it,bake 60 - 65 minutes , or until light golden brown,best served warm with whipped cream or vanilla ice cream !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (447, 'kelly s chinese cabbage salad', 'easy', '22 min', 'in frying pan , melt butter,add teaspoons seasoning and noodles,saute 2 minutes , stirring,set aside on paper towel,in lg,bowl , combine coleslaw mix , kernels , green onions and red bell pepper,toss , cover and refrigerate,30 minutes to 1 hour before serving make dressing:,in small bowl , whisk rest of ingredients well til syrupy,pour over salad , stir well , and refrigerate,just before serving , stir in noodles,variations:,sub or add toasted slivered or chopped almonds in place of or in addition to sunflower kernels,for a complete \"one-dish\" lunch or meal , stir in 2-3 cups cooked , diced chicken', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (448, 'kicked up baked corn pudding casserole', 'easy', '70 min', 'set oven to 350 degrees,butter an 11 x 7-inch glass baking dish,melt butter in a large skillet over medium heat,add in thawed corn and saute for 5 minutes , then add in half and half cream,bring to a boil , reduce heat and simmer for 5 minutes,transfer the mixture to a food processor and puree until a coarse texture consistancy,melt another 3 tablespoons butter in the skillet , add in the yellow and green onions , garlic , green bell pepper and jalapeno pepper,saute for about 5 minutes,remove from heat and add in the corn puree,cool 20 minutes,in a small bowl beat eggs , flour , salt and pepper then stir in 1 cup parmesan cheese , the stir into the corn mixture,mix to combine,transfer the mixture to prepared baking dish,sprinkle with 1 cup parmesan cheese,bake for 30 minutes uncovered,remove from oven , then sprinkle with grated cheddar cheese,return to oven , bake for another 15-20 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (449, 'kicked up macaroni and cheese', 'easy', '70 min', 'cook the pasta from the kraft dinner until firm-tender drain and rinse under cold water , set aside the cheese packages and the cooked macaroni,in a large frypan or dutch oven brown the ground beef with onion , garlic and celery until beef is no longer pink,drain fat,add in the mushrooms and the cooked macaroni to the ground beef,mix to combine,in a bowl , mix together mushroom soup , tomato soup , hp steak sauce , tabasco sauce green pepper , parmesan cheese and the two packages of cheese mix,mix well to combine,add the mixture to the ground beef in the pan and stir to combine,simmer on medium heat for 10 minutes,reduce heat to low and simmer for 30-35 minutes , stirring occasionally , adding in milk to thin sauce,delicious !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (450, 'kitchen sink chocolate chunk cookies', 'easy', '38 min', 'cream butter in an upright mixer until fluffy,add dark brown and white sugar and mix until thoroughly blended with butter , scraping sides and bottom of bowl from time to time,add eggs , 1 at a time , and mix until thoroughly blended , scraping sides and bottom of bowl from time to time,add vanilaa extract and mix at low speed to combine well,in a separate bowl , mix flour , salt and baking soda,add flour mixture to butter and sugar mixture and mix at low speed until thoroughly blended , scraping sides and bottom of bowl from time to time,mix briefly at medium speed until completely combined,add peanut butter chips and mix on low until combined,add toffee chips and mix on low until combined,add mini-marshmallows and mix on low until combined,add chocolate chunks and mix on low until combined,refrigerate batter for a few hours of overnight until cold,preheat oven to 350 degrees f,line baking sheets with parchment paper and drop heaping teaspoonsfuls of batter 2 inches apart,bake for approximately 12 -18 minutes , turning tray once during baking,cookies are done with they are golden brown around the edges and soft on top,let cool on wire rack', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (451, 'lamb chops sensory explosion', 'easy', '56 min', 'in medium size bowl whisk together 1 tbsp olive oil , rosemary , oregano , pepper , salt,rinse and pat dry lamb chops , place in bowl , turning to coat with seasoning mix,let marinate at least 15 min and up until 6 hrs in fridge,place chops in a casserole dish and bake in oven for 30 min at 350 degrees,you may need to check and add a small bit of water to pan so chops do not stick or burn on bottom,check to see if all pink is cleared , place sliced tomatoe and sliced mozzerella on top of chop in order stated , use additional pepper to taste and bake for 5 more minutes,remove from oven and let sit for 5 minutes so juices can set and meld into meat,serve with a crusty loaf of bread and your favorite sides,you may also choose to add red pepper flakes for heat i used 1 / 2 tsp on 2 chops , sprinkled after in oven,thickness of chop will effect cooking time as well so if thin check after 20 minutes,ovens vary so please check to be sure at the 30 min time frame', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (452, 'leave me for you chili', 'easy', '10 min', 'make ahead meal:,break up hamburger,mix all ingredients in crock pot,cook on low 7-8 hours,stir before serving,faster meal:,brown hamburger,mix all ingredients in large pot and bring to boil', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (453, 'leftover roast mexican casserole', 'easy', '120 min', 'shred cooked meat and remove any bones or fat,heat oil in a large skillet,add onion and pepper and saute until tender,add all ingredients except corn tortillas and cheese,stir together,bring to a boil,reduce heat to medium or medium-low and boil for one hour , allowing most of the liquid to cook off,watch and reduce heat if necessary,preheat oven to 350,spray a 9x13 pan with non-stick spray,place 3 corn tortillas in the bottom of the pan , tearing to fit,spoon 1 / 3 of the meat mixture over the tortillas,spread to cover,sprinkle with 1 / 3 of the cheese,repeat steps 7-9 two times,bake at 350 for 30 minutes,can also be refrigerated in the morning and baked later that day,i haven\'t tried to freeze it yet', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (454, 'light chocolate chip oatmeal cookies', 'easy', '21 min', 'combine margarine , sugar , egg , vanilla and cinnamon,stir until creamy and smooth,i microwave the margarine for about 30 seconds to soften,add flour and baking powder and stir until completely combined,add oats and then chocolate chips,spoon onto greased cookie sheets with a soup spoon with about an inch between each cookie,bake at 350 f for 11 minutes,i used two sheets in the oven at once , and if you do that , switch the bottom sheet with the top sheet after about 5 minutes and then continue cookie,let cool', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (455, 'lighter chocolate peanut butter pie', 'easy', '15 min', 'mix the 4 tablespoons of milk with the peanut butter,stir in container of cool whip,in a separate bowl , whisk 11 oz,of milk with the pudding for 2 min,fold the cool whip mixture into the pudding,spoon mixture into shortbread crust,garnish with chopped chocolate and peanuts,chill for 4 hours', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (456, 'lighter pistachio pudding salad', 'easy', '10 min', 'soften whipped topping,drain pineapple,mix all ingredients together,chill', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (457, 'lite tortillas', 'easy', '50 min', 'in a large bowl mix flour and baking powder,in a two cup measuring cup combine 1 cup of water and salt,add 1 / 3 cup of olive oil,pour water and olive oil all at once into the flour mixture and mix with a spoon or your hand quickly,when dough comes together , knead only until the dough is smooth,if your dough is too sticky add more flour 1 tablespoon at a time until it is no longer sticky,divide into 12-16 equal pieces and let it rest for 30 minutes,roll the dough balls out to a 6-7 inch circle for 16 pieces and 8-9 inch circle for 12 pieces on a floured surface,heat an iron skillet over medium heat and place tortilla in the ungreased skillet one at a time,the tortilla will form bubbles all over it,if they grow bigger than quarter pop them,when the spots are lightly browned turn over to brown other side,remove to a covered dish,you may need more flour than usual on your surface because these tortillas are slightly more soft which makes them easier to roll but also sticky if you don\'t use enough flour,i place a paper towel or cloth in the bottom of the warmer before i start adding the tortillas to prevent the bottom one from getting soggy from steam,if you like the fluffy tortillas like on a muchaco or gordita at chain resturaunts you can add baking powder to this and make circles slightly smaller,they can also be deep fried into taco shell shapes after they are grilled', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (458, 'little kick jalapeno burgers', 'easy', '16 min', 'in a large bowl , combine the first eight ingredients,crumble turkey over mixture and mix well,shape into 6 patties,coat grill rack with cooking spray before starting the grill,grill burgers , covered , over medium heat for 2-3 minutes on each side or until no longer pink,top with cheese,cover and grill 1-2 minutes longer or until cheese is melted,serve on rolls with salsa sour cream and lettuce', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (459, 'loco moco style hamburger steak with gravy', 'easy', '30 min', 'mix bread cubes with milk or water until bread is softened,mix together ground beef , softened bread cubes and rest of ingredients,mix well,form into patties,pan fry or broil to desired doneness,place cooked hamburgers on a warm platter and keep warm while preparing the gravy,remove oil , leaving brown particles in pan,pour broth into pan and heat to boiling , stirring and loosening brown particles ,,mix flour with water to make a smooth paste,slowly add to heated broth , stirring constantly , until smooth,add salt and pepper,serve the hamburger steak on hot steamed rice , with fried egg on the hamburger and gravy over all', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (460, 'lofthouse sugar cookies', 'easy', '18 min', 'preheat oven to 375f,blend , cake mix , eggs , and oil until moistened,roll into 1\" balls,place on ungreased cookie sheet,flatten with a glass or cookie stamp,bake at 375f for 6-8 minutes,allow to cool 1 minute before removing to cooling rack,while the cookies are still a little warm , spread on some buttercream frosting,allow the frosting to set up before storing', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (461, 'magic chicken noodle soup', 'easy', '40 min', 'put water in a tall pot and heat to a boil,add the chicken bullion , diced onions , oregano , garlic powder , and pepper,-slice carrots and add to the boiling water,- slice celery,-cut chicken into bite size pieces,add carrots to the pot and allow them to boil for about 5 minutes before adding the celery , chicken , and about half the package of wide egg noodles and allow to boil until the noodles are tender,now it\'s ready to serve,i love serving it with some buttered dinner rolls on the side,remember , you can adjust the seasoning and amount of veggies to your taste', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (462, 'magic coleslaw', 'easy', '20 min', 'in a large bowl , mix the dressing ingredients together with a wire whisk,whisk in 1 / 4 cup water,combine the coleslaw ingredients in a large bowl,pour dressing over the coleslaw mix and toss well to combine,refrigerate until chilled', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (463, 'magic cookie bars', 'easy', '35 min', 'preheat oven to 350 degrees f,beat butter , condensed milk and egg until well blended,add cookie crumbs to mixture , blending well,pour mixture into 13x9 inch square baking pan,spread crumb mixture into pan without pressing down,once crumb mixture is evenly spread , sprinkle chocolate chips all over,press down with fork,bake 25 to 30 minutes or until lightly brown,cool , cut into slices , and enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (464, 'mama mia triple cheese mostaccioli bake', 'easy', '50 min', 'cook pasta \"al dente\" style,while pasta is cooking , preheat oven to 350 degrees,melt butter in a large saucepan under medium heat,stir in flour , salt and pepper,gradually add milk,cook and stir until it thickens and slowly bubbles,remove from heat,stir in 1 cup each cheddar and parmesan cheese , blend until mixed well,stir in pasta,spoon 1 / 2 pasta and sauce into greased 13\" x 9\" baking dish,layer with swiss cheese , then remaining pasta mixture,cover and bake 25-30 minutes or until hot and bubbly,uncover and sprinkle remaining cheddar cheese over the top,serve after cheese melts , about 5-10 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (465, 'mamma mia ravioli bites', 'easy', '45 min', 'heat oven to 375f spray 24 mini muffin cups with crisco original no-stick cooking spray,on work surface , unroll 1 dough sheet,cut into 24 squares,place 1 dough square in bottom and up side of each of 24 muffin cups , letting points of dough extend over edge of cup,in medium bowl , mix remaining ingredients,spoon about 1 tablespoon cheese mixture into each cup,bake 10 to 15 minutes or until golden brown,cool in pans 3 minutes,remove from pan to cooling rack,repeat with remaining dough and filling , cooling pans between batches,serve warm', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (466, 'mandarin chicken', 'easy', '30 min', 'cut up chicken into 1 inch pieces,combine flour , salt , pepper and ginger in a bowl,dredge chicken in egg and then seasoned flour,in a large frying pan or wok heat canola oil and fry chicken until golden brown,set chicken aside,in another large pan , heat 1 tbsp of oil,sautee onion and peppers until slightly softened,add ketchup , vinegar , brown sugar and salt,blend cornstarch and mandarin orange syrup,stir into sauce,cook and stir until thickened,add chicken to sauce,stir and heat through,add mandarin oranges', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (467, 'marco polenta', 'easy', '40 min', 'in a boiler , simmer chickpeas , including liquid , with red pepper flakes and garlic for about 20 minutes,meanwhile , drain spinach , reserving the liquid,in a large skillet , heat oil,add cardamon and cook for about a minute,add onions , garlic and ginger and saute until the onions are translucent,add spinach , then cinammon and coriander,reduce heat and simmer gently for about ten minutes , adding reserved spinach liquid as needed to keep the mixture moist,meanwhile , slice and grill polenta , using a dry skillet or stovetop grill,drain chickpeas and add to the spinach mixture,prepare for serving by placing two slices of polenta on each plate,use a slotted spoon to drain the spinach and chickpea mixture , and top each slice of polenta,(ingredient,one cup dried chickpeas can be substituted for canned , by soaking overnight and then cooking until tender,one pound fresh spinach , wash and deveined , can be substituted for frozen,dried ground cardamon and ginger can be substituted for fresh,)', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (468, 'margarita dip', 'easy', '70 min', 'beat cream cheese , limeade concentrate and orange juice in medium bowl with electric mixer on medium speed until well blended,gently stir in cool whip,cover,refrigerate at least 1 hour,serve with cut-up fresh fruit,if you want to jazz it up a bit: serve in a wide-brimmed margarita glass and dip the rim of the glass in sugar before filling with the dip', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (469, 'mcgriddle pancakes breakfast sandwich', 'easy', '15 min', 'mix first four ingredients,pour 1 / 4 cup batter for each pancake onto a 300 degree griddle,flip when pancakes start to bubble,place warm cheese on meat , sandwich between pancakes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (470, 'meat potatoes meatloaf', 'easy', '90 min', 'heat oven to 375 degrees,in large bowl , combine potatoes , onion , eggs , bread crumbs , 1 / 3 cup of the ketchup , salt and pepper,mix well,add ground beef,mix lightly but thoroughly,on rack set over broiler pan , shape beef mixture in to 8 x 4-inch loaf,spread remaining 1 / 3 cup ketchup over top of loaf,bake 1 1 / 4 hours or until center is no longer pink and of medium doneness,let stand 5 minutes,cut into slices', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (471, 'meat ralf makeover', 'easy', '80 min', 'preheat oven to 350,mix ground meats together until blended well,if using italian sausage slices brown first and add last to keep them from falling apart,mix egg , cream , and 1 / 2 cup tomato sauce together then mix into meat,using your hands seems to be the easiest way , dont forget to wash and remove your rings,add breadcrumbs , finely minced garlic and onion , worcestershire sauce , salt , and pepper,don\'t be afraid to use the cayenne powder its not enough to burn you and it really gives the dish a lot of flavor,mix well,form into a large loaf pan,bake at 350 for 1 hour , top with remaining tomato sauce or ketchup , dust with salt and sugar , and bake for an additional 15 to 20 minutes,you can use 2 small loaf pans if you reduce the baking time by 15 minutes,serve with your favorite fresh veggie or garlic mashed potatoes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (472, 'melanie s chicken chili', 'easy', '90 min', 'heat a large stock pot to mediumheat with olive oil,add onion and peppers,season with a pinch of salt & pepper,cook until softened - about 2-3 minutes,add the chicken,season with a pinch of salt and pepper,cook until white , and cooked through,about 3-4 minutes,add the tomatoes , beans , garlic , and corn,season with salt and pepper,cook for 2-3 minutes,add all of the spices and the adobo sauce,add chicken stock,you may want more or less chicken stock depending on your desired consistency,i like mine fairly thick,bring to a boil,reduce to a rapid simmer,simmer for about 30-60 minutes -- all up to you -- the longer and lower temperature the better,add corn meal and cheese to thicken a little at a time,stir rapidly to avoid lumps,simmer for another 15 minutes or so,you may need to add more corn meal and / or cheese to obtain your desired thickness,check for seasoning -- you may want to add more salt and pepper to fit your taste,also , add more cayenne or chili powder for heat and depth,once the desired thickness and seasoning is achieved , the chili is technically ready to serve,i often like to turn the heat down to low and cook longer -- anywhere from 15 minutes to hours,this continues to intensify the flavors and thicken the chili,serve in a bowl with a sprinkle of fresh cilantro , scallions , cheddar cheese , and a spoonful of sour cream,fresh corn tortillas , cornbread , and garlic-jalapeno focaccia bread go well with this also,you can vary this in any way - often i\'ll use shredded rotisserie chicken or different types of beans,also , you can omit the tomatoes , adobo sauce and red powders all together and use roasted , seeded and peeled green chiles,if you like more of that east coat / midwestern style chili use ground chicken or turkey and add some tomato paste instead of the cheese / cornmeal to thicken,you can also omit the meat altogether and add extra beans & vegetables,this recipe also works well in the crock pot left cooking all day using dried & soaked beans - i like the health benefits of this myself', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (473, 'missy s sweet potato casserole', 'easy', '50 min', 'preheat oven to 350 degrees,mash the sweet potatoes,mix the sugar , melted butter , eggs , milk , vanilla and cinnamon into the sweet potatoes,spray a baking dish with non-stick cooking spray and pour potato mixture into it,mix the topping ingredients together in a small bowl,sprinkle topping over the sweet potato mixture,bake for approximately 35 minutes , or until the casserole gets brown and bubbly', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (474, 'mohnstrietzel german poppy seed cake', 'easy', '55 min', 'in a bowl mix poppy seeds , butter , sugar , eggs , granola cereal / almonds and raisins,stir until well blended,in a second bowl mix baking powder and flour,add quark , milk , oil , applesauce , sugar , vanilla and salt,using the dough hooks work into a smooth dough,do not knead longer than 1 minute or dough will become sticky,roll out on a floured surface into a rectangle of 35x45 cm,if the dough is too sticky , add a little flour,spread with the poppy-seed-mixture and roll up starting on the longer side,carefully place on a paper-lined baking sheet and cut a criss-cross-pattern into the top of the dough,brush with a little milk,in the preheated oven bake at 180c / 350f for about 30-35 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (475, 'mom s amazing banana bread', 'easy', '55 min', 'preheat oven to 350,beat butter and sugars until smooth and creamy,beat in eggs , one at a time,beat in bananas and vanilla,in a separate bowl , mix dry ingredients together,fold the dry ingredients into the wet , until well blended,fold the nuts and sour cream into batter until just blended,do not over-mix,butter a cast iron skillet,pour batter into skillet-bake in oven until toothpick inserted in the center comes out clean-45 minutes to an hour', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (476, 'mom s chicken', 'easy', '80 min', 'season flour with paprika , garlic powder , salt and pepper,dredge chicken pieces in flour shaking off excess,heat oil in frying pan and brown chicken on both sides,meanwhile make sauce,mix mushroom soup , chicken broth , orange juice , white wine , ginger and brown sugar together,season to taste with salt and freshly ground pepper,place browned chicken in large oven proof dish and pour sauce over and add the carrots , celery and mushroom,cook in a 350 oven for 1 hour until vegetables are tender and chicken is cooked through', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (477, 'moose milk', 'easy', '10 min', 'mix ingredients in a punchbowl , adding nutmeg last , and to taste,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (478, 'mostly clean eating granola bars', 'easy', '30 min', 'mix dry ingredients,add applesauce and agave to dry ingredients , mix well,add chocolate chips and craisins , mix well,using a rolling pin press into a jelly roll pan,you may need to use a clean eating spray to keep it from sticking to your rolling pin,press firmly !,bake at 350 degrees for 15 minutes,allow to cool slightly and cut into bars with a pizza cutter,allow to finish cooling in pan,when cool , store in freezer bags in the freezer', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (479, 'muffalata sandwich by any name tastes great', 'easy', '20 min', 'open up the sandwich rolls and scoop out most of the center,in a small mixing bowl combine 2 tablespoons of pesto with the tepanade , artichoke slices and stir to mix well,on the rolls: spread 1 / 2 tablespoon of remaining pesto on each side of the rolls,divide the olive artichoke pesto mixture between the two rolls and spread on each roll,take slices of the turkey , ham and salami and cheese and place on top of the olive mixture , dividing them between the two sandwiches,at this point you can make these hot or cold sandwiches,for hot::,heat heavy cast iron skillet , place the two rolls and top with another pan or i use my tea kettle with water in it to squish them down,heat through , turning over halfway,for cold:,squish the two sides of the sandwich together and wrap tightly with suran wrap and place in fridge,this gives the flavors time to marry , serve and enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (480, 'nachos casserole', 'easy', '35 min', 'preheat over to 350 degrees,brown ground beef and drain,add the two packets of taco seasoning to the beef,fill each packet with water and add to the meat and seasoning mixture,stir well,let meat simmer about 15 minutes covered or until water has evaporated and mixture is not soupy,in casserole dish spread refried beans evenly on bottom of dish , fully covering,sprinkle 1 cup of shredded cheese over refried beans,next pour meat mixture over beans and cheese,spread evenly,cover with remaining cheese and top with green onions,bake in oven about 15 minutes or until cheese is melted,serve with tortilla chips and desired toppings', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (481, 'naked grilled salmon', 'easy', '25 min', 'rinse fillet and pat dry,start grill,heat to medium high to high,rub with olive oil,if salmon is skinned , rub both sides,rub one side with garlic , sprinkle with salt and pepper,grill for approximately 10 minutes , turning once , or until fish flakes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (482, 'navajo style peach crisp vegan friendly', 'easy', '60 min', 'preheat oven to 375 ?,butter or oil an 11x17-inch baking dish,filling: in a medium bowl , combine peaches , sugar , flour , and lemon juice,spread fruit mixture evenly in baking dish,set aside,topping: in a medium bowl , mix together flour , cornmeal , sugar , and salt,use a pastry blender to work the butter pieces into the dry ingredients so the mixture looks like coarse crumbs,cover fruit evenly with topping,set the baking dish on a baking sheet to catch any juices that spill over,bake until fruit is bubbling , the peaches are fork tender and topping is golden in color , about 45 minutes,add the pine nuts to the top of the crisp the final 5-10 minutes of baking', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (483, 'need a pick me up banana peanut butter smoothie no', 'easy', '10 min', 'cut banana into chunks,combine 1 / 3 banana chunks and milk and use hand blender or regular blender to mix well,i use a hand blender and blend in a hard plastic cup,slowly add rest of banana and blend,add peanut butter,blend well,add cocoa powder and push powder underneath liquid so as to not splatter when turning on blender,blend well,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (484, 'new mashed potatoes', 'easy', '30 min', 'scrub potatoes and cut into 1 / 2 inch cubes,place into cold salted water , enough to cover , and boil until tender,mince onions and garlic while potatoes are cooking,drain well,in a large bowl , put drained potatoes , and 1 stick of butter mash lightly,add onions , garlic , garlic powder and salt and pepper,using a hand mixer , blend well,add remaining butter and enough cream to make smooth,these reheat great and even better the next day when flavors have blended,i used them today to make a casserole , put into a buttered casserole dish and added some grated swiss and broiled about 5 minutes until cheese was browned a bit and bubbly', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (485, 'next to sex dessert', 'easy', '27 min', 'mix margarine and flour until crumbly,add pecans and press into the bottom of a 9 x 13 pan,bake at 350 for approximately 12 minutes , being careful that the crust does not brown,cool completely,combine confectioners sugar , cream cheese , and 1 cup of the whipped topping,spread on cooled crust,combine pudding mixes , and milk,spread on top of the cream cheese mixture,top with remaining whipped topping', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (486, 'no egg tomato soup cake', 'easy', '75 min', 'cream butter and sugar together,add tomato soup,add water , rinsing can,sift dry ingredients together,add dry ingredients to creamed product,spray generously loaf pan with butter and flour spray,pour batter into pan,bake at 350 degrees for 1 hour,let cool for 10 minutes and remove from pan', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (487, 'no fettuccine spaghetti alfredo', 'easy', '30 min', 'heat whipping cream in large saucepan over medium heat for 5 minutes , stirring frequently,add garlic , wine , parmesan , and black pepper to cream , stirring until smooth and unfiorm,reduce heat to medium-low and add cream cheese , 4 oz,at a time , until melted , stirring constantly,keep sauce on low heat while cooking noodes,noodles: in a large stockpot , bring water to a rapid boil , add sea salt and noodles,cook noodles for 8 - 12 minutes , until soft when bitten,briefly drain and rinse noodles , then toss with sauce in saucepan,serve immediately', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (488, 'no fuss easy baked artichokes', 'easy', '65 min', 'rinse and trim the artichoke , cutting the stem off straight so that the artichoke can stand up on it\'s own without,spread artichoke petals open as far as possible without snapping,between the petals: squeeze lemon juice , drizzle olive oil and broth and stuff garlic,sprinkle the top of the artichoke with sea salt,tightly double wrap and seal the artichoke with heavy-duty aluminum foil,place artichoke , making sure that it is standing up straight so the liquid doesn\'t come out in a pre-heated 425 oven and bake,remove from oven and remove wrapping', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (489, 'no more fears paella', 'easy', '70 min', '1,season shrimps , cover with plastic wrap and refrigerate while sauteeing other ingredients,2,in a wok , sautee green bell pepper strips in little oil , transfer to a small bowl and set aside,add more oil in the wok and cook chicken breasts strips , 3 minutes on each side,move cooked chicken strips around sides of the wok , and add sliced chorizos or smoked sausages to hot oil,brown chorizos for about 4 minutes,transfer cooked chicken strips and chorizos in another bowl and set aside,3,add about 2 tablespoons oil in wok and sautee onions until translucent,add diced tomatoes with the juice and 2 cups of sweet rice,stir until sweet rice is coated with the tomato mixture,4,add chicken broth , wine , saffron threads , bay leaf , salt and cooked chicken and chorizos,bring to boil , stirring occasionally,5,transfer to a large aluminum tray or casserole dish and cover and bake in 350 f oven for about 15 to 20 minutes or until mixture is almost dry and rice is done,uncover and arrange toppings (bell peppers , shrimps , peas and seafood mix,cover and return to oven and bake for another 12 to 15 minutes,remove from the oven and let paella stand for another 5 minutes for rice to firm up and absorb more juices', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (490, 'no sausage gravy for biscuits and gravy', 'easy', '7 min', 'melt butter in a saucepan over medium heat,sprinkle flour over melted butter and whisk together to form a paste,allow this to cook for a minute,pour in milk , all at once , whisking constantly,add seasonings , whisking constantly,allow the gravy to come to a boil , still whisking,taste and adjust seasoning , if necessary', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (491, 'no time flat nuked nachos with salsa and cheese', 'easy', '10 min', 'with a large spoon , spread out the beans in a ring on a large microwave-safe dinner plate , leaving about 4 inches in the center of the plate ,,smear the sour cream and then the salsa over the beans,sprinkle about half of the cheese over everything,microwave on high for 2 minutes,remove the plate from the microwave , pile the chips in the center of the plate,sprinkle the remaining cheese over the chips,return the plate to the oven and microwave on high for another minute or until the cheese has melted,remove carefully as the plate will be hot,serve hot', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (492, 'not too sweet sweet potatoes', 'easy', '53 min', 'roast yams / sweet potatoes @ 375 for 45 minute,peel bananas and quarter,roast bananas in greased pan @ 375 10 minute,scoop out yams from skins,add bananas to yams / sweet potatoes,add remaining ingredients,whip yam / potato mixture until creamy,grate zest of lime over top of mixture', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (493, 'not your average spuds', 'easy', '45 min', 'rince spuds in cold water and drain well,heat bacon drippings in lg,skillet or electric skillet over medium heat,add potatoes and saute until potatoes begin to brown,add onions and seasonings and stir to combine,cover and watch closely stirring occasionally until potatoes are tender,adjust seasonings to taste,serve with you favorite beans and cornbread', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (494, 'off the boat sicilian pasta sauce', 'easy', '85 min', 'chop your 1 / 2 medium onion,take a medium size pot and simmer together your chopped onions and oil over medium heat until onions are tender,pour in your tomato sauce and stir well,let your sauce come to a boil for at least a half an hour,reduce heat to medium-low,stir in your desired amount of salt and pepper,cook for an additional half an hour,after at least an hour of cooking , bring a pot of water to a boil for your pasta,let the sauce cook until pasta is drained and ready,scoop some sauce into your drained pasta to coat,serve with a scoop of pasta sauce ontop and enjoy !,you can add anything to this base pasta sauce -- we italians sometimes will throw in cooked tender cauliflower for one dish or asparagas , or drained / fried ground beef for pasta bolognese , etc,you get the idea', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (495, 'oh boy waffles', 'easy', '15 min', 'mix wet ingredients together,sift dry ingredients into separate bowl,add wet ingredients,mix till moistened,bake in preheated waffle maker 7-8 minutes until done and golden brown,cooking time is for all the waffles', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (496, 'oh i love this cheesecake', 'easy', '210 min', 'preheat oven to 325 dg,place jellyroll pan or cookie sheet with sides half filled with hot water on rack underneath center rack in oven,grease or spray bottom and sides of a 10\" springform pan with butter or non-stick vegetable spray,make crust by putting graham cracker crumbs and sugar in a small bowl and mixing in melted butter until crumbly,press mixture into bottom and partially up the sides of a greased 10\" springform pan,bake on center rack in oven at 325 dg,for 10 minutes,set aside to cool,mix together cheeses , sugar , beaten eggs , lemon juice and vanilla,add cornstarch , flour and melted stick of butter,mix until smooth,blend in sour cream and mix well,pour over prepared crust,bake at 325 dg,for 1 hour on center rack of oven , centered over water bath underneath,after 1 hr,, turn off oven and keep cheesecake in oven for 2 hours -- do not open oven door during resting period !,remove from oven and refrigerate , do not worry if cheesecake is a little \"jiggly\" when removing from oven , because it will firm up during chilling process,when chilled , remove from pan just prior to serving,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (497, 'old bay grilled steak fries', 'easy', '20 min', 'combine spices in a bowl,place potatoes in a pot of cold water , add salt , and cook until potatoes are tender but firm , about 10 minutes,drain , let cool , and cut each potato lengthwise into 8 slices,heat grill to high,brush potatoes w / oil , season w / the spice rub , and grill until golden brown and cooked through , about 3 to 5 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (498, 'old reliable french bread for kitchen aid mixers', 'easy', '170 min', 'dissolve yeast in warm water in warmed mixer bowl,add salt , butter , and flour,attach bowl& dough hook to mixer , turn to speed 2 and mix about 1 minute or until well blended,knead on speed 2 about 2 minutes longer,dough will be sticky,put dough in large greased bowl , turning to coat,cover and let rise in warm place , free from draft , about 1 hour , or until doubled in bulk,punch dough down and divide in half,roll each half into 12\" x 15\" rectangle,roll dough tightly , from longest side , tapering ends , if needed / wanted,put loaves on greased baking sheets that have been dusted with cornmeal,cover and let rise in warm place , free from draft , about 1 hour , or until doubled in bulk,with sharp knife , make 4 diagonal cuts on top of each loaf,bake at 450f for 25 minutes , then remove from oven,beat egg white and water together and brush each loaf with this mix,return to the oven and bake 5 minutes longer,immediately remove from baking sheets and cool on wire racks,serve with your favorite spread such as herbed butter , garlic bread topping , etc', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (499, 'olive garden salad and dressing recipe', 'easy', '15 min', 'for the dressing: mix the first eleven ingredients in a blender until well mixed,if this is a little to tart for your own personal taste , add 1 tablespoon of sugar,for the salad: pour 1 / 2 package of the salad blend into a large salad bowl,top with 1 / 2 of the onion , olives , banana peppers , croutons and tomatoes,add dressing to taste and toss well,add the other 1 / 2 bag of salad and more dressing to taste,toss well,top the salad with the remaining onion , olives , banana peppers , croutons and tomatoes,pass the grated parmesan cheese and black pepper mill at the table', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (500, 'one of cookies no bake 4 ingredients', 'easy', '13 min', 'in a large saucepan , mix sugar and corn syrup and bring to a boil , stirring frequently,boil for 1 minute,remove from heat and blend in peanut butter,add cornflakes , stirring gently to coat,working quickly , drop mixture in 1 / 4 cup lumps , 2\" apart onto countertop lined with waxed paper,using fingers , shape each cookie into rounded mound as necessary,let stand at room temp for 20-30 minutes to set,store in airtight container at room temperature', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (501, 'one pot dinner', 'easy', '260 min', 'brwon ground beef in skillet , drain off fat and put in crock pot,cut bacon in small pieces,fry bacon and onions till brown,drain off fat,add bacon , onions , and remaining ingredients to crock pot,stir together well,cover and cook on low for 4 to 9 hours,if using the 2 quart crock pot , reduce this recipe by half', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (502, 'oopah feta chicken breasts', 'easy', '55 min', 'preheat oven to 350 and spray baking pan with small amount of vegetable cooking spray,randomly pierce chicken breasts with a fork to absorb lemon juice,sprinkle 2 t lemon juice over chicken breasts , then season with salt and pepper,top evenly with feta cheese , green pepper , chopped tomatoes and scallions , reserving a portion of green stems for garnishing later,drizzle with remaining lemon juice,bake uncovered in oven for 40-45 minutes until cooked through,before serving , sprinkle with diced scallion greens and chopped parsley,if desired , a small amount of additional lemon juice can be drizzled over dish,serve with crusty bread and butter and green vegetable of your choice,we like cut green beans sprinkled with a little oregano and melted butter,enjoy !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (503, 'oops there it is chocolate cake low fat', 'easy', '60 min', 'preheat oven to 350 degrees,in a small bowl , mix together flour , cocoa , baking powder , baking soda , cinnamon , and salt,in a medium bowl , blend together brown sugar , whole egg , egg whites , and oil with an electric mixer over medium speed,add vanilla , almond extract , and sour cream,beat on low speed until well blended,gradually add flour mixture to sour cream mixture , beating on medium speed,fold in chocolate chips with a spoon,spray and 8x8 pan with non-stick spray,spread batter evenly in pan,bake for 40-45 minutes , until wooden toothpick inserted in center comes out clean,be sure to chekc cake after 40 minutes , as you don\'t want to overbake it,remove from oven and let cool in pan for 15 minutes,cut into 12 squares,for maximum moistness , store at room temperature in an air tight container', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (504, 'orange soup', 'easy', '45 min', 'peel and cube the squash and sweet potato,chop the carrots,put in a pot and add water to just cover the vegetables,boil until vegetables are soft , then mash with a fork,add the yogurt and the broth,squeeze the juice out of the mandarin and add,stir well so that the solids mix with the liquids,add spices , honey , salt and pepper,you\'re done !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (505, 'p anana confetti circles', 'easy', '5 min', 'arrange sliced banana on a plate,put a small dollop of peanut butter on each slice,then sprinkle with colored candies', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (506, 'pancakes in a bowl', 'easy', '3 min', 'combine the bisquick heart smart and water or milk,stir well,microwave on high for 2 minutes,top with powdered sugar , syrup , fruit , or whatever you would like !', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (507, 'pantry raid chicken enchilada casserole', 'easy', '60 min', 'preheat the oven to 375 degrees f,grease a 9x9-inch baking dish,mix tomato sauce , water , taco seasoning mix , and chili powder together in a saucepan,bring to a simmer over medium heat,heat vegetable oil in a skillet over medium heat and brown chicken tenderloins on both sides , about 5 minutes per side,pour tomato sauce mixture over the chicken , bring to a simmer , and cook over medium-low heat until chicken tenderloins are no longer pink inside , about 8 minutes,transfer chicken to a bowl and shred,return shredded chicken to the sauce,mix in black beans and cream cheese until thoroughly combined,pour chicken mixture into prepared baking dish,top with shredded mexican cheese,whisk corn bread mix , egg , and milk in a bowl , and spoon the batter over the chicken mix,bake in the preheated oven until the casserole is bubbling and the corn bread topping is browned and set , about 30 minutes', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (508, 'payday candy bar squares', 'easy', '10 min', 'put half the peanuts in lightly greased 11x7 pan,melt butter and chips on low,remove from heat,add milk and marshmallows,stir well,pour over peanuts,sprinkle with remaining peanuts,chill and cut into bars', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_recipes` VALUES (509, 'peanut butter jam sandwich muffins', 'easy', '30 min', 'preheat oven to 400f,beat egg , 1 cup peanut butter and the oil in large bowl with wire whisk until well blended,add sugar,mix well,gradually add milk , mixing well after each addition,set aside,mix flour , baking powder , baking soda and salt,add to peanut butter mixture,stir just until moistened,spoon enough batter into each of 12 greased muffin cups to cover bottom of cup,spoon 1 / 2 teaspoons each of the jam and remaining 2 tablespoons peanut butter over batter in cups,cover evenly with batter,bake 15 minutes , or until lightly browned,cool in pan 5 minutes,remove to wire rack,cool completely,variation: prepare as directed , using your favorite flavor of jam and variety of peanut butter', '2025-10-05 13:35:12', '2025-10-05 13:35:12', NULL);
INSERT INTO `re_user_collect_recipe` VALUES (1, 10, 0, 4, '2025-10-08 17:55:32', '2025-10-08 23:23:20', NULL);
INSERT INTO `re_user_collect_recipe` VALUES (1, 12, 1, 5, '2025-10-08 17:55:59', '2025-10-08 17:55:59', NULL);
INSERT INTO `re_user_collect_recipe` VALUES (1, 14, 0, 6, '2025-10-08 17:56:04', '2025-10-08 23:23:37', NULL);
INSERT INTO `re_user_collect_recipe` VALUES (1, 11, 1, 7, '2025-10-08 23:23:27', '2025-10-08 23:23:27', NULL);
INSERT INTO `re_user_ingredients` VALUES (7, 1, 1, 21, 'beef', '2025-10-05 18:32:14', '2025-10-08 17:11:44', NULL);
